INSERT INTO `app_help_page` (`id`, `title`, `text`) VALUES
(1, 'Что купить выгоднее? ', 'При покупке доступа к бОльшему количеству видео и на более продолжительный срок Вы получаете скидку - 50% от стоимости!'),
(2, 'Какие тарифы существуют? ', 'Тариф «Серебряный» - позволяет приобрести выбранный Вами материал для просмотра на 3 суток. После окончания этого срока просмотр материала будет недоступен. \nТариф «Золотой»  - позволяет приобрести выбранный Вами материал для просмотра на 30 суток. После окончания этого срока просмотр материала будет недоступен. \nТариф «Бриллиантовый» - позволяет приобрести выбранный Вами материал для просмотра на 300 суток. После окончания этого срока просмотр материала будет недоступен. При покупке данного тарифа вы получаете скидку более 50%. '),
(3, '\"Мне это сейчас не по карману...\"', 'Понимаем Ваши опасения относительно цены. У нас есть доступ к бесплатным материалам, к которым Вы имеете доступ, а также есть возможность заработать Бебикоины, рекомендуя наше приложение знакомым. Эти монеты можно потратить на покупку видео.'),
(4, '\"Я не уверен/а в качестве контента.\" ', 'Мы стремимся предоставить только качественный и проверенный материал от экспертов в области материнства и родительства. Также, возможно, бесплатные материалы и отзывы других пользователей помогут Вам убедиться в этом'),
(5, ' \"Уже есть много бесплатной информации в интернете.\" ', 'Согласны, информации в интернете много, но ее качество и достоверность зачастую оставляет желать лучшего. Мы ультрафильтруем информацию и предоставляем только проверенные и актуальные материалы от экспертов.'),
(6, ' \"Я не уверен/а, что смогу все регулярно смотреть.\"', 'Наше приложение предоставляет гибкость в просмотре видео. Вы можете смотреть их в любое удобное для вас время и месте. Оно будет доступно в Вашем аккаунте на срок, выбранный по тарифу при покупке. '),
(7, '\"Мне кажется, это не так уж и важно.\" ', 'Это полностью нормально иметь такое ощущение, но на самом деле знание и подготовка к важным этапам родительства может дать Вам уверенность и помочь избежать многих проблем. Давайте дадим шанс одному из наших бесплатных материалов, чтобы Вы могли убедиться в этом.'),
(8, 'Что такое реферальная программа?', 'Реферальная программа – это накопительная бонусная программа, позволяющая зарегистрированному Посетителю получить бонусные баллы (бебикоины) за использование платного доступа к ресурсам веб-сайта и оплатить этими баллами новый и/или дополнительный платный доступ к тем или иным ресурсам веб-сайта, а так же получить реферальное вознаграждение.\nРеферальное вознаграждение - средства, которые партнер получает в виде определенных процентов от сумм заработков или трат его рефералов. \nРеферал - участник реферальной программы, зарегистрировавшийся по рекомендации другого участника.');
INSERT INTO `app_info` (`id`, `agreement_title`, `agreement_text`, `recommended_title`, `recommended_subtitle`, `lectures_catalog_title`, `lectures_catalog_subtitle`, `out_lectors_title`, `not_viewed_yet_title`, `more_in_the_collection`, `about_lector_title`, `diplomas_title`, `lectors_videos`, `app_title`, `about_app`, `app_author_name`, `app_link_share_title`, `app_link_share_link`, `app_show_qr_title`, `tarif_title_1`, `tarif_title_2`, `tarif_title_3`, `free_lecture_hours`, `validation_wrong_credentials`, `reset_code_sent`, `added_to_saved`, `removed_from_saved`, `added_to_watched`, `removed_from_watched`, `message_sent`, `message_sent_error`, `thanks_for_rate`, `thanks_for_feedback`, `successful_purchase_text`, `buy_page_under_btn_description`, `buy_page_description`, `buy_category`, `buy_subcategory`, `view_schedule`, `watched_already`, `next_free_lecture_available_at`, `buy_all`, `watch_from`, `chosen_category_contains_lectures`, `your_profit_is_roubles`, `ref_system_title`, `ref_system_description`, `successful_purchase_image`, `user_invites_you_to_join`, `ref_system_preview_picture`, `category_special_price_text`, `credit_minimal_sum`) VALUES
(1, 'Прочтите лицензионное соглашение тут', '<p><strong>Соглашение об использовании ресурсов веб-сайта (пользовательское соглашение)</strong></p><p>Настоящее Соглашение заключается между Обществом с ограниченной ответственностью «Гиппократ ФИН» (ОГРН 1217700388047, ИНН 9721140346, адрес местонахождения: 109542, Россия, г. Москва, Муниципальный округ Выхино-Жулебино, пр-кт Рязанский, д. 91 к. 1, этаж 1 пом. 11, ком. 1 офис 316), далее «Владелец веб-сайта», и Посетителем веб-сайта, далее «Посетитель», определяет условия использования Посетителем инструкций, справочников и материалов, размещенных в информационно-телекоммуникационной сети Интернет по адресу: <a href=\"https://roddom.vip\"><span style=\"text-decoration: underline;\">https://roddom.vip</span></a> и <a href=\"https://roddom.vip/\"><span style=\"text-decoration: underline;\">https://roddom1.vip</span></a> , иных информационно-телекоммуникационных пространствах, где используется доменное имя&nbsp; roddom.vip, roddom1.vip и его любые поддомены, далее «веб-сайт», и является публичной офертой.<br>&nbsp;</p><p><strong>1.</strong>&nbsp; &nbsp; &nbsp; <strong>Термины и определения.</strong></p><p>&nbsp;1.1. Веб-сайт — совокупность веб-страниц в информационно-телекоммуникационной сети «Интернет», расположенных по адресу: <a href=\"https://roddom.vip\"><span style=\"text-decoration: underline;\">https://roddom.vip</span></a> , <a href=\"https://roddom.vip/\"><span style=\"text-decoration: underline;\">https://roddom1.vip</span></a><span style=\"text-decoration: underline;\"> </span>и всех их поддоменах, функционал которых позволяет Посетителю зарегистрироваться на веб-сайте, перейти на страницы платежных сервисов, предоставляемых третьими лицами для оплаты доступа, а также получить доступ к его ресурсам (инструкциям, справочникам и материалам).&nbsp;</p><p>1.2. Посетитель – любое дееспособное физическое лицо, которое намерено использовать ресурсы веб-сайта на условиях настоящего Соглашения.&nbsp;</p><p>1.3. Инструкция — совокупность правил и набор действий, необходимых для выполнения и получения определенного результата, описанных на одной или нескольких страницах веб-сайта.&nbsp;</p><p>1.4. Справочник — набор различных данных, опубликованных Владельцем на его веб-сайте (на одной или нескольких страницах), связанных между собой каким-либо признаком (например, категории состояний).&nbsp;</p><p>1.5. Материалы – материалы, представленные в формате видео- и/или аудиозаписи, в виде фотографий, иных изображений, таблиц, схем, диаграмм, а также в любых текстовых форматах, содержащие информационный ресурс, предназначенный для Посетителей веб-сайта.&nbsp;</p><p>1.6. Открытая часть веб-сайта — совокупность страниц веб-сайта, которая доступна Посетителю после регистрации с возможностью получения отдельных бесплатных материалов.&nbsp;</p><p>1.7. Закрытая часть веб-сайта — совокупность страниц веб-сайта, которая доступна Посетителю только после его регистрации на веб-сайте с использованием личного адреса электронной почты Посетителя и оплаты им доступа к веб-сайту в соответствии с выбранным тарифом.&nbsp;</p><p>1.8. Адрес электронной почты Посетителя — адрес электронной почты, указанный Посетителем при регистрации и используемый для доступа на веб-сайт и получения рассылок Владельца веб-сайта.&nbsp;</p><p>1.9. Доступ к веб-сайту – использование Посетителем инструкций, справочников и материалов (далее также – «ресурсы»), размещенных на страницах веб-сайта, в соответствии с настоящим Соглашением на условиях простой (неисключительной) лицензии.&nbsp;</p><p>Доступ к ресурсам, размещенным на веб-сайте, в зависимости от объема и сроков использования может быть платный и бесплатный.</p><p>1.10. Платный доступ к веб-сайту – срочный доступ Посетителя к веб-сайту на условиях простой (неисключительной) лицензии, исходя из выбранного им тарифа.</p><p>1.11. Несанкционированный доступ к веб-сайту - использование и распространение инструкций, справочников и материалов, размещенных на веб-сайте (полностью или в части) с нарушением условий настоящего Соглашения и положений применимого гражданского законодательства. Несанкционированным доступом к веб-сайту также является использование учетной записи зарегистрированного Посетителя третьими лицами в отсутствие письменного согласия Владельца веб-сайта.&nbsp;</p><p>1.12. Тариф — установленная Владельцем веб-сайта стоимость доступа к определенному объему ресурсов на конкретный период времени.&nbsp;</p><p>1.13. Реферальная программа – накопительная бонусная программа лояльности Владельца веб-сайта, позволяющая зарегистрированному Посетителю получить бонусные баллы (бебикоины) за использование платного доступа к ресурсам веб-сайта и/или за использование платного доступа к ресурсам веб-сайта и оплатить этими баллами новый и/или дополнительный платный доступ к тем или иным ресурсам веб-сайта, либо получить реферальное вознаграждение.</p><p>1.14. Определения и термины, перечисленные в п.п. 1.1-1.13 Соглашения, распространяются на все приложения и дополнения, а также договоры и соглашения, заключенные Сторонами в связи с использованием любых ресурсов веб-сайта.&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>2. Предмет Соглашения</strong></p><p>2.1. Владелец веб-сайта на условиях настоящего Соглашения и простой (неисключительной) лицензии предоставляет Посетителю право на использование доступа к инструкциям, справочникам и материалам, размещенным на веб-сайте, исходя из выбранного Посетителем тарифа.</p><p>&nbsp;</p><p><strong>3. Общие положения.</strong></p><p>3.1. Владелец веб-сайта является его администратором и правообладателем.</p><p>3.2. Использование веб-сайта Посетителем подтверждает его согласие со всеми условиями настоящего Соглашения без каких-либо изменений и изъятий, а также с условиями, содержащимися в иных документах (договорах, соглашениях, правилах, политиках, процедурных документах, инструкциях, тарифах и т.д.), которые размещены и/или могут быть опубликованы Владельцем веб-сайта в порядке, установленном Соглашением.&nbsp;</p><p>3.3. Получая доступ или используя любую часть веб-сайта, Посетитель соглашается соблюдать условия настоящего Соглашения. Если Посетитель не согласен со условиями Соглашения (полностью или в части), то он не может получить доступ к веб-сайту и использовать какие-либо ресурсы.&nbsp;</p><p>3.4. Веб-сайт доступен только лицам старше 18 лет.&nbsp;</p><p>3.5. Доступ к инструкциям, справочникам и материалам не наделяет Посетителя правом копирования, записи, сохранения их целиком или их отдельных элементов в памяти любого устройства.&nbsp;</p><p>3.6. Доступ к инструкциям, справочникам и материалам предоставляется Посетителю на условиях абонентского договора (ст.429.4 ГК РФ), исходя из выбранного и оплаченного Посетителем тарифа.&nbsp;</p><p>Если в течение предусмотренного тарифом срока Посетитель не воспользуется правом доступа к инструкциям, справочникам и материалам, внесенная Посетителем плата за такое право доступа возврату не подлежит.&nbsp;</p><p>Доступ к размещенным на веб-сайте ресурсам предоставляется Посетителю исключительно для индивидуального использования.&nbsp;</p><p>Предоставление Посетителем доступа к инструкциям, справочникам и материалам и/или их частям третьим лицам или размещение таких данных в открытом доступе не допускается.&nbsp;</p><p>В случае приобретения режима доступа в подарок, одаряемое лицо, получив доступ к ресурсам веб-сайта, становится стороной настоящего Соглашения и получает право индивидуального доступа к инструкциям, справочникам и материалам посредством Премиум-доступа, а лицо, подарившее доступ, теряет право на Премиум-доступ.&nbsp;</p><p>3.7. Посетитель подтверждает и гарантирует, что информация, предоставленная им при регистрации на веб-сайте, является корректной и актуальной и самостоятельно несет риск возникновения неблагоприятных последствий вследствие предоставления им некорректной и/или неактуальной информации.&nbsp;</p><p>3.8. Все действия, совершаемые Посетителем в рамках Соглашения с помощью функционала веб-сайта, считаются и признаются действиями, совершенными непосредственно Посетителем.&nbsp;</p><p>3.9. Доступ к веб-сайту возможен только при наличии у Посетителя доступа к информационно-телекоммуникационной сети Интернет.&nbsp;</p><p>Для бесперебойного доступа к ресурсам веб-сайта Посетителю необходимо самостоятельно обеспечить надлежащее качество доступа к информационно-телекоммуникационной сети Интернет.&nbsp;</p><p>3.10. Ресурсы, размещенные на веб-сайте, не являются учебными материалами, не предназначены для использования в медицинских целях и носят исключительно информационный характер.&nbsp;</p><p>Правоотношения Сторон, регулируемые настоящим Соглашением, не связаны с оказанием медицинских и опосредованных с медицинской сферой консультационных услуг.&nbsp;</p><p>Изучение инструкций, справочников и материалов, представленных на веб-сайте, не является ни учебным процессом, ни медицинскими консультациями.</p><p>3.11. Ресурсы, размещенные на веб-сайте, могут быть подготовлены Владельцем веб-сайта с привлечением специалистов и экспертов, обладающих специальными познаниями в той или иной области. В отношении указанных ресурсов Владелец веб-сайта не дает никаких гарантий относительно действительности содержания, несмотря на прилагаемые усилия по проверке актуальности и точности содержания.&nbsp;</p><p>В случае, если в своих выступлениях/презентациях привлеченные специалисты и эксперты используют наглядные материалы/изображения, на них возлагается обязанность по соблюдению авторских прав в отношении таких материалов/изображений. При выявлении признаков нарушений авторских прав, в том числе после обращения сторонних лиц с информацией о данном факте, Владелец веб-сайта самостоятельно организует проверку факта нарушения авторских прав и направляет соответствующий запрос специалисту/эксперту для устранения любого допущенного нарушения. &nbsp;</p><p><br></p><p><strong>4. Права и обязанности Сторон</strong></p><p>4.1. Владелец веб-сайта обязуется:&nbsp;</p><p>4.1.1. Предоставить Посетителю доступ к размещенным на веб-сайте ресурсам в соответствии с выбранным тарифом;</p><p>4.1.2. Выполнять иные обязательства, предусмотренные применимым гражданским законодательством и настоящим Соглашением.</p><p>4.2. Владелец веб-сайта вправе:&nbsp;</p><p>4.2.1. Приостановить предоставление доступа к веб-сайту по техническим и иным причинам, препятствующим нормальной работе веб-сайта (например, в связи с проведением технических работ сторонними организациями, оказывающими услуги хостинга Владельцу веб-сайта), на время устранения таких причин;&nbsp;</p><p>4.2.2. Приостановить предоставление доступа к закрытой части веб-сайта сроком на 1 (один) месяц в случае выявления Владельцем веб-сайта однократного несанкционированного доступа к ресурсам веб-сайта в результате действий Посетителя либо неисполнения обязательств, перечисленных в п.п. 4.3.1-4.3.12 настоящего Соглашения, уведомив Посетителя об этом в трехдневный срок с момента приостановления доступа;</p><p>4.2.3. Прекратить предоставление доступа к закрытой части веб-сайта в случае выявления Владельцем веб-сайта повторного несанкционированного доступа к ресурсам веб-сайта в результате действий Посетителя либо неоднократного нарушения обязательств, перечисленных в п.п. 4.3.1-4.3.12 настоящего Соглашения, уведомив его об этом в трехдневный срок с момента прекращения доступа;</p><p>4.2.4. В одностороннем порядке отказаться от исполнения Соглашения в порядке, предусмотренном разделом 7 Соглашения.&nbsp;</p><p>4.2.5. В любое время без специального уведомления и по своей инициативе производить обновление любых веб-страниц на веб-сайте.&nbsp;</p><p>4.2.6. В целях улучшения и развития функционала веб-сайта Владелец веб-сайта вправе анализировать сообщения Посетителя, получаемые Владельцем веб-сайта от Посетителя по любым каналам связи и любым способом.&nbsp;</p><p>4.3. Посетитель обязуется:</p><p>4.3.1. При регистрации на веб-сайте предоставить Владельцу веб-сайта: корректную и полную информацию о себе, а также корректный и актуальный адрес электронной почты.&nbsp;</p><p>4.3.2. Обеспечивать и соблюдать конфиденциальность доступа к закрытой части веб-сайта посредством указанного при регистрации личного адреса электронной почты и предотвращать доступ к этой части веб-сайта третьих лиц;</p><p>4.3.3. Осуществлять доступ к ресурсам веб-сайта исключительно в соответствии с их целевым назначением, установленным Соглашением;</p><p>4.3.4. Не продавать, не переуступать, не распространять, не передавать в пользование или иным образом предоставлять права на доступ к веб-сайту, полученные Посетителем в рамках настоящего Соглашения, третьим лицам, за исключением случая приобретения Премиум-доступа в подарок;</p><p>4.3.5. При компрометации или подозрении на компрометацию доступа к закрытой части веб-сайта посредством указанного при регистрации личного адреса электронной почты незамедлительно уведомить об этом Владельца веб-сайта;</p><p>4.3.6. Оплатить доступ к веб-сайту, исходя из выбранного тарифа;</p><p>4.3.7. В случае использования ресурсов закрытой части веб-сайта третьими лицами посредством указанного при регистрации личного адреса электронной почты Посетителя до момента уведомления Владельца веб-сайта о компрометации доступа указанные ресурсы веб-сайта считаются полученными Посетителем и оплачиваются им Владельцу веб-сайта в полном объеме;&nbsp;</p><p>4.3.8. Не использовать веб-сайт и размещенные на нем материалы для нарушения прав третьих лиц, а также для целей, противоречащих применимому законодательству или Соглашению;</p><p>4.3.9. Исключить любым образом доступ третьих лиц к закрытой части веб-сайта посредством указанного при регистрации личного адреса электронной почты;</p><p>4.3.10. Не выдавать сублицензии, не продавать, не переуступать, не передавать в пользование, не распространять, не тиражировать, не перерабатывать или иным образом не предоставлять права на использование любых инструкций, справочников и материалов, размещенных на веб-сайте, а также не копировать, не сохранять и не записывать их;</p><p>4.3.11. Не нарушать функционирование веб-сайта, не использовать веб-сайт для предложения товаров/услуг, для рассылки спам-сообщений или общения, не связанного с обсуждением информации, полученной в рамках доступа к инструкциям, справочникам и материалам;</p><p>4.3.12. Не нарушать иные условия Соглашения и применимого гражданского законодательства;</p><p>4.3.13. Не использовать представленные на веб-сайте ресурсы в качестве каких бы то ни было самостоятельных или с помощью третьих лиц лечебных пособий, инструкций к действию без очной консультации медицинских и иных специалистов, если они требуются.&nbsp;</p><p>4.4. Посетитель вправе:&nbsp;</p><p>4.4.1. Получать доступ к открытой и закрытой части веб-сайта на условиях настоящего Соглашения;</p><p>4.4.2. В одностороннем порядке отказаться от исполнения Соглашения в порядке, предусмотренном разделом 7 Соглашения.&nbsp;</p><p><br>&nbsp;<strong>5. Вознаграждение за платный доступ к веб-сайту, возврат вознаграждения</strong></p><p>&nbsp;5.1. Вознаграждение за предоставление Посетителю доступа к закрытой части веб-сайта, справочникам, инструкциям и материалам рассчитывается и оплачивается в соответствии с условиями тарифа и формируется из: лицензионного вознаграждения за предоставление права использования инструкций, справочников и материалов.</p><p>5.2. Доступ к закрытой части веб-сайта подлежит оплате посредством платежных систем и/или сервисов, информация о которых доступна на веб-сайте.&nbsp;</p><p>5.3. Для получения доступа к закрытой части веб-сайта такой доступ должен быть предварительно оплачен Посетителем в полностью или частично (на условиях предоплаты) в сумме, определенной Сторонами по тарифу, действующему на дату оплаты.&nbsp;</p><p>5.4. Лицензионное вознаграждение за предоставление права использования инструкций, справочников и материалов не подлежит возврату с момента предоставления Посетителю доступа для просмотра инструкций, справочников и материалов на выбранном и оплаченном им тарифе.&nbsp;</p><p>5.5. Все без исключения возвраты денежных средств Посетителю, если это предусмотрено настоящим Соглашением или иным образом согласовано Сторонами, перечисляются за вычетом комиссий платежных систем и/или сервисов, посредством которых Посетитель оплачивал доступ к ресурсам на веб-сайте.&nbsp;</p><p>Возврат денежных средств, оплаченных Посетителем, производится тем же способом, что и их оплата, если иное не согласовано Сторонами.</p><p>&nbsp;</p><p><strong>6. Ответственность Сторон. Урегулирование споров</strong></p><p>&nbsp;6.1. За неисполнение либо ненадлежащее исполнение обязательств Стороны несут ответственность в соответствии с применимым гражданским законодательством и условиями настоящего Соглашения.&nbsp;</p><p>6.2. Владелец веб-сайта не несет ответственность за невозможность использования веб-сайта Посетителем.&nbsp;</p><p>6.3. В случае отсутствия у Посетителя возможности использовать веб-сайт по вине Владельца веб-сайта, последний увеличивает срок доступа Посетителя к закрытой части веб-сайта на количество дней, в течение которых у Посетителя отсутствовала возможность использовать веб-сайт.&nbsp;</p><p>6.4. Владелец веб-сайта предпринимает все разумные меры и осуществляет любые целесообразные действия, направленные на обеспечение сохранности конфиденциальных данных Посетителя и поддержание работоспособности веб-сайта. Владелец веб-сайта не несет ответственность за доступ третьих лиц к закрытой части веб-сайта посредством указанного при регистрации личного адреса электронной почты Посетителя, если это стало возможным вследствие компрометации учетных данных Посетителя, предоставлении Посетителем доступа таким лицам или несанкционированного доступа таких лиц к техническим устройствам, посредством которых Посетитель осуществлял доступ к закрытой части веб-сайта.&nbsp;</p><p>6.5. Посетитель несет ответственность:</p><p>6.5.1. За выдачу сублицензий, продажу, уступку, передачу в пользование, распространение, тиражирование, копирование, переработку или передачу прав на использование и дальнейшее распространение ресурсов, размещенных на веб-сайте;</p><p>6.5.2. За предоставление третьим лицам доступа к закрытой части веб-сайта посредством указанного при регистрации личного адреса электронной почты.&nbsp;</p><p>При обнаружении нарушений, указанных в настоящем пункте Соглашения, Владелец веб-сайта вправе приостановить и в дальнейшем прекратить доступ Посетителя к закрытой части веб-сайта (п.п. 4.2.2, 4.2.3 Соглашения), а также требовать от Посетителя уплаты штрафа в размере 100 000 (Сто тысяч) рублей за каждое правонарушение.&nbsp;</p><p>6.6. В случае возникновения споров, связанных с осуществлением Посетителем доступа к закрытой части веб-сайта, связанных с предоставлением Посетителем некорректной информации, нарушении им прав третьих лиц или ином нарушении применимого гражданского законодательства, Посетитель обязуется при получении уведомления от Владельца веб-сайта выступить на стороне Владельца сайта, оказать Владельцу веб-сайта полное содействие при урегулировании претензий с третьими лицами, по запросу Владельца веб-сайта предоставить необходимую Владельцу веб-сайта информацию, а в последствии (в случае если на основании вступившего в законную силу судебного решения или акта уполномоченного органа государственной власти или, если по согласованию с Владельцем веб-сайта будет признано приемлемым возместить убытки во внесудебном порядке) возместить Владельцу веб-сайта в полном объеме понесенные им убытки, включая разумные и обоснованные расходы и издержки.&nbsp;</p><p>6.7. Все споры и разногласия, возникающие из Соглашения или в связи с ним, в том числе касающиеся его исполнения, нарушения, прекращения или недействительности, будут разрешаться путем переговоров. В случае недостижения согласия в ходе переговоров, заинтересованная сторона направляет другой стороне претензию, подписанную уполномоченным лицом. К претензии заинтересованной Стороной прилагаются документы и обоснования заявленных в претензии требований, а также документы, подтверждающие полномочия лица, подписавшего претензию. Сторона, получившая претензию, обязана рассмотреть ее в течение 10 (десяти) рабочих дней со дня ее получения и сообщить о результатах рассмотрения другой стороне. В случае неурегулирования спорных вопросов в претензионном порядке, а также в случае неполучения ответа на претензию в течение указанного срока, спор будет разрешаться в судебном порядке в соответствии с законодательством Российской Федерации в суде по месту нахождения Владельца веб-сайта (г. Москва), язык судопроизводства — русский.&nbsp;</p><p>&nbsp;</p><p><strong>7. Заключительные положения</strong></p><p>&nbsp;7.1. Владелец веб-сайта обрабатывает персональные данные Посетителя в целях реализации прав и исполнения обязанностей по настоящему Соглашению, а именно: осуществляет сбор, запись, систематизацию, накопление, хранение, уточнение, использование, блокирование, удаление, уничтожение, распространение данных, а именно: фамилия, имя, отчество Посетителя, адрес электронной почты Посетителя, регион проживания (страна, область, город), страна гражданства, состав и количественный состав семьи (при необходимости), прочая личная информация, требуемая для подбора Посетителю комфортного сценария подачи наиболее соответствующих ему материалов, для конкретных инструкций, комментарии Посетителя, данные, полученные посредством веб-сайта и/или направленные в адрес Владельца веб-сайта посредством почтовых сервисов. В случае получения согласия Посетителя, фотографии и/или комментарии Посетителя могут быть размещены Владельцем веб-сайта в информационно-телекоммуникационной сети Интернет в том числе для привлечения внимания третьих лиц к веб-сайту, при этом какое-либо вознаграждение за размещение указанных материалов Посетителю не выплачивается. Владелец веб-сайта обязуется осуществлять обработку персональных данных Посетителя, а также обеспечить конфиденциальность и защиту обрабатываемых персональных данных в соответствии с требованиями Федерального закона от 27.07.2006 года No 152-ФЗ «О персональных данных». При обработке персональных данных Владелец веб-сайта принимает необходимые правовые, организационные и технические меры для защиты получаемых от Посетителя персональных данных от неправомерного или случайного доступа к ним, уничтожения, изменения, блокирования, копирования, предоставления, распространения персональных данных, а также от иных неправомерных действий в отношении обрабатываемых персональных данных Посетителя. После достижения целей обработки персональных данных Посетителя или по личному запросу Посетителя они удаляются Владельцем веб-сайта. Посетитель дает согласие на хранение и использование Владельцем веб-сайта результатов прохождения Посетителем по инструкциям, переписки с Владельцем веб-сайта и другими Посетителями в любом виде для улучшения качества инструкций и справочников и разработки новых инструкций и справочников. Действие Соглашения распространяется на все последующие обновления/новые версии веб-сайта, если такое обновление не сопровождается заключением нового договора или соглашения.&nbsp;</p><p>7.2. Любые уведомления и иные юридически значимые сообщения могут быть направлены Посетителю Владельцем веб-сайта на адрес электронной почты Посетителя с любого адреса электронной почты Владельца веб-сайта, содержащего доменное имя roddom.vip. Такие сообщения считаются полученными Посетителем и влекут для него правовые последствия с момента доставки на адрес электронной почты Посетителя (на сервер почтовой службы Посетителя). Посетитель дает согласие на получение по адресу электронной почты Посетителя сервисных сообщений, относящихся к инструкциям и справочникам. Посетитель дает согласие на получение по адресу электронной почты Посетителя маркетинговых сообщений от Владельца веб-сайта о его продуктах и услугах и/или продуктах или услугах третьих лиц. Посетитель вправе отказаться от получения таких сообщений путем изъявления своего желания через использование пункта «Хочу отписаться», содержащегося в каждом письме, направленном на адрес электронной почты Посетителя Владельцем веб-сайта.&nbsp;</p><p>7.3. Владелец сайта вправе вносить изменения в Соглашение в одностороннем порядке.&nbsp;</p><p>Условия Соглашения в новой редакции публикуются на веб-странице по адресу: https://roddom.vip/termins.html и вступают в силу через 10 (десять) календарных дней с даты публикации, если иное не оговорено в соответствующей публикации.&nbsp;</p><p>7.4. Посетитель обязуется перед каждым доступом к закрытой части веб-сайта проверять редакцию Соглашения, опубликованную по адресу https://roddom.vip/termins.html для отслеживания изменений.&nbsp;</p><p>7.5. Владелец веб-сайта вправе вносить изменения в Тариф в одностороннем порядке.&nbsp;</p><p>Тариф Владельца веб-сайта в новой редакции публикуется на веб-сайте и, если иное не оговорено в соответствующей публикации, вступает в силу с даты публикации.&nbsp;</p><p>В отношении оплаченного Посетителем режима доступа применяются условия Соглашения и тарифы, действовавшие на момент оплаты соответствующего режима доступа.&nbsp;</p><p>Если в период оплаченного Посетителем режима доступа им приобретается дополнительный доступ к ресурсам веб-сайта, оплата такого доступа производится по тарифам, действующим на дату приобретения; в отношении такого дополнительного доступа применяются положения Соглашения в редакции на дату приобретения дополнительного доступа к веб-сайту. &nbsp;</p><p>7.6. Каждая из Сторон вправе отказаться от Соглашения в одностороннем внесудебном порядке путем направления уведомления другой Стороне по адресу ее места нахождения или по адресу электронной почты Посетителя/ адресу электронной почты Владельца веб-сайта в срок не менее чем за 10 (десять) календарных дней до соответствующей даты прекращения Соглашения. Соглашение также может быть расторгнуто по соглашению Сторон.&nbsp;</p><p>7.7. К правам и обязанностям Посетителя и Владельца веб-сайта из настоящего Соглашения вне зависимости от места нахождения Владельца веб-сайта или Посетителя подлежит применению законодательство Российской Федерации.&nbsp;</p><p>7.8. В случае прекращения действия Соглашения Посетитель обязан незамедлительно прекратить доступ к закрытой части веб-сайта.&nbsp;</p><p>7.9. Соглашение действует с даты принятия Посетителем условий Соглашения в порядке, определенном в Соглашении, до полного исполнения обязательств Сторон.&nbsp;</p>', 'Рекомендуем', 'Не пропустите новые лекции!', 'Каталог лекций', 'Выберите тему, которая вас интересует', 'Наши специалисты', 'Вы ещё не смотрели', 'Ещё в подборке на эту тему', 'О лекторе', 'Дипломы и сертификаты', 'Видео от лектора', 'Школа Мам и Пап', '<p><strong>Школа Мам и Пап&nbsp;</strong>- это уникальная платформа, созданная специально для мам и пап, которые хотят получить ценные знания и навыки в области родительства. Наша школа предлагает широкий выбор видео, которые помогут вам стать лучшими родителями, успешно пройти этап беременности и родов, грудного вскармливания и создать гармоничные отношения в семье с Вашими детьми.&nbsp;</p>', 'ООО Гиппократ-Фин', 'Поделиться ссылкой', 'https://roddom1.vip', 'Показать QR-код', 'Тариф \"Серебряный\"', 'Тариф \"Золотой\"', 'Тариф \"Бриллиантовый\"', 5, 'Неправильный логин/пароль. Повторите попытку.', 'Код для подтверждения регистрации отправлен на указанную почту. Проверьте папку \"спам\" если он не пришел. Иногда это бывает. Приложение принадлежит ООО Гиппократ-Фин ', 'Добавили в «Сохранённые»', 'Удалили из «Сохранённых»', 'Добавили в «Просмотренные»', 'Удалили из «Просмотренных»', 'Ваше сообщение успешно отправлено. Напоминаем что мы не вступаем в переписку и не оказываем дистанционные консультации. ', 'Во время отправки сообщения произошла ошибка.', 'Спасибо за вашу оценку!', 'Спасибо за обратную связь! Ваше сообщение успешно отправлено. Мы не оказываем дистанционные консультации. ', '<h3>Уважаемый пользователь!</h3><h3>Благодарим Вас за приобретение доступа к видеоматериалу в мобильном приложении \"Школа мам и пап. Мы высоко ценим Ваше доверие и выбор нас в качестве источника надежной и полезной информации. Наша миссия - предоставить Вам только самый актуальный, экспертного уровня контент, который будет Вам полезен и доступен в любом месте в удобное для Вас время.&nbsp;<br><br>Напоминаем Вам, что Вы можете получить доступ ко всем нашим материалам абсолютно бесплатно благодаря участию в нашей партнерской реферальной программе. Достаточно просто рекомендовать наше приложение своим знакомым будущим мамам - а за их покупки и покупки тех, кому они рекомендуют наше приложение, Вам будут начисляться Бебикоины, которые можно потратить на приобретение доступа к видеоматериалу. Даже за установку нашего приложения приглашенным Вами человеком Вы (как и он) получите по 500 Бебикоинов каждый!</h3><p><br></p><h3>Количество начисленных Бебикоинов, Вы всегда можете&nbsp; проверить в своем личном кабинете в разделе \"Партнерская программа\".&nbsp;<br><br>Также мы хотели бы напомнить Вам, что при покупке доступа к бОльшему количеству видео и на более продолжительный срок Вы получаете скидку - 50% от стоимости!&nbsp;<br>При желании Вы можете приобрести доступ ко всем материалам сразу с оплатой в рассрочку (https://roddom1.vip/catalog_prices/) - все немедленно будет доступно для Вас на 300 дней (рекомендуемый срок приобретения доступа)! Срок рассрочки и удобный график и размер оплаты рассрочки Вы выбирает сами!</h3><h3><br>Мы надеемся, что Вам понравится выбранный видеоматериал и он принесет Вам максимальную пользу в этот важный период жизни. Мы всегда рады помогать Вам на каждом этапе родительства!</h3><p>Приложение принадлежит ООО \"Гиппократ Фин\" и не связано ни с какой иной организацией</p>', 'Выбранный материал будет доступен Вам для просмотра в течение x дня(ей) с момента покупки.', 'Вы можете приобрести доступ к этому материалу(ам) на необходимый Вам промежуток времени. По его окончанию просмотр видео будет невозможен. Покупка на бОльший срок и в бОльшем количестве более выгодна - скидка может превысить 50% от стандартной стоимости!', 'Купить все материалы категории оптом со скидкой', 'Купить все материалы подкатегории со скидкой', 'График просмотра', 'Вы уже посмотрели бесплатный материал на сегодня.', 'Следующий бесплатный просмотр будет доступен через', 'Купить все материалы каталога со скидкой', 'Смотреть от', 'Выбранная категория содержит x лекции (й).', 'При покупке всех материалов в выбранной группе оптом Ваша экономия составит x рублей. Для покупки можно использовать Бебикоины, имеющиеся на Вашем счету в приложении. ', 'Реферальная (партнерская) программа ', '<p><strong>Реферальная (партнерская) программа </strong>– это накопительная бонусная программа лояльности, позволяющая вам получить бонусные баллы (бебикоины) за собственное использование платного доступа к ресурсам веб-сайта или за использование платного доступа к ресурсам веб-сайта ваших приглашенных рефералов*. И оплатить этими баллами новый и/или дополнительный платный доступ к ресурсам веб-сайта, либо получить реферальное вознаграждение.</p><p><em>*Реферал - участник реферальной программы, зарегистрировавшийся по рекомендации другого участника.</em></p>', 'images/app/successful_purchase_image.jpeg', 'x приглашает Вас присоединиться к интересным материалам Школы Мам и Пап! В качестве бонуса Вам будет начислено 500 Бебикоинов!', 'images/app/ref_system_preview_picture.png', 'Вы также можете приобрести доступ ко всем материалам (более 150 видео) на 300 дней со скидкой более 50% - и все видео будут доступны сразу на 300 дней (рекомендуется) с просмотром в удобное время по любой теме. Оплата (в рассрочку) от 3500 рублей в месяц.', 5000);
