INSERT INTO `lectors` (`id`, `name`, `position`, `description`, `career_start`, `photo`, `created_at`, `updated_at`) VALUES
(27, 'Анна Сергеевна Шинкевич', 'Врач акушер-гинеколог, эксперт по грудному вскармливанию, врач УЗИ ', '<p>\"... я врач акушер-гинеколог и уже несколько лет являюсь консультантом по грудному вскармливанию. Имею опыт организации грудного вскармливания в родильном доме, активно консультирую женщин в очном и онлайн форматах. Так же имею собственный опыт кормления грудью. Как вы поняли, я являюсь активным сторонником грудного вскармливания и это является огромной областью моих интересов. Помощь кормящим женщинам доставляет мне огромное удовольствие, именно поэтому я сейчас здесь с вами...\"&nbsp;</p>', '2014-03-03', 'images/lectors/hB5zyUNTEA8ArBjagVnLFqRYG4tDrI-meta0YTQvtGC0L4g0KjQuNC90LrQtdCy0LjRhy5qcGc=-.jpg', '2023-03-22 08:09:01', '2023-08-01 19:57:20'),
(29, 'Канаева Светлана Андреевна', 'Врач-педиатр, нефролог', '<p>Моя работа приносит мне огромное удовлетворение и радость. Я люблю помогать своим маленьким пациентам оставаться здоровыми и счастливыми, а также помогать родителям находить решения проблем, связанных со здоровьем и благополучием их детей.&nbsp;</p><p>Как сторонник доказательной медицины, я уделяю большое внимание научным исследованиям в моей области, и стараюсь внедрять их результаты в мою практику лечения. Я считаю, что только основанные на научных данных методы могут обеспечить максимально эффективное и безопасное лечение моих пациентов.&nbsp;</p><p>Кроме моей работы с пациентами, я также активно занимаюсь научной работой в области педиатрии и нефрологии. Являюсь куратором направления \"Педиатрия\" в школе Мам и Пап Нежность</p>', '2021-03-01', 'images/lectors/CWeVH1jFZavSruTAVXTjaIG1MCoKAn-metaNjUyQTk4MTEwLmpwZw==-.jpg', '2023-03-24 08:38:38', '2023-06-13 07:49:07'),
(31, 'Азимова Амина Юсуповна ', 'Врач акушер-гинеколог', '<p>Я являюсь врачом акушер-гинекологом, сотрудником кафедры «Акушерства и Гинекологии» РНИМУ им. Н.И. Пирогова, и я безгранично люблю свою работу. Одним из аспектов моей работы является научная деятельность. Я посвятила много времени и усилий на исследования в области гинекологии, и сейчас я активно работаю над своей диссертационной работой. Это позволяет мне углубленно изучать теоретические аспекты своей профессии, а также строить работу с пациентами, обоснованную на научных данных.</p>', '2019-09-01', 'images/lectors/2gkjepF9katDQAX16dQA3jMI5OfRZm-meta0YTQvtGC0L4g0JDQt9C40LzQvtCy0LAgLmpwZw==-.jpg', '2023-05-03 18:51:12', '2023-05-04 06:40:45'),
(32, 'Алиева Фатима Назимовна ', 'Врач акушер-гинеколог, гинеколог-эндокринолог', '<p>Как врач акушер-гинеколог, я очень горжусь тем, что окончила Первый МГМУ им. И.М. Сеченова с отличием. Это подтверждает мои знания и компетенцию в области акушерства и гинекологии.</p><p>Я стремлюсь не останавливаться на достигнутом и постоянно совершенствовать свои знания и навыки в этой области. Поэтому я прошла курсы повышения квалификации по эндокринной гинекологии и по доказательной медицине. Я уверена, что только основанные на научных данных методы могут обеспечить максимально эффективное и безопасное лечение моих пациенток.</p><p>Кроме того, у меня есть диплом педагога-психолога, что позволяет мне быть более гибкой и эффективной в общении с пациентками и учитывать их индивидуальные потребности и пожелания.</p><p>Сейчас я работаю над своей научной диссертацией, в которой рассматриваю вопросы, связанные с применением современных методов диагностики и лечения в гинекологической практике.</p>', '2020-06-23', 'images/lectors/ntiUb8S1pkIekBLe6r2KnRMINxyLr0-meta0YTQvtGC0L4g0JDQu9C40LXQstCwIDEuanBn-.jpg', '2023-05-03 19:05:18', '2023-08-01 19:59:03'),
(33, 'Брагина Любовь Владимировна', 'Врач акушер-гинеколог', '<p>Как врач акушер-гинеколог, я испытываю искреннее удовлетворение от своей работы. Я окончила медицинский институт с отличием и считаю, что моя профессия позволяет мне помогать женщинам сохранять свое здоровье и справляться с различными заболеваниями. Я постоянно обучаюсь и развиваю свои навыки, чтобы быть в курсе последних достижений в медицине и предоставлять пациенткам наилучшую медицинскую помощь.</p>', '2020-06-25', 'images/lectors/1sIMC00opsDooTbIlrVItETQxlj88o-meta0YTQvtGC0L4g0JHRgNCw0LPQuNC90LAucG5n-.png', '2023-05-03 19:10:53', '2023-05-04 07:41:28'),
(34, 'Булатова Алия Илгизовна', 'Клинический психолог (высшее психологическое образование), преподаватель психологии по специальности «Клиническая психология»', '<p>Как психолог, я чувствую большую радость и удовлетворение от работы с беременными женщинами. Это очень важный период в их жизни, и мне приятно помогать им пройти его с минимальным уровнем стресса и тревоги. Я работаю в тесном сотрудничестве с врачами-акушерами и гинекологами, чтобы предоставить беременным женщинам всестороннюю поддержку. Работа с беременными женщинами - это не только моя профессия, но и моя страсть.</p>', '2008-06-30', 'images/lectors/YbpExsPWQzPuiB5zaigltC0i6qVfeU-meta0KTQvtGC0L4g0JHRg9C70LDRgtC+0LLQsDEuanBn-.jpg', '2023-05-03 19:14:31', '2023-08-01 20:00:15'),
(35, 'Вахрамеева Надежда Николаевна', 'Практикующий психолог, высшее психологическое образование.', '<p>Меня зовут Надежда Вахрамеева, я практикующий психолог, автор курса «Из какой капусты мой ребенок». Работаю в методах ДПДГ, разговорный гипноз.&nbsp; Моя профессия позволяет мне помогать людям в различных областях их жизни, а достижение результатов вместе с моими клиентами приносит мне огромную удовлетворенность. Я считаю, что индивидуальный подход в моей работе это ключевой принцип, помогающий мне создавать доверительные отношения со своими клиентами.</p>', '2006-06-19', 'images/lectors/mmS5GMAg9FNVrR87T4n5tZyRRZuRb5-meta0YTQvtGC0L4g0JLQsNGF0YDQsNC80LXQtdCy0LAxLmpwZw==-.jpg', '2023-05-04 06:22:38', '2023-08-01 20:09:15'),
(36, 'Гребнева Марина Алексеевна', 'Врач акушер-гинеколог', '<p>Я врач акушер-гинеколог. В своей практической деятельности мне нравится заниматься подготовкой женщин к беременности, с дальнейшим их ведением, решать вопросы, связанные с нарушением менструального цикла, разбираться в эндокринной гинекологии и подбирать способы лечения выявленных патологий.&nbsp;</p><p>Я испытываю глубокую любовь к своей работе. Моя профессия позволяет мне помогать женщинам важными периодами их жизни, начиная от беременности и родов, до всеобщего здоровья и ухода за женской репродуктивной системой.&nbsp;</p>', '2017-06-19', 'images/lectors/OG0qcDsRYA2BXNe4OOeRTbVmKvQEIP-meta0YTQvtGC0L4g0LPRgNC10LHQvdC10LLQsC5qcGc=-.jpg', '2023-05-04 08:22:34', '2023-08-01 20:04:00'),
(37, 'Жмаченкова Алина Витальевна', 'Врач анестезиолог-реаниматолог  ', '<p>Я как врач анестезиолог-реаниматолог, испытываю глубокую любовь к своей профессии. Моя работа позволяет мне спасать жизни пациентов, обеспечивать им комфорт во время операций, процедур. Я понимаю, что моя работа играет очень важную роль в жизни людей, которые нуждаются в помощи, и это дает мне огромное удовлетворение.&nbsp;</p>', '2018-06-28', 'images/lectors/804fYB6uOQVSQji6JwPltoIvbrIYzn-meta0YTQvtGC0L4g0JbQvNCw0YfQtdC90LrQvtCy0LAxLmpwZw==-.jpg', '2023-05-04 08:27:20', '2023-08-01 20:08:08'),
(38, 'Каграманян Маргарита Арутюновна', 'Врач акушер-гинеколог', '<p>В качестве врача-акушера-гинеколога я испытываю настоящую любовь к своей профессии. Забота о женском здоровье и качестве жизни - это то, что действительно вдохновляет меня каждый день.&nbsp;</p><p>Большое значение для меня имеет возможность принимать участие в самом важном и ответственном периоде в жизни женщины, помогать ей преодолевать все трудности и радоваться вместе с нею при благополучном исходе.&nbsp;</p><p>Мне дорога возможность быть полезной обществу и помогать женщинам сохранять здоровье и благополучие в течение всей их жизни.</p>', '2020-07-07', 'images/lectors/Hkz2cicVlUUzoUh0IKI7b8tzQlmC7c-meta0YTQvtGC0L4g0LrQsNCz0YDQsNC80LDQvdGP0L0xLmpwZw==-.jpg', '2023-05-04 08:39:30', '2023-08-01 20:06:56'),
(39, 'Казарян Надежда Ашотовна', 'Врач акушер-гинеколог, врач УЗИ', '<p>Я врач-акушер-гинеколог, а также врач УЗИ. Имею большой опыт и знания в области заботы о женском здоровье.&nbsp;</p><p>Как врач-акушер-гинеколог, я посвятила свою карьеру заботе о здоровье женщин. Я стремлюсь оказывать максимальную поддержку моим пациенткам, проводить операции и другие медицинские процедуры, а также повышать общее здоровье женщин.</p>', '2016-06-30', 'images/lectors/gojNnTE7KjsEWpzUPyv2iSDDaZqQOf-meta0YTQvtGC0L4g0LrQsNC30LDRgNGP0L0ucG5n-.png', '2023-05-04 08:48:47', '2023-05-04 08:56:26'),
(40, 'Коновод Марина Александровна', 'Врач акушер-гинеколог', '<p>Как врач акушер-гинеколог, я прекрасно понимаю, насколько важно постоянно развиваться и улучшать свои навыки, чтобы предоставлять максимально качественную медицинскую помощь моим пациенткам. Я уделяю большое внимание повышению своей квалификации и прошла обучение в таких областях, как \"Эстетическая гинекология\", \"Эксперт по аменореям\", \"Гистероскопия и лапароскопия в оперативной гинекологии\" и \"Патология шейки матки и кольпоскопия\".&nbsp;</p><p>Я считаю, что постоянное обучение позволяет мне использовать наиболее передовые методы и технологии в своей работе и достигать наилучших результатов для моих пациенток.</p>', '2019-06-27', 'images/lectors/frCpaXHwPYbQexA5MuesrKvGfc1AEf-meta0YTQvtGC0L4g0LrQvtC90L7QstC+0LQgMS5qcGc=-.jpg', '2023-05-04 09:00:19', '2023-08-01 20:10:22'),
(41, 'Котикова Ирина Викторовна', 'Врач акушер-гинеколог, к.м.н.', '<p>Я работаю в Перинатальном Центре в отделении патологии беременности в качестве врача акушера-гинеколога, являюсь кандидатом медицинских наук . Я имею многолетний опыт работы в области акушерства-гинекологии и являюсь практикующим врачом, которому важно обеспечить наилучшую медицинскую помощь всем моим пациенткам.</p><p>Я постоянно совершенствую свои знания и навыки, повышаю свою квалификацию, участвуя в научных конференциях и семинарах, чтобы быть в курсе последних технологических достижений и лучших практик, чтобы предлагать самые передовые и безопасные методы лечения моим пациенткам.</p>', '2003-06-20', 'images/lectors/HUuPtbbuzgr2ed1JnoTowHbkNtZRCX-meta0YTQvtGC0L4g0LrQvtGC0LjQutC+0LLQsDEuanBn-.jpg', '2023-05-04 09:09:50', '2023-08-03 08:23:00'),
(42, 'Кутепова Дарья Сергеевна', 'Врач акушер-гинеколог, врач УЗИ', '<p>Я горжусь тем, что моя работа позволяет мне помогать женщинам в различных аспектах их здоровья. Прохождение дополнительной подготовки по ультразвуковой диагностике и кольпоскопии позволяет мне предоставлять лучший уровень медицинской помощи моим пациенткам, обеспечивая постановку более точного диагноза и более эффективное лечение.</p>', '2019-06-28', 'images/lectors/FAN4bl0b7DlSvfgSC8q4WtVzg5gIUt-meta0YTQvtGC0L4g0LrRg9GC0LXQv9C+0LLQsC5qcGc=-.jpg', '2023-05-05 06:33:34', '2023-05-05 06:33:34'),
(44, 'Логинов Дмитрий Николаевич', 'Врач акушер-гинеколог, гинеколог-эндокринолог, врач УЗИ', '<p>Я искренне люблю свою профессию. Я очень увлечен темой родов и посвящаю ей большую часть своего времени и профессиональной деятельности. Как гинеколог с опытом работы более 15 лет, я не только теоретически изучил все нюансы родов, но и постоянно практикую свои знания и умения, чтобы чувствовать себя уверенно и помогать своим пациенткам наилучшим образом.</p>', '2011-12-12', 'images/lectors/24kBra8pzk3F3YSOaBSC7cZALxDXoP-metaNGRkYzRhN2EtNTU5NC00ZjY5LThhM2QtZThlMzM3YjU3N2U1LmpwZw==-.jpg', '2023-05-05 07:56:47', '2023-05-05 07:56:47'),
(45, 'Михайлова Яна Рамазановна', 'Врач акушер-гинеколог', '<p>Как акушер-гинеколог с 7-летним опытом работы я не могу представить, что могла бы делать в жизни помимо этой профессии. Я получаю огромное удовлетворение от возможности помогать женщинам в самом важном периоде их жизни. Я постоянно обучаюсь и развиваю свои навыки, чтобы быть готовой к любым вызовам, которые могут возникнуть в моей работе. Но для меня самое важное - это увидеть улыбку на лице моих пациенток, которые становятся мамами благодаря моей помощи. Это невероятно чудесный опыт, который вдохновляет меня на продолжение работы в моей любимой профессии.</p>', '2011-06-23', 'images/lectors/VZHSkKDio9WxfG8OTKIG1rPTzvZNdE-meta0YTQvtGC0L4g0LzQuNGF0LDQudC70L7QstCwLmpwZw==-.jpg', '2023-05-05 08:30:25', '2023-05-07 13:13:13'),
(46, 'Наткина Оксана Александровна', 'Врач акушер-гинеколог ', '<p>Я окончила медицинский институт с отличием и с тех пор с большим энтузиазмом занимаюсь здоровьем женщин. Я горжусь тем, что моя работа позволяет мне помогать женщинам в самые важные моменты их жизни - рождение детей, поддержание здоровья и профилактика заболеваний. Эта профессия даёт мне возможность не только помогать людям, но и быть опорой для них в трудные моменты.</p>', '2020-07-06', 'images/lectors/xnxPk16Qkk8LNHFo453IoFwgkxZvLE-meta0YTQvtGC0L4g0J3QsNGC0LrQuNC90LAxLmpwZw==-.jpg', '2023-05-05 08:47:18', '2023-08-03 08:24:50'),
(47, 'Невмержицкая Елена Анатольевна ', 'Врач акушер-гинеколог, врач УЗИ ', '<p>Я считаю, что здоровье женщин - это основа здорового общества, и поэтому я всегда стремлюсь к профессиональному развитию. В своей профессии я испытываю огромную страсть и всегда стремлюсь к улучшению своих навыков. Я прошла обучение ультразвуковой диагностике, что помогает мне точнее и быстрее определять состояние здоровья моих пациенток. Работа с женщинами доставляет мне большое удовольствие.</p>', '2014-06-19', 'images/lectors/fzd1eu2ffTysslJrJQknHCIodErp1G-meta0YTQvtGC0L4g0J3QtdCy0LzQtdGA0LbQuNGG0LrQsNGPLmpwZw==-.jpg', '2023-05-05 08:55:39', '2023-05-05 08:55:39'),
(48, 'Полетыкина Екатерина Сергеевна', 'Врач акушер-гинеколог', '<p>Я с отличием окончила институт, являюсь сторонником доказательной медицины и постоянно работаю над расширением своих знаний и навыков, чтобы всегда быть в курсе новых тенденций и достижений в медицине. Я влюблена в свою работу и глубоко уважаю своих пациенток, и всегда делаю все возможное, чтобы они получили максимально качественную медицинскую помощь.</p>', '2020-06-30', 'images/lectors/pZFyc4KLcHoCkXbrPu8LBCOFw56zAS-meta0YTQvtGC0L4g0L_QvtC70LXRgtGL0LrQuNC90LAxLmpwZw==-.jpg', '2023-05-05 09:14:48', '2023-08-03 08:26:11'),
(49, 'Полынина Александра Михайловна', 'Врач акушер-гинеколог, врач УЗИ', '<p>Я - акушер-гинеколог и врач УЗИ. Я искренне люблю свою профессию и считаю ее одной из самых важных и ответственных. Я проходила повышение квалификации в Российском университете дружбы народов (РУДН), а также участвовала в программе «Эндокринные аспекты репродуктивного здоровья» на кафедре эндокринологии ФПК МР РУДН.&nbsp;</p>', '2018-06-22', 'images/lectors/x3oPXi6QvjcX1H4fJpMABIEzxNmCsi-meta0YTQvtGC0L4g0L_QvtC70YvQvdC40L3QsDEyLmpwZw==-.jpg', '2023-05-06 19:43:51', '2023-08-03 08:28:14'),
(50, 'Урманова Екатерина Николаевна', 'Врач акушер-гинеколог, врач УЗИ', '<p>Как врач-акушер-гинеколог, я чувствую глубокую любовь и уважение к своей профессии, люблю помогать женщинам заботиться о своем здоровье. Я являюсь сторонником доказательной медицины и постоянно совершенствую свои знания и навыки, чтобы предоставлять новейшие методы диагностики и лечения в области гинекологии.&nbsp; Всегда стремлюсь улучшать свои знания и навыки, поэтому прошла курсы повышения квалификации по \"Эндокринной гинекологии\", \"Практической кольпоскопии\" и \"Профилактике, диагностике и лечению заболеваний шейки матки, влагалища и вульвы\". Я считаю, что каждая женщина заслуживает высококвалифицированного и заботливого врача, который всегда готов помочь ей заботиться о своем здоровье.&nbsp;</p>', '2015-09-03', 'images/lectors/wIDqbS9fEVUUJny8wjIdiD7f0VJWL5-meta0YTQvtGC0L4g0KPRgNC80LDQvdC+0LLQsC5wbmc=-.png', '2023-05-07 12:04:28', '2023-05-09 12:25:15'),
(51, 'Чернецова Анна Сергеевна', 'Врач акушер-гинеколог', '<p>Как акушер-гинеколог, я люблю свою профессию из-за ее важности в жизни женщин. Наша работа позволяет нам помогать женщинам в самых важных моментах их жизни - во время беременности, родов, и в послеродовом периоде. Мы не только помогаем родить здоровых и красивых детей, но и оберегаем здоровье и благополучие мам. Я также пишу диссертацию в своей области, чтобы продвинуть науку и посвятить свой вклад в развитие области акушерства и гинекологии.</p>', '2018-06-29', 'images/lectors/vVaV6A2a4VbTexGdwbkIyeAhJiZxd0-meta0YTQvtGC0L4g0KfQtdGA0L3QtdGG0L7QstCwMS5qcGc=-.jpg', '2023-05-07 12:52:40', '2023-08-03 08:29:38'),
(52, 'Юдина Марина Михайловна', 'Врач дерматолог, аллерголог, косметолог, к.м.н., MBA, Руководитель Центра по изучению и терапии зуда ', '<p>Я практикующий врач дерматолог, аллерголог, косметолог. Имею более чем 15-летний опыт работы с пациентами и на сегодняшний день написала более 50 статей, как на русском, так и на английском языках, в числе которых есть издания международного уровня. Кроме того, я занимаюсь преподавательской деятельностью, проводя обучающие программы для врачей и пациентов. Я имею учёную степень кандидата медицинских наук. Свое образование я получала не только в России , но и проходила стажировку в Германии.</p>', '2007-06-01', 'images/lectors/qgW87x1Aexkh2Ex1kE3EUAqWaYzpAp-meta0YTQvtGC0L4g0K7QtNC40L3QsC5qcGc=-.jpg', '2023-05-08 13:41:12', '2023-05-08 16:06:44'),
(54, 'Вахрушев Александр Николаевич', 'Врач-педиатр', '<p>Я работаю врачом-педиатром с 2012 года, и за это время я получил обширный опыт и знания в области медицины, которые я использую, чтобы помочь родителям лечить и профилактировать заболевания у их детей. В работе с детьми, я стараюсь понимать их индивидуальные потребности и нахожу для них лучшее решение в каждом случае.</p>', '2012-05-01', 'images/lectors/nT4fo6SsonhQl6Ta6gHVEPhBIhwuUD-meta0YTQvtGC0L4g0JLQsNGF0YDRg9GI0LXQsjEuanBn-.jpg', '2023-05-08 16:42:33', '2023-08-03 08:31:11'),
(55, 'Макарова Екатерина Алексеевна', 'Врач-педиатр', '<p>Я - врач-педиатр, и я чувствую огромное удовольствие от работы с маленькими пациентами. Я прошла обучение на курсах детского массажа и консультирования по вопросам грудного вскармливания. Моя сфера профессиональных интересов включает период новорожденности, уход, питание и развитие грудных детей.</p>', '2016-06-22', 'images/lectors/ERpDWWVOUU3FlA9iHI07eGGkcg91gf-meta0YTQvtGC0L4g0JzQsNC60LDRgNC+0LLQsC5qcGc=-.jpg', '2023-05-08 16:50:26', '2023-05-08 16:54:16'),
(57, 'Агаева Гюнай Фаик Кызы', 'Врач-педиатр', '<p>Я врач-педиатр и считаю свою работу крайне важной и полезной для общества. Я помогаю заботиться о здоровье детей, которые являются будущим нашей страны, и это приносит мне огромное удовольствие.</p>', '2020-06-01', 'images/lectors/q2PI7WZ7XZvNAy1BWoREWISRBvtz0C-meta0YTQvtGC0L4g0JDQs9Cw0LXQstCwMS5qcGc=-.jpg', '2023-06-13 08:45:54', '2023-08-03 08:32:19');
