INSERT INTO `lectures` (`id`, `title`, `description`, `preview_picture`, `content`, `lector_id`, `category_id`, `is_published`, `is_recommended`, `created_at`, `updated_at`, `content_type_id`, `payment_type_id`, `show_tariff_1`, `show_tariff_2`, `show_tariff_3`) VALUES
(186, '24 Мифа о грудном вскармливании. Часть 1', '<p>Вокруг грудного вскармливания существует много мифов, многие из них противоречат друг другу, а многие и вовсе способны навредить. Эта лекция создавалась для мам и пап,чтобы поделиться с ними достоверной информацией. Чтобы вы почувствовали себя увереннее на прекрасном пути родительства. Приятного просмотра.</p>', 'images/lectures/MUFltNDByid34Dbv39NAxQ08TOH33P-metacGV4ZWxzLWd1c3Rhdm8tZnJpbmctNDk3NTQ1MS5qcGc=-.jpg', '203024655', 27, 36, 1, 0, '2023-03-22 08:38:01', '2023-06-25 18:26:00', 1, 2, 1, 1, 1),
(187, '24 Мифа о грудном вскармливании. Часть 2', '<p>Вокруг грудного вскармливания существует много мифов, многие из них противоречат друг другу, а многие и вовсе способны навредить. Эта лекция создавалась для мам и пап,чтобы поделиться с ними достоверной информацией. Чтобы вы почувствовали себя увереннее на прекрасном пути родительства. Приятного просмотра.</p>', 'images/lectures/CTvrCkVNdTxAdRwE086BzL1iPAQrrQ-metaMjEuanBn-.jpg', '203178633', 27, 36, 1, 0, '2023-03-22 11:10:07', '2023-05-27 07:00:40', 1, 2, 1, 1, 1),
(188, 'Мало молока... Что делать?', '<p>Каждая кормящая женщина сталкивается с проблемой - «мало молока». Одни мамы ставят себе такой приговор из-за страха и незнания, другие -потому что кто-то им это сказал, и лишь небольшая часть действительно имеет такую проблему. Как понять,хватает ли молока малышу? А главное, что с этим делать и как отследить,что все наладилось, мы подробно рассказываем в этом вебинаре. Конкретно, структурировано и с пользой для вас.</p>', 'images/lectures/DGIcXbDFuAoaU05HZzQwyKkx4g10dj-metaMTYuanBn-.jpg', '203178719', 27, 36, 1, 0, '2023-03-22 13:28:27', '2023-06-22 12:12:59', 1, 2, 1, 1, 1),
(189, 'Сцеживание молока при кормлении грудью', '<p>Сцеживать или нет-это одна из самых спорных тем. Как и все в родительстве. В разных случаях должны быть разные подходы. Кому-то нужно сцеживать грудь,а кому-то это может навредить.В этой лекции мы рассмотрели разные сценарии событий, а также объяснили, кому,как и когда нужно применять сцеживание.Приятным бонусом для вас будет мастер-класс ручной техники сцеживания груди, а так же ответ на вопрос: «Что делать со сцеженным молоком?»</p>', 'images/lectures/gX5MdcTvV6v9RgYSgF7cVDcoJ0FPFs-metaMTQuanBn-.jpg', '203178848', 27, 36, 1, 0, '2023-03-24 07:49:45', '2023-06-07 11:40:40', 1, 2, 1, 1, 1),
(190, 'Как образуется грудное молоко?', '<p>В этой лекции мы рассмотрим с вами как устроена наша молочная железа. Заглянем на саму фабрику продукции грудного молока, поймём инструкцию по ее применению, а так же развенчаем некоторые мифы,связанные с физиологией лактации.</p>', 'images/lectures/hPC66rVZAJlJbALs55pxXK3WFaPhck-metaMTcuanBn-.jpg', '203178690', 27, 39, 1, 1, '2023-03-28 12:43:47', '2023-06-16 06:32:25', 1, 1, 0, 0, 0),
(191, 'Полезно ли грудное вскармливание для мамы?', '<p>Польза грудного вскармливания<em> для малышей</em> бесспорна, об этом говорят не только врачи, но и даже производители детских молочных смесей. <strong>А как же лактация влияет на наш женский организм? </strong>Об этом мы подробно рассказываем в этой лекции. Так же здесь мы рассмотрим лактационную аменорею в качестве метода контрацепции. Будет интересно!</p>', 'images/lectures/XVJFp1Wc2omdQjZXbavNjjfUXYOH5W-metaMjguanBn-.jpg', '203178660', 27, 36, 1, 0, '2023-03-29 05:11:19', '2023-05-27 06:57:18', 1, 2, 1, 1, 1),
(195, 'Уникальный состав грудного молока', '<p>Грудное молоко уникально, это бесспорно! Но почему это так? Почему молоко для новорожденного отличается от молока для годовалого малыша? Почему мы не можем кормить наших детей коровьим или козьим молоком? От чего зависит состав молока, и как мы можем на это влиять? Ответы на все эти вопросы вы найдёте в этой лекции.Приятного просмотра.</p>', 'images/lectures/W51IBihOELoDVaB1xaXSn3roJZpdQP-metacGV4ZWxzLW1hcnQtcHJvZHVjdGlvbi03NDkxMjIxLmpwZw==-.jpg', '203178866', 27, 36, 1, 0, '2023-03-29 05:22:57', '2023-06-25 18:30:49', 1, 2, 1, 1, 1),
(201, 'Инфекция – ключевой фактор развития осложнений во время беременности и родов', '<p>Инфекционные заболевания женских половых органов являются самой частой группой заболеваний,с которыми приходится сталкиваться акушеру-гинекологу.<br>Инфицирование и развитие воспалительного процесса в половых органах во время беременности может нарушать ее течение.<br>Внутриутробное инфицирование плода может привести к развитию у него специфического воспалительного процесса и повышение частоты послеродовой воспалительных осложнений.<br>В данной теме закрываем все &nbsp; «белые пятна» в ведении беременности &nbsp; с инфекционно- воспалительными заболеваниями.</p>', 'images/lectures/bE6CeRO43f5mWmGHmnETfMtP9Pq1IV-metaMjcuanBn-.jpg', '203247843', 47, 39, 1, 1, '2023-04-26 16:01:08', '2023-06-16 06:33:33', 1, 1, 0, 0, 0),
(211, 'Шкала АПГАР - раскрываем секреты', '<p>«У вашего малыша 7/8 баллов по Апгар», — сообщают врачи новоиспеченной маме. И часто слышат в ответ: «Сколько чего?» Правда, вы бы тоже задались этим вопросом? Что это за шкала Апгар, по которой оценивают новорожденных? Что означают эти цифры? Сколько баллов — хорошо, а сколько — плохо? В этой лекции вы узнаете ответы на все эти вопросы, а именно что такое шкала Апгар, какие критерии оценки в нее включены, зачем она нужна и о чем могут сказать эти две загадочные цифры, которые говорят маме после рождения малыша.</p>', 'images/lectures/D7PNKSio2nOioKVoynz7CMw0rIkHdN-metaMzYuanBn-.jpg', '203322449', 32, 39, 1, 1, '2023-05-09 07:03:33', '2023-06-16 06:32:53', 1, 1, 0, 0, 0),
(212, 'У меня задержка, что делать? Когда идти к врачу? ', '<p>У меня задержка! Сколько же волнений и тревог приносят задержка менструаций и сбои менструального цикла у женщин. Когда мы будем говорить о норме? С чем могут быть связаны нарушения цикла? Как не пропустить внематочную беременность? Что делать, если менструации не пришли в срок? Разберемся с Вами во всех этих вопросах.</p>', 'images/lectures/QfPna1Pa4p3QLs8gfQyhpYQtnz8Qxt-metaZGVvbi1ibGFjay0xTnZOUUlZVG9pYy11bnNwbGFzaC5qcGc=-.jpg', '203262526', 36, 39, 1, 1, '2023-05-09 07:09:06', '2023-06-25 20:00:08', 1, 1, 0, 0, 0),
(213, 'Предгравидарная подготовка: верный путь к беременности ', '<p>Прегравидарная подготовка является необходимым и обязательным условием успешного зачатия, и как следствие благоприятного течения беременности и родов. В рамках данной беседы мы постараемся ответить на ряд вопросов, которые часто вы задаете – а стоит ли вообще планировать беременность? Какой интервал должен быть между беременностями? И вообще надо ли принимать какие-либо витамины, если мы можем их получить из пищи?</p>', 'images/lectures/0qJnfVAJ9IEhLyV1XvKno35G5ag7A8-metaam9uYXRoYW4tYm9yYmEtQkl4bDRHOXVvZzAtdW5zcGxhc2ggKDEpLmpwZw==-.jpg', '203262507', 41, 80, 1, 0, '2023-05-09 07:16:07', '2023-06-25 20:03:15', 1, 1, 0, 0, 0),
(214, 'Постановка на учет, принципы дородового наблюдения. Обменная карта, родовой сертификат, декретный отпуск. ', '<p>Расскажем в мельчайших подробностях, что делать после наступления беременности. Вы узнаете, в каком сроке нужно вставать на учет, какие документы и выплаты вам положены. Также рассмотрим обязательные исследования во время беременности и разберемся, как выбрать роддом.</p>', 'images/lectures/gDSdUUXKRnURv1HC7LI5q925kYmqoE-metaOC5qcGc=-.jpg', '203179012', 39, 39, 1, 1, '2023-05-09 07:20:04', '2023-06-16 06:36:27', 1, 1, 0, 0, 0),
(215, 'Менструальный цикл  от а до я', '<p>На этой лекции мы с вами разберём, как устроена женская репродуктивная система, поговорим о нормах и нарушениях менструального цикла, что может насторожить, узнаем как определить овуляцию, как происходит зачатие, могут ли быть менструации во время беременности, на гормональных препаратах, контрацептивах, после родов, а также поговорим немного о контрацепции после родов.</p>', 'images/lectures/NCLhmI6YxQ2lWJXDiApaDdrJy9LPxe-metacGV4ZWxzLW5hZGV6aGRhLW1vcnlhay03NDY3MTAyLmpwZw==-.jpg', '203262485', 32, 39, 1, 1, '2023-05-09 07:23:23', '2023-06-25 20:01:04', 1, 1, 0, 0, 0),
(216, 'ВИЧ-инфекция и беременность', '<p>Что такое ВИЧ? Можно ли беременеть при данном диагнозе? Какие особенности ведения беременных существуют? Есть ли риски для плода у мамы с положительным ВИЧ-статусом? Какие дополнительные исследования и анализы могут потребоваться для постановки на учет?&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>', 'images/lectures/KdkxD0ZR2wnjYToSvpWXg613pHnxmU-metaMTcuanBn-.jpg', '203247786', 46, 39, 1, 1, '2023-05-09 07:26:00', '2023-06-25 20:01:40', 1, 1, 0, 0, 0),
(222, 'Секреты успешного зачатия', '<p>Если опытным путем вы пришли к выводу, что поза березки и советы подруг не способствуют наступлению беременности, то пришло самое время разобраться в основных причинах не наступления беременности и методах диагностики этих причин.</p>', 'images/lectures/FY4y5Qz9PChvjVYHwQvLqLFd8JSk5q-metaQWRvYmVTdG9ja18zMDUwMTAxNjEuanBn-.jpg', '203262515', 48, 80, 1, 1, '2023-05-09 08:03:06', '2023-07-28 22:45:37', 1, 1, 0, 0, 0),
(223, 'Правда и мифы о ВПЧ-инфекции. Эрозия шейки матки, лечить или наблюдать?', '<p>ВПЧ-инфекция, самая распространенная инфекция вызванная вирусом папилломы человека. К сожалению,от ВПЧ не застрахован ни один человек. 90% людей в мире будут заражены данным вирусом. Что должна знать каждая женщина? Как защитить себя от ВПЧ-инфекции? Как генитальные кондиломы связаны с ВПЧ-инфекцией? Эрозия шейки матки, лечить не надо прижигать, куда поставим запятую?</p>', 'images/lectures/4kEdotxQopFzFJtCyGCx35Syogy0hL-metaMTQuanBn-.jpg', '203262486', 36, 6, 1, 1, '2023-05-09 08:06:16', '2023-06-16 06:41:40', 1, 1, 0, 0, 0),
(224, 'Правильное прикладывание ребенка к груди. Как приложить ребенка к груди? Правильный захват соска', '<p>Каждая вторая проблема с грудным вскармливанием связана с неправильным прикладыванием ребенка к груди. Знание ключевых моментов правильного прикладывания, механизма сосание груди, помогает маме кормить безболезненно, а ребёнку хорошо опустошать грудь и набирать вес. Вебинар наполнен не только схемами и картинками, но и показательными видеоматериалами. Приятного и полезного просмотра.</p>', 'images/lectures/Q8zKXbdLw6eA4Ur2mRalJeTwDJFfh8-metaMTcuanBn-.jpg', '203178847', 27, 36, 1, 0, '2023-05-09 08:24:22', '2023-05-27 06:42:56', 1, 2, 1, 1, 1),
(225, 'Положения при кормлении грудью. Какие и зачем?', '<p>Удобство мамы во время кормления - залог длительного грудного вскармливания. Ведь если удобно, комфортно и не больно, то нет причин не кормить. Вебинар наполнен картинками, схемами, видеоматериалами и комментариями лектора, что-то не понять - не получится.</p>', 'images/lectures/RMp82i581REWd7kvLk1fL7bLX9okt1-metacGV4ZWxzLW1vbmljYS10dXJsdWktMTU4NTUyMDUuanBn-.jpg', '203178829', 27, 36, 1, 0, '2023-05-09 08:27:11', '2023-06-25 18:34:36', 1, 2, 1, 1, 1),
(226, 'Питание кормящей мамы', '<p>Самая популярная тема среди запросов на протяжении уже многих лет. Есть сторонники воды и гречки, а есть сторонники - «нужно кушать за двоих». Эта тема поможет вам не сойти с ума от разносторонних советов, и, опираясь на научные данные, разложить все в своей голове по полочкам. Поговорим и про аллергию, и про колики, и про все то, в чем еще обвиняют грудное молоко.</p>', 'images/lectures/ecNJCGgYKDSmw7tnQbRaUnhCQ2JijD-metaMTMuanBn-.jpg', '203178809', 27, 36, 1, 0, '2023-05-09 08:30:28', '2023-05-27 06:44:49', 1, 2, 1, 1, 1),
(227, 'Отлучение ребенка от груди', '<p>Тема актуальна для тех, кто хочет завершить грудное вскармливание максимально комфортно для ребёнка и для себя. Мы расскажем, как делать не нужно, развенчаем некоторые мифы, и конечно же дадим четкий план действий для мягкого и не травмирующего отлучения ребенка от груди и плавного завершения лактации.</p>', 'images/lectures/3JFsg7y3KbaXt2XsIdFsN1bGxhOiwz-metaMTYuanBn-.jpg', '203178776', 27, 36, 1, 0, '2023-05-09 08:32:19', '2023-05-27 06:49:08', 1, 2, 1, 1, 1),
(228, 'Особенности кормления грудью в разном возрасте малыша', '<p>Кормление грудью новорожденного, полугодовалого и годовалого малыша очень отличаются. И только маме кажется,что вот,все наладилось и вошло в ритм,как появляются у ребенка новые навыки и интересы, что всегда влияет на поведение у груди и сам режим кормлений. Об этих особенностях мы и поговорим. Задача - дать вам понимание, что нужно для ребенка в данном возрастном периоде и как это совместить с грудным вскармливанием.</p>', 'images/lectures/ZkH4pDZx88a42drzo90AYWMnSkj8JM-metaMTUucG5n-.png', '203178773', 27, 36, 1, 0, '2023-05-09 08:34:48', '2023-05-27 06:49:35', 1, 2, 1, 1, 1),
(229, 'Нужны ли аксессуары для кормления грудью?', '<p>Маркетинг торговых брендов не дремлет и на рынке нам предлагают очень много различных «помогаторов». Действительно ли они нужны? Что поможет облегчить быт кормящей мамы,а что лишь опустошит наш кошелек? Мы сделали большой обзор различных аксессуаров, который однозначно сэкономит ваш бюджет.</p>', 'images/lectures/q62POePCiMz5DNl7FO38crzvG6Exa2-metadmljdG9yaWEtc3RydWtvdnNrYXlhLWZ1M1VxWFRiR2NzLXVuc3BsYXNoLmpwZw==-.jpg', '203178746', 27, 36, 1, 0, '2023-05-09 08:36:18', '2023-06-25 18:41:00', 1, 2, 1, 1, 1),
(230, 'Мама болеет. Можно ли кормить грудью?', '<p>Эта тема не требует долгого представления. Любая кормящая мама может заболеть. В этом вебинаре мы поговорим про заболевания при которых можно и нельзя кормить грудью, что делать, если маму укусил клещ, а так же, как проверить лекарство на совместимость с грудным вскармливанием. Скучно не будет,как всегда, вас ждёт все самое актуальное и научно обоснованное.</p>', 'images/lectures/WAJvG4bDp7WY5C8wLo1eb51WVlzerE-metaMjMuanBn-.jpg', '203178735', 27, 36, 1, 0, '2023-05-09 08:52:18', '2023-05-27 06:50:47', 1, 2, 1, 1, 1),
(231, 'Лактостаз и мастит. Причины и профилактика. Алгоритмы помощи.', '<p>Мы создали четкие алгоритмы помощи при таких осложнениях, как лактостаз и мастит. Разберем: как помочь себе, когда обращаться к врачу, и как не допустить повторения таких эпизодов. Лекция нужна каждой кормящей маме, ведь когда знаешь алгоритм самопомощи, когда понимаешь в каких ситуациях нужно идти к врачу, нет страха и паники,есть только план действий.</p>', 'images/lectures/Vr45fW1YpMcstzYxLBXq954YlF4qsn-metaMTlfMS5qcGc=-.jpg', '203178712', 27, 36, 1, 0, '2023-05-09 08:54:46', '2023-05-27 06:52:46', 1, 2, 1, 1, 1),
(232, 'Если ребенок не может взять грудь', '<p>Отказ ребенка от груди всегда воспринимается остро и тяжело мамой. Самое важное в этот момент не допустить панику и страх и в этом конечно же помогают нам знания. В вебинаре мы собрали все известные причины отказа от груди, а самое главное дали алгоритм действий для преодоления этой трудности.</p>', 'images/lectures/lVVfsTCClOnpy2fzE3jtuD3vTffT1h-metaMjYuanBn-.jpg', '203178674', 27, 36, 1, 0, '2023-05-09 09:18:34', '2023-05-27 06:53:09', 1, 2, 1, 1, 1),
(233, '10 причин боли при кормлении грудью. Трещины сосков, профилактика.', '<p>Боль при кормлении грудью является одной из причин отказа мамы от грудного вскармливания, и мы считаем это очень важной проблемой. Эта лекция не только про 10 причин, она про то,как выявить причину и как ее устранить. Максимально доступно, понятно и главное практично. Наша цель не просто озвучить перечень,а научить вас самим понимать и решать проблему.</p>', 'images/lectures/At7m5gUi2aEYVWuHZgrG8uEeT4JZx3-metaMTlfMi5qcGc=-.jpg', '203178610', 27, 36, 1, 0, '2023-05-09 09:57:26', '2023-06-25 18:41:52', 1, 2, 1, 1, 1),
(234, '10 преимуществ грудного вскармливания для ребенка', '<p>Еще 100 лет назад эта тема была бы не актуальна, но сейчас, в 21 веке, сторонникам грудного вскармливания, к которым мы себя причисляем, приходится бороться с агрессивной и навязывающей рекламой детских смесей, и это понятно, ведь производителям нужно продавать и зарабатывать. Почему мы рекламируем грудное молоко? Все просто, это вклад в здоровье наших детей, женщин, а соответственно и в будущее.</p>', 'images/lectures/WWCLJqi781DkT2xWoBOrQgksfKwiTL-metaMTUuanBn-.jpg', '203178609', 27, 36, 1, 0, '2023-05-09 09:58:46', '2023-05-27 07:10:47', 1, 2, 1, 1, 1),
(235, '10 правил успешного грудного вскармливания в первый год жизни', '<p>10 простых правил, которые помогут вам избежать многих проблем в грудном вскармливании. Все проще, чем кажется. Грудное вскармливание не нужно усложнять, об этом и есть наш вебинар.</p>', 'images/lectures/LF38sEeAr2kDtXUjmvYNG6alxJubRO-metacGV4ZWxzLXdlbmR5LXdlaS0zMDc0OTM1LmpwZw==-.jpg', '203881640', 27, 36, 1, 0, '2023-05-09 11:08:44', '2023-06-25 18:43:21', 1, 2, 1, 1, 1),
(236, 'Защитите своего малыша: симптомы эндокринных нарушений во время беременности, о которых стоит знать', '<p>В этой лекции вы узнаете, какие бывают нарушения в гормональной системе, вместе попробуем в них разобраться&nbsp; и рассмотрим особенности планирования и течения беременности при этих нарушениях. В процессе занятия мы разберем как устроена эндокринная система человека, поговорим подробно о сахарном диабете при беременности, затронем тему проблем с щитовидной железой при беременности, кратко коснемся надпочечников и их гормонов, поговорит о пролактине – главном гормоне грудного вскармливания, и <strong>по секрету вам расскажу, какие анализы на гормоны сдавать нет смысла&nbsp;</strong></p>', 'images/lectures/TLgZY9CLVAICBLmAuVY60ol4ySx32F-metaOC5qcGc=-.jpg', '203248044', 32, 66, 1, 0, '2023-05-09 11:20:33', '2023-05-25 06:56:14', 1, 2, 1, 1, 1),
(237, 'Будьте бдительны: симптомы, на которые стоит обратить внимание в период беременности', '<p>Разбираем самые распространённые жалобы, которые возникают во время беременности. Определяемся когда необходимо насторожиться и показаться врачу, а когда можно справиться самостоятельно.</p>', 'images/lectures/Z0UAqRsRdv7euJBfRCAS7EQye61D8J-metaMTguanBn-.jpg', '203248041', 45, 66, 1, 0, '2023-05-09 11:25:39', '2023-05-25 07:01:40', 1, 2, 1, 1, 1),
(238, 'Проблемы с печенью во время беременности: Холестаз и его последствия', '<p>Холестаз беременных занимает 2 место по частоте распространенности желтухи у беременных. Как заподозрить и диагностировать холестаз беременных? Почему беременность является провоцирующим фактором развития данного заболевания? Чем опасен холестаз беременных? Ответим на все эти вопросы и не только!</p>', 'images/lectures/UZy9LeWfcM0I5QYvwOb2xt5TP3dX68-metaYW5kcmV3LXNlYW1hbi04bjAyVXBKMTcwRS11bnNwbGFzaC5qcGc=-.jpg', '203248017', 36, 65, 1, 0, '2023-05-09 11:33:08', '2023-06-25 20:06:37', 1, 2, 1, 1, 1),
(239, 'Свертываемость крови у мамы или Как предупредить развитие венозных тромбоэмболических осложнений во время беременности? ', '<p>Знаете ли вы о том, что риск тромбоза у беременной женщины повышается в 8 раз по сравнению с не беременной? Наши советы и четкие этапы диагностики помогут сохранить вам спокойствие, избежать бесполезных анализов и необоснованного лечения.</p>', 'images/lectures/dP1YnjDg8JQI2G3ehMtUASNoQMivcZ-metacGV4ZWxzLWthcm9saW5hLWdyYWJvd3NrYS02NjI5MzY5LmpwZw==-.jpg', '203248014', 48, 66, 1, 0, '2023-05-09 12:16:58', '2023-06-25 20:24:00', 1, 2, 1, 1, 1),
(240, 'Розацеа и беременность: причины, симптомы и лечение', '<p>Розовые угри, или розацеа, во многом зависят от гормонального статуса женщины. У некоторых пациенток розацеа начинается во время беременности и периода кормления грудью в связи со значительными гормональными перестройками в организме. Как правильно ухаживать за кожей, что можно и нельзя использовать во время беременности и кормления грудью Вы узнаете в этом видео.</p><p>Содержание лекции:<br>1. Что такое розацеа;<br>2. Причины появления и триггеры обострений;<br>3. Обследования и анализы при розацеа;<br>4. Как правильно питаться;<br>5. Препараты для лечения;<br>6. Домашний уход при розацеа.<br><br></p>', 'images/lectures/2W9uMTDb44OrgF4y5Lir1yZTFqCeem-metaQWRvYmVTdG9ja18zMjA5MDMwNTguanBn-.jpg', '203247980', 52, 68, 1, 0, '2023-05-09 12:18:36', '2023-06-27 04:55:09', 1, 2, 1, 1, 1),
(241, 'Секреты успешной беременности. Часть 1. ', '<p>Учащенное сердцебиение, одышка, изжога…<br>Почему возникают такие симптомы во время беременности? Можно ли справиться с этими изменениями? Как себе помочь?<br>Что делать при пониженном или повышенном артериальном давлении?<br>Как самостоятельно справиться с тошнотой и затрудненным стулом?<br>В каких ситуациях стоит обращаться к врачу, а когда можно справиться самостоятельно?<br>На эти и многие другие вопросы можно найти ответы в этой лекции.</p>', 'images/lectures/aoZEmLnSS7x7DMq7La1c5TTrrEYq6y-metaYW5uYS1oZWNrZXItd3FjUTZPRHdQeFUtdW5zcGxhc2guanBn-.jpg', '203247956', 50, 66, 1, 0, '2023-05-09 12:21:32', '2023-06-25 20:25:15', 1, 2, 1, 1, 1),
(242, 'Секреты успешной беременности. Часть 2', '<p>Учащенное мочеиспускание, лейкоциты и слизь в моче. Когда стоит принимать препараты?<br>Сниженный гемоглобин, а врач говорит, что все в порядке? Третий круг кровообращения и как это всё связано?&nbsp;Безопасен ли глюкозо-толерантный тест во время беременности?&nbsp;Какие обследования необходимы во время беременности?</p>', 'images/lectures/v2qcJNOJBiNiqAx4ehzsLdBM7c9exU-metaY2FteWxsYS1iYXR0YW5pLWR6OGcwSXhFcWgwLXVuc3BsYXNoLmpwZw==-.jpg', '203247979', 50, 66, 1, 0, '2023-05-09 12:23:15', '2023-06-25 20:25:57', 1, 2, 1, 1, 1),
(243, 'Профилактика подтекания мочи и перерастяжения промежности в беременность', '<p>На данной лекции будет рассказано о причинах возникновения проблем с недержанием мочи у беременных женщин, а также об изменениях, происходящих в органах малого таза и промежности во время беременности. Мы также рассмотрим методы, которые помогут предотвратить или исправить недержание мочи.</p>', 'images/lectures/z6JTcbjnhjaJHl8mSeDX7FpAVlG5BU-metaQWRvYmVTdG9ja180ODEwOTAxMjQuanBn-.jpg', '203247954', 45, 70, 1, 0, '2023-05-09 14:15:09', '2023-06-27 05:29:59', 1, 2, 1, 1, 1),
(244, 'Переношенная беременность: как облегчить путь к родам', '<p>Если ваш срок беременности подходит к концу, но роды не начались, это может вызывать беспокойство. Наша лекция осветит этот вопрос и поможет вам понять, что происходит со здоровьем будущей мамы и малыша, а также что следует делать. В лекции будут даны советы будущим мамам, а также рассмотрены риски и потенциальный стресс, связанный с данной ситуацией.</p>', 'images/lectures/7AbizQpeeElqlY887lVFkVEHfj9MBl-metaYmV0aGFueS1iZWNrLVJHZGhFTmFHWjk0LXVuc3BsYXNoLmpwZw==-.jpg', '203247923', 41, 65, 1, 0, '2023-05-09 14:36:32', '2023-06-25 20:07:21', 1, 2, 1, 1, 1),
(245, 'Патология пуповины - важные детили', '<p>Патология пуповины очень многообразна и помимо обвития пуповины, которое очень волнует большинство будущих мамочек, есть и другие виды ее патологии. В рамках данной беседы мы ответим на ряд вопросов, касающиеся обвития пуповины и не только. Выясним можно ли что-нибудь сделать, если у Вас при УЗИ выявлена патология пуповины? И стоит ли Вам переживать по поводу обвития пуповины или нет?</p>', 'images/lectures/sOXJ74vROJVoBoXR76pMeFY0BSmIvk-metaQWRvYmVTdG9ja18yODQ4NzgxNDMuanBn-.jpg', '203247913', 41, 67, 1, 0, '2023-05-09 14:57:39', '2023-06-26 15:39:05', 1, 2, 1, 1, 1),
(246, 'Отрицательный резус фактор и беременность:  как избежать конфликтов? ', '<p>Около 15% женщин имеют кровь с отрицательным резус-фактором. Вокруг беременностей у таких женщин много мифов и драмы, но современная медицина знает, что и как делать в этом случае. В ходе данной лекции вы выясните, что резус-конфликтная беременность - это не приговор и не повод для паники, и что на современном этапе развития медицины есть много способов помощи будущей маме в вынашивании здорового ребенка.</p>', 'images/lectures/Cfu6gVebH8mfHpSI20A4iPv4N84TSA-metacGV4ZWxzLXJvYmVydG8tY2FycmFmYS0zOTA4MTc5LmpwZw==-.jpg', '203247885', 41, 66, 1, 0, '2023-05-09 15:16:04', '2023-06-25 20:27:43', 1, 2, 1, 1, 1),
(247, 'Операции и беременность. Можно ли?', '<p>В жизни человека есть состояния здоровья которые могут потребовать хирургического вмешательства - операцию. К сожалению, беременных женщин от такого случая никто не может застраховать. Поэтому необходима прегравидарная подготовка, которая включает в себя обследования на выявление заболеваний, особенно тех где требуется хирургическое лечение. Но если все же, по каким-либо причинам будет предстоять экстренная операция в период беременности, важно понимать будущей маме, что в большей степени не само хирургическое вмешательство валяет на дальнейшее течение и исход беременности, а само заболевание.&nbsp;</p>', 'images/lectures/A2uzTH7UCU60BHFCzaS4toVKSllDKw-metacGV4ZWxzLWFubmEtc2h2ZXRzLTQ1ODY5OTQuanBn-.jpg', '203247879', 46, 65, 1, 0, '2023-05-09 15:18:40', '2023-06-25 20:08:40', 1, 2, 1, 1, 1),
(248, 'Миома матки и беременность.', '<p>Тема посвящена одному из самых частых заболеваний женской репродуктивной системы - миоме матки, а точнее, ее влиянию на течение беременности. В этой лекции вы узнаете почему возникает миома, каких видов она бывает, как себя проявляет, и чем же она все таки опасна при беременности.&nbsp;</p>', 'images/lectures/0Pbiwd9Hctnof41gYN54tOMR4XoCEg-metacGV4ZWxzLW5hZGV6aGRhLW1vcnlhay03NDY3MTAwLmpwZw==-.jpg', '203247867', 31, 66, 1, 0, '2023-05-09 15:20:23', '2023-06-26 14:10:25', 1, 2, 1, 1, 1),
(249, 'Сахарный диабет у беременных. Как сохранить здоровье ребенка?', '<p>Гестационный сахарный диабет – это заболевание, характеризующееся повышением уровня сахара крови, впервые выявленным во время беременности. Оно является самым распространенным нарушением обмена веществ у будущей матери, что не может не волновать ее. В рамках нашей сегодняшней беседы мы выясним, что нужно знать будущей маме, чтобы защитить здоровье своего малыша. Дадим советы по питанию и образу жизни, чтобы взять данную ситуацию под свой контроль.</p>', 'images/lectures/jmbeTPlonfwgZHPLSBAgefioUjhCmc-metacGV4ZWxzLWtsYXVzLW5pZWxzZW4tNjMwMzcxMi5qcGc=-.jpg', '203247836', 41, 65, 1, 0, '2023-05-09 15:28:34', '2023-06-25 20:11:21', 1, 2, 1, 1, 1),
(250, 'Вульвовагиниты при беременности: что необходимо знать. Какие исследования проводятся?', '<p>Деликатные проблемы всегда требуют индивидуального подхода и незамедлительного решения. Если вы устали от нескончаемого количества мазков и непонятных свечей, то разбор этой темы в нашей лекции вам точно необходимо послушать!&nbsp;<br>Позиция доказательной медицины в контексте нарушения флоры влагалища: от симптомов к грамотной диагностике.&nbsp;</p>', 'images/lectures/pqFzYuZsr2s8yQtlyrSmlGAKlp98nM-metaamFuLWtsZWluZXJ0LWZTWGZfa1FpdklzLXVuc3BsYXNoLmpwZw==-.jpg', '203247812', 48, 70, 1, 0, '2023-05-09 15:34:58', '2023-06-27 05:37:24', 1, 2, 1, 1, 1),
(251, 'Вкусовые предпочтения  беременных. Часть 1', '<p>Во время беременности в организме женщины происходит много изменений. Это нужно для того, чтобы обеспечить благополучное протекание беременности и рост малыша. Женщина должна прислушиваться к потребностям своего организма и разнообразить свой пищевой рацион для профилактики возможных осложнений беременности</p>', 'images/lectures/VGTd4NtnMBEVluPfCKEE5IMoMPm5KV-metaMTBfMS5qcGc=-.jpg', '203247811', 51, 66, 1, 0, '2023-05-09 15:37:41', '2023-06-26 14:11:43', 1, 2, 1, 1, 1),
(252, 'Вкусовые предпочтения беременных. Часть 2', '<p>Во время беременности в организме женщины происходит много изменений. Это нужно для того, чтобы обеспечить благополучное протекание беременности и рост малыша. Женщина должна прислушиваться к потребностям своего организма и разнообразить свой пищевой рацион для профилактики возможных осложнений беременности</p>', 'images/lectures/28TH9ksWbvJlw2phEn0trfsiJhSTem-metacGV4ZWxzLWFtaW5hLWZpbGtpbnMtNTQyNDYyMi5qcGc=-.jpg', '203247798', 51, 66, 1, 0, '2023-05-09 16:57:04', '2023-06-26 14:20:23', 1, 2, 1, 1, 1),
(253, 'Истмико-цервикальная недостаточность: секреты ведения беременности ', '<p>Беременность осложнённая истмико-цервикальной недостаточностью - это беременность повышенного риска.<br>Это проблема, которая приводит к невынашиванию беременности и преждевременным родам.<br>Тема посвящена&nbsp; ведению женщин с истмико-цервикальной недостаточностью, изложены диагностические возможности, лечебные мероприятия, как на этапе прегравидарной подготовки, так и во время беременности. Освещены методы коррекции истмико-цервикальной недостаточности у женщин различных групп, обоснован выбор тактики ведения позволяющие выносить беременность и родить здорового ребёнка.</p>', 'images/lectures/LHfwB7CVYtDaao2xvVEGJDVaR0Z68d-metaNDUuanBn-.jpg', '203247777', 47, 65, 1, 0, '2023-05-09 16:59:28', '2023-06-25 20:15:45', 1, 2, 1, 1, 1),
(254, 'Ведение беременных с  гестозами', '<p>Повышение артериального давления бывает как до беременности, так и во время нее, которое может приводить к такому осложнению, как гестоз(преэклампсия), доля которого во время беременности составляет 2-8%. При каких заболеваниях у будущих мам, может развиться данное состояние во время беременности? Как обеспечить себе спокойную беременность и родить здорового малыша? Кесарево сечение или роды через естественные родовые пути, что выбрать?</p>', 'images/lectures/QrH34ppg6eMEAUztWomx0Z6HxczxLA-metacGV4ZWxzLXBhdmVsLWRhbmlseXVrLTcxMDgzNDQuanBn-.jpg', '203247764', 36, 65, 1, 0, '2023-05-09 17:01:07', '2023-06-25 20:16:25', 1, 2, 1, 1, 1),
(255, 'Беременность и ВПЧ инфекция', '<p>Беременность- это состояние физиологического иммунодефицита, поэтому во время беременности восприимчивость к вирусам и инфекционным процессам достаточно высокая, ВПЧ-инфекция в том числе. Можно ли во время беременности передать вирус папилломы человека ребенку? Когда стоит удалить кондиломы во время беременности? Дисплазия шейки матки во время беременности - это приговор? Также разберемся в диагностике, лечении и методах родоразрешения при ВПЧ-инфекции.</p>', 'images/lectures/YgkHStC6ZADTy4znUN66XGFQ08ZcHJ-metaQWRvYmVTdG9ja180MDkyMjYyMzUuanBn-.jpg', '203247757', 36, 66, 1, 0, '2023-05-09 17:02:41', '2023-06-26 14:28:26', 1, 2, 1, 1, 1),
(256, 'Аллергия во время беременности. Что делать?', '<p>В этом видео научимся распознавать симптомы аллергии и справляться с ними.<br>Вы узнаете:&nbsp;<br>1. Что такое аллергия: определение, механизмы развития и проявления;&nbsp;<br>2. Поллиноз, или сезонная аллергия, во время беременности&nbsp; -&nbsp; что можно и нельзя использовать;<br>3. Что такое перекрестная аллергия и как ее распознать;&nbsp;<br>4. Аллергия на домашних животных, клещей домашней пыли, плесень&nbsp; - как справляться во время беременности.</p>', 'images/lectures/4Vq1kSyY5wzLlP14JbXhy6nnlGe6cL-metaQWRvYmVTdG9ja18yOTcwMjM3MzIuanBn-.jpg', '203247711', 52, 66, 1, 0, '2023-05-09 17:04:41', '2023-06-26 14:33:53', 1, 2, 1, 1, 1),
(267, 'Растяжки. Как с ними бороться?', '<p>Растяжки или стрии - очень частое явление, с которым сталкиваются женщины. В особенности эта проблема актуальна во время беременности.&nbsp;</p><p>В этом видео Вы узнаете:&nbsp;<br>1. Причины, почему появляются растяжки;<br>2. Как стрии выглядят на коже и изменяются со временем;<br>3. Какие факторы усугубляют, а что, наоборот, препятствует развитию растяжек;<br>4. Что делать для профилактики растяжек во время беременности и какие наиболее эффективные методы коррекции существуют сегодня.&nbsp;</p>', 'images/lectures/3Dy0nuoLi9EjNtc1YkZnvZo59MXYV8-metacGV4ZWxzLWthcm9saW5hLWdyYWJvd3NrYS04MDkzMTM1LmpwZw==-.jpg', '203178985', 52, 68, 1, 0, '2023-05-13 18:53:45', '2023-06-25 20:33:01', 1, 2, 1, 1, 1),
(268, 'Что нельзя беременной? Противопоказания во время беременности. ', '<p>В этой лекции будут рассмотрены запреты, которые должна соблюдать каждая будущая мама во время беременности. Мы рассмотрим, какие привычки следует исключить, какие продукты необходимо убрать из рациона и объясним, почему это так важно.</p>', 'images/lectures/DeV4srIuqTlfc9FpAbZWRfoJdnVOwL-metaQWRvYmVTdG9ja18yNzE1ODExMDEuanBn-.jpg', '203178961', 45, 66, 1, 0, '2023-05-13 18:58:32', '2023-06-26 14:40:17', 1, 2, 1, 1, 1),
(269, 'Основные этапы развития плода', '<p>Этапы развития плода, безусловно, одна из важнейших тем в жизни каждой будущей мамы. Мы рассмотрим с Вами весь путь превращения крохотной клетки в маленького человека. Вы узнаете, что происходит с малышом внутри утробы матери, как он развивается неделя за неделей и что он чувствует. Также мы рассмотрим возможные риски и пути их предотвращения, чтобы Ваша беременность протекала легко и комфортно.</p>', 'images/lectures/UPhLPAJQAGFdQJyTYV1mXpx2PB7KDa-metaa2VsbHktc2lra2VtYS1JRThLZmV3QXAtdy11bnNwbGFzaCAoMikuanBn-.jpg', '203178960', 38, 67, 1, 0, '2023-05-13 19:00:05', '2023-05-13 19:14:50', 1, 2, 1, 1, 1),
(270, 'Многоплодная беременность - хорошо или плохо? ', '<p>В вашей жизни наступил счастливый момент –<strong> тест на беременность положительный.</strong> В радостных мыслях идете на УЗИ для подтверждения беременности, а там… Многоплодная беременность. В процессе сегодняшней беседы мы узнаем почему какие то близнецы похожи друг на друга как копия, а какие-то нет. Заглянем в книгу рекордов Гиннеса, чтобы узнать о беременностях с максимальным количеством малышей. Мы представим информацию, которая поможет избавить вас от лишних страхов при вынашивании многоплодной беременности и даже вдохновить на пополнение в семье.</p>', 'images/lectures/NHHPkZZseHdf9ZCM0ZaEXa61slwDfM-metaQWRvYmVTdG9ja18yNzUwMTg0NDcxLmpwZw==-.jpg', '203178948', 41, 66, 1, 0, '2023-05-13 19:24:38', '2023-06-26 15:29:34', 1, 2, 1, 1, 1),
(271, 'Интимная гимнастика во время беременности: польза для женского организма', '<p>Разберем какую пользу женскому организму приносит <strong>интимная гимнастика.</strong> Познакомимся со строением женской промежности. Детально рассмотрим показания и противопоказания для занятий интимной гимнастикой.</p>', 'images/lectures/ADofOBdG1JuIVrbi1JrNtQBEzhsZCO-metaQWRvYmVTdG9ja18xNTc0NDY4NjUuanBn-.jpg', '203178946', 45, 70, 1, 0, '2023-05-13 19:31:27', '2023-06-27 05:35:16', 1, 2, 1, 1, 1),
(272, 'Зуд кожи во время беременности', '<p>Цель этого видео - рассказать про основные причины возникновения кожного зуда во время беременности и способах его облегчения.&nbsp;</p><p>Вы узнаете:<br>1.	Что такое зуд кожи: определение и классификация;&nbsp;<br>2.	Причины кожного зуда;<br>3.	Анализы для выявления причин зуда кожи;<br>4.	Купирование зуда: разрешенные и запрещенные препараты во время беременности.&nbsp;</p>', 'images/lectures/PnScuicMlHiB2XHQH4gRPXMD5g9T6W-metaQWRvYmVTdG9ja18zMjIyNzQ2ODEuanBn-.jpg', '203881704', 52, 68, 1, 0, '2023-05-13 19:37:03', '2023-06-27 05:00:07', 1, 2, 1, 1, 1),
(276, 'Интимная гимнастика во время беременности. Упражнения Кегеля. ', '<p>Узнаем полезные эффекты от занятий интимной гимнастикой во время беременности. Познакомимся с изменениями в промежности женщины во время беременности, рассмотрим показания, противопоказания, а также примерный комплекс упражнений для беременных</p>', 'images/lectures/zKjJsevFNsAzZwyCr0F7Nafq152BFK-metaQWRvYmVTdG9ja18zMDczOTIxMDIuanBn-.jpg', '203178931', 45, 70, 1, 0, '2023-05-21 20:22:26', '2023-06-27 05:32:56', 1, 2, 1, 1, 1),
(277, 'Ведение родов при многоплодной беременности ', '<p>Вы вынашиваете многоплодную беременность и конечно же закономерно возникают вопросы о предстоящем родорозрешении. В рамках данного занятия мы разберем с вами наиболее часто возникающие и волнующие вас вопросы. Определимся с оптимальными сроками родоразрешения. В результате нашей беседы Вы поймете кому показано оперативное родоразрешение, а кто из вас может родить самостоятельно.</p>', 'images/lectures/wTbAREqXQwYJj5mnP1tLX25f3T5Kq3-metaQWRvYmVTdG9ja18yNzUwMTkwNjUuanBn-.jpg', '203178924', 41, 66, 1, 0, '2023-05-21 20:27:39', '2023-06-26 15:05:49', 1, 2, 1, 1, 1),
(278, 'Вакцинация во время беременности и на этапе планирования', '<p>Желаемый исход абсолютно любой беременности - это здоровый малыш. Вакцинация - крайне важный этап не только прегравидарной подготовки, но и самой беременности.<br>О том, как обезопасить себя от тяжелого течения инфекционных заболеваний и от постинфекционных осложнений , влияющих в том числе и на внутриутробное развитие плода, вы узнаете из этой лекции.</p>', 'images/lectures/qcNLgBcQk679YMJ41wmvOjRJWuoCSz-metaQWRvYmVTdG9ja180ODMzMDEyODIuanBn-.jpg', '203178906', 48, 66, 1, 0, '2023-05-21 20:33:29', '2023-06-26 15:07:09', 1, 2, 1, 1, 1),
(279, 'Молодые матери: как преодолеть основные риски первой беременности и родов', '<p>Подростковая беременность явление не только медицинское, но и социальное. Зачастую молодые мамы испытывают большое количество страхов, связанных не только с предстоящей беременностью и родами, но с негативным отношением общества к ним. В процессе беседы мы ответим на<br>вопросы, наиболее часто волнующие молодых мам, чтобы они чувствовали себя<br>более уверенно и четко понимали, что с ними происходит.</p>', 'images/lectures/oka5xVwApxv7UB6adGdCnbhQECOU7E-metaQWRvYmVTdG9ja180NjU4MTgyNDYuanBn-.jpg', '203178905', 41, 66, 1, 0, '2023-05-21 21:04:28', '2023-06-26 15:17:38', 1, 2, 1, 1, 1),
(280, 'Дети из пробирки. Беременность и роды после ЭКО. ', '<p>Неспособность зачать ребенка - это проблема, которая затрагивает огромное количество людей - как женщин, так и мужчин. Один из важнейших способов лечения бесплодия - это ЭКО, или экстракорпоральное оплодотворение. В нашей лекции мы подробно раскроем все секреты проведения данной процедуры: показания, противопоказания, технологию и расскажем про деток, рожденных у родителей после ее проведения.</p>', 'images/lectures/uZ7lJyEEsI0thZ6pbOu1SW1tklGof6-metaQWRvYmVTdG9ja18zMTE2NjI0MzkuanBn-.jpg', '203178893', 39, 66, 1, 0, '2023-05-21 21:07:37', '2023-06-26 15:20:03', 1, 2, 1, 1, 1),
(281, 'Беременность в зрелом возрасте: сколько лет - не преграда?', '<p>Поздняя беременность имеет свои нюансы и риски, но это не значит, что женщина обязательно пройдет через большие трудности со здоровьем. Современная медицина обладает всеми возможностями, чтобы такая беременность прошла максимально благополучно и для мамы, и для ее малыша. В процессе нашей беседы мы представим информацию, которая поможет избавить вас от лишних страхов и даже вдохновить на пополнение в семье.</p>', 'images/lectures/g8cFzp4gigFLNcZGmv8gDVZqyjwnn7-metaQWRvYmVTdG9ja18zNDMzMTQzODMuanBn-.jpg', '203178891', 41, 66, 1, 0, '2023-05-21 21:13:31', '2023-06-26 15:25:04', 1, 2, 1, 1, 1),
(282, 'Токсикоз и беременность: как понять, что происходит и что делать', '<p>Успешная беременность без неприятностей: лекция о том, как контролировать токсикоз. Мы расскажем вам, что это такое, как он влияет на беременность и как избежать его. Узнаете о правильном рационе питания, методах профилактики и когда необходима помощь специалиста. Присоединяйтесь к нам и получите полезные советы для комфортной беременности</p>', 'images/lectures/MU9HiHAuQReAy7dpku0O5DWhDyB7VV-metaQWRvYmVTdG9ja18zMDY1NDgwMjExLmpwZw==-.jpg', '203178875', 31, 65, 1, 0, '2023-05-21 21:19:07', '2023-06-26 15:16:28', 1, 2, 1, 1, 1),
(283, 'От зачатия до родов: как рассчитать срок родов?', '<p>«Когда же я стану мамой?»<br>Практически все беременные задаются этим вопросом, высчитывают сроки и очень расстраиваются, если их подсчеты не совпадают с подсчетами лечащего врача или результатами УЗИ. В этой лекции мы расскажем, как правильно посчитать срок, и объясним, почему сроки могут не совпадать. Небольшая лекция, но с конкретными данными и пояснениями. Приятного просмотра.</p>', 'images/lectures/fTNJZ45Hwi601bDLuEDvKKAYSIp44T-metaMjZfMS5wbmc=-.png', '203178763', 27, 62, 1, 0, '2023-05-21 21:25:43', '2023-06-25 16:33:41', 1, 2, 1, 1, 1),
(284, '\"Beauty-процедуры\" во время беременности и лактации', '<p>Такая важная тема и так мало информации о ней. В 21 веке сфера красоты развивается с огромной скоростью, и конечно, каждая женщина задается вопросом: <strong>«А можно ли во время беременности или грудного вскармливания делать ту или иную процедуру?»</strong> В этой лекции мы рассказываем про большую часть услуг в сфере красоты, начиная со стрижки и окрашивания волос до инъекционных процедур. И конечно, все подкрепляем научными объяснениями, почему эту процедуру можно делать, а другую нельзя. Приятного просмотра, надеемся, вы найдёте ответы на все ваши вопросы.</p>', 'images/lectures/McdKhEUfsvukY2QMJKteZhtyoR8MJ5-metacGV4ZWxzLWFubmEtc2h2ZXRzLTUwNjk1MDYuanBn-.jpg', '203178658', 27, 68, 1, 0, '2023-05-21 21:31:14', '2023-06-25 20:30:12', 1, 2, 1, 1, 1),
(285, 'Что такое скрининг?', '<p>Что такое скрининг и когда он проводится?<br>Как выбрать врача для проведения скрининга?<br>Сколько скринингов необходимо сделать, чтобы убедиться, что с ребенком всё в порядке?<br>Как проводится 1 скрининг?<br>Когда можно узнать пол малыша?<br>Какие самые современные методы диагностики для определения генетических аномалий существуют?<br>Инвазивные методы диагностики. Когда стоит их применять?</p>', 'images/lectures/5ZlcBrjqkUVTAgTYPBVnvuMlA6uctU-metacGV4ZWxzLW1hcnQtcHJvZHVjdGlvbi03MDg4ODQxLmpwZw==-.jpg', '203179019', 50, 69, 1, 0, '2023-05-24 19:59:59', '2023-10-16 22:49:58', 1, 2, 1, 1, 1),
(286, 'Мифы и правда о первом УЗИ ', '<p>Данный вебинар крайне полезен, особенно для беременных. Вы узнаете насколько важно выполнение УЗИ. Когда нужно сделать первое УЗИ? Всегда ли можно доверять данному методу, особенно при определении пола. Развеем с Вами некоторые мифы. Коснемся основных вопросов многоплодной беременности.</p>', 'images/lectures/QIQE9ef4f4lCN811wVfdBZCCKcKcra-metaNi5qcGc=-.jpg', '203179002', 49, 69, 1, 0, '2023-05-24 20:12:17', '2023-10-16 22:50:57', 1, 2, 1, 1, 1),
(287, '6 врачей, которых стоит посетить беременной', '<p>В этом видео вы узнаете, какие изменения можно считать индивидуальной нормой и какие требуют особого внимания. Мы также подробно расскажем о врачах, которых необходимо посетить во время беременности, чтобы вы получили важные советы и поддержку для поддержания вашего здоровья.</p>', 'images/lectures/XsGBjkS5aGp6rRfkluhgMpS34lAQMQ-metacGV4ZWxzLWtzZW5pYS1jaGVybmF5YS01NzY2MDcyLmpwZw==-.jpg', '203178993', 49, 69, 1, 0, '2023-05-24 20:19:33', '2023-10-16 23:04:49', 1, 2, 1, 1, 1),
(288, 'Что делать с акне во время беременности?', '<p>Цель этого видео – рассказать, как правильно выбирать средства по уходу за кожей с акне, какие препараты разрешены и запрещены во время беременности.&nbsp;<br>Вы узнаете:&nbsp;<br>1. О причинах акне, формах и проявлениях;<br>2. Какие продукты могут негативно влиять на течение угревой болезни;&nbsp;<br>3. Какие средства можно использовать во время беремености, а какие категорически запрещены;<br>4. Поговорим про уход за кожей, склонной к анне, в домашних условиях.</p>', 'images/lectures/nmz5k5iHmmD8yMMhWbqYfXFOSxQCas-metacGV4ZWxzLWFubmEtbmVrcmFzaGV2aWNoLTY0NzYwODEuanBn-.jpg', '203247710', 52, 68, 1, 0, '2023-05-25 08:56:42', '2023-06-25 20:29:19', 1, 2, 1, 1, 1),
(289, 'Как питаться беременной женщине?', '<p>«Доктор, а можно мне кофе?А суши? А сладкое? А какие витамины мне принимать?» В этой лекции мы ответим на все ваши вопросы, объясним почему именно так и никак иначе. Увидим, как отвечает мировая наука на эти вопросы. И наконец выясним: «Нормальная прибавка веса во время беременности, это сколько?»</p>', 'images/lectures/0n6MjRZqyvqv6KTDZryqEbxWVAJyBA-metaQWRvYmVTdG9ja180MzUzNjU3MTguanBn-.jpg', '203178799', 27, 66, 1, 0, '2023-05-27 06:48:19', '2023-06-26 15:24:28', 1, 2, 1, 1, 1),
(290, 'Похудение после родов', '<p><em>&nbsp;\"Что я могу съесть? Когда я смогу потренироваться? Какие упражнения я могу выполнять? И как я могу совместить все это с грудным вскармливанием?\" </em>Ответы на эти и многие другие вопросы будут даны на этом вебинаре. Вас ждёт 30 минут любви к себе.</p>', 'images/lectures/WeMxb5n1rkHBLbkc4l6IYrHSAAtz2A-metacGV4ZWxzLXNodmV0cy1wcm9kdWN0aW9uLTY5NzU0ODguanBn-.jpg', '203178834', 27, 61, 1, 0, '2023-05-28 13:34:55', '2023-06-25 16:22:22', 1, 2, 1, 1, 1),
(291, 'Колики у малыша. Как быть и что делать? Часть 2', '<p>Любого родителя испугает, когда его ребенок длительно плачет без видимой причины. В этой лекции мы узнаем причины плача, на которые родитель может повлиять, прежде чем подозревать колики.&nbsp;<br>Обсудим с вами, что не желательно делать до приема врача педиатра. Познакомимся с состоянием, которое встречается у каждого малыша - «Младенческая дисхезия», является ли оно нормой и как быть родителям. Поговорим о таком грозном состоянии здоровья ребенка, как синдром «встряхнутого младенца», как избежать подобного и как важно родителям делать перерывы и помогать друг другу.&nbsp; Также узнаем новый термин «Фиолетовый плач», что это такое и что делать родителям, если они его заподозрили.&nbsp; В первой лекции мы познакомились с понятием младенческих колик, как уменьшить риски их возникновения и как можно помочь малышу. А в этой узнаем, какие препараты можно использовать при коликах.</p>', 'images/lectures/LRNoUpUVsmWlmlBw1zfb2Jj25bPLdT-metacGV4ZWxzLWh1eW5oLXZhbi05MzAwNjE0LmpwZw==-.jpg', '203882164', 29, 74, 1, 0, '2023-05-28 15:26:12', '2023-06-25 19:47:44', 1, 2, 1, 1, 1),
(292, '11 мифов о коликах', '<p>Многие из родителей сталкивались с таким состояниям у малышей как колики.&nbsp;<br>Слышали различные советы как с ними бороться, почему они мучают малыша, что давать ребенку и что есть маме.&nbsp; Чтобы разобраться, что является правдой, а что мифом, мы обсудим 11 самых распространенных мифов связанные с младенцами и коликами в этой лекции.</p>', 'images/lectures/WAGnlwEeehNDojGWpN0OGW0dGQcUVy-metacGV4ZWxzLWxlb25hcmRvLWx1ei0xNTEyODA2OS5qcGc=-.jpg', '203881764', 29, 74, 1, 0, '2023-05-28 15:27:42', '2023-06-25 19:47:00', 1, 2, 1, 1, 1),
(293, 'Опрелости и пеленочный дерматит: как предотвратить и лечить?', '<p>Опрелости – название кожных поражений, часто встречающихся у детей раннего возраста, связанные с трением и/или контактом с выделениями. В этом видео врач дерматолог, аллерголог, к.м.н. MBA Юдина Марина Михайловна рассказывает о правильном уходе за кожей младенцев для профилактики опрелостей и пеленочного дерматита. Вы узнаете о причинах, предрасполагающих факторах, лечении и профилактике опрелостей. Особое внимание уделено частому состоянию у младенцев – Пеленочному дерматиту.</p>', 'images/lectures/TKKWiIVfCTdVnkpMIhcj0cdHodtD8r-metaaXphYmVsbHktbWFycXVlcy1oYWctaFRzcGZKWS11bnNwbGFzaC5qcGc=-.jpg', '203881589', 52, 72, 1, 0, '2023-05-28 15:31:07', '2023-06-25 19:07:59', 1, 2, 1, 1, 1),
(294, 'Колики у малыша. Как быть и что делать? Часть 1', '<p><strong>Младенческие колики </strong>- одна из самых частых причин обращения к педиатру, это состояние малыша, которое приносит ему дискомфорт и очень сильно тревожит родителей, потому что они порой не знают, как правильно помочь малышу.&nbsp;<br>В этой лекции мы с вами узнаем, что такое колики, когда и почему они возникают, что является причиной. Какие вопросы будет задавать вам педиатр, что поможет в постановке диагноза. Какие существуют факторы риска, можно ли на них заранее повлиять, чтобы избежать колик. А также как важно сохранять психологический комфорт дома и что можно сделать, чтобы помочь малышу облегчить состояние.</p>', 'images/lectures/ZokyyvjYbbpq1TuE4Z9C6AyBX70D9g-metaNTUuanBn-.jpg', '203881565', 29, 74, 1, 0, '2023-05-28 15:32:26', '2023-06-25 19:43:26', 1, 2, 1, 1, 1),
(295, 'Как накормить малыша без грудного молока? ', '<p>Если грудное вскармливание невозможно или противопоказано, то единственный способ накормить новорожденного и малыша первых месяцев жизни - дать&nbsp; детскую молочную смесь. Какие существуют правила искусственного вскармливания разберем на лекции “Как накормить малыша без грудного молока?”</p>', 'images/lectures/bDFFuoM6RpCp0WxCULtccvw3L0JJeY-metacGV4ZWxzLXNhcmFoLWNoYWktNzI4MjMyMi5qcGc=-.jpg', '203881552', 54, 73, 1, 0, '2023-05-28 15:38:42', '2023-06-25 19:20:50', 1, 2, 1, 1, 1),
(296, 'Как выбрать детскую. Смесь?', '<p>Проблема рационального вскармливания особенно актуальна для новорожденных и малышей раннего возраста. И если малыш, находящийся на грудном вскармливании, получает все необходимое в нужном количестве с молоком мамы, то при искусственном вскармливании вся надежда ложится на детскую молочную смесь. Как правильно выбрать заменитель материнского молока и на какие факторы стоит обратить внимание разберем на занятии “Как выбрать детскую смесь?”</p>', 'images/lectures/D6tNZZpw7dDBLWelBpUv2AoR2pQVwJ-metacGV4ZWxzLW1hcnQtcHJvZHVjdGlvbi03NDkxMjcxLmpwZw==-.jpg', '203881535', 54, 73, 1, 0, '2023-05-28 15:39:51', '2023-06-25 19:33:25', 1, 2, 1, 1, 1),
(297, 'Топ 10 аксессуаров для искусственного вскармливания', '<p>Искусственное вскармливание требует выполнения&nbsp; правил по выбору и приготовлению смеси и наличия определенных аксессуаров. Например, Вам не обойтись без бутылочки и соски. Какие еще предметы потребуются, чтобы кормление малыша было удобным и безопасным, рассмотрим в этой лекции.&nbsp;</p>', 'images/lectures/AmrAFOCNldUWMA3z4Tje61KoZTgY1e-metacGV4ZWxzLXB1YmxpYy1kb21haW4tcGljdHVyZXMtNDEyMjIuanBn-.jpg', '203881514', 54, 73, 1, 0, '2023-05-28 15:43:01', '2023-06-25 19:39:11', 1, 2, 1, 1, 1),
(298, 'Безопасный сон малыша', '<p>В этой лекции мы обсудим, как обеспечить безопасность сна для вашего малыша. Вы узнаете о главных причинах смертности младенцев во время сна и о важных мерах по предотвращению их возникновения. Мы также обсудим правильную организацию места для сна, выбор подходящего матраса и постельного белья, а также правильную температуру и влажность в комнате. Рассмотрим техники самостоятельного засыпания. Вас ждет интересная и информативная лекция, которая поможет вам обеспечить комфортный и безопасный сон вашему малышу.&nbsp;</p>', 'images/lectures/bZrxSdL5yOpS4WQCOF9PpwFZNL979c-metaNTYuanBn-.jpg', '203881513', 29, 78, 1, 0, '2023-05-28 15:52:26', '2023-06-25 19:57:28', 1, 2, 1, 1, 1),
(299, 'Ухаживаем за кожей младенца правильно', '<p>Первый год жизни – очень важный период в плане созревания кожи и формирования кожного иммунитета. Правильный уход за кожей младенца важен для поддержания здоровья в целом.&nbsp;<br>В этом видео Вы узнаете:&nbsp;<br>1. Особенности кожи младенца;<br>2. Что такое физиологическая сухость кожи и как ухаживать за кожей в этот период;&nbsp;<br>3. Подробно разберем процесс купания и особенности ухода за кожей головы;<br>4. Поговорим про гигиену глаз, ушей, носа;<br>5. Научимся правильно защищаться от ультрафиолета.</p>', 'images/lectures/f45Alc3lF2a3av7rHk7Q9EAXvfZniO-metaMzguanBn-.jpg', '203322435', 52, 77, 1, 0, '2023-05-28 16:00:39', '2023-06-25 19:54:59', 1, 2, 1, 1, 1);
INSERT INTO `lectures` (`id`, `title`, `description`, `preview_picture`, `content`, `lector_id`, `category_id`, `is_published`, `is_recommended`, `created_at`, `updated_at`, `content_type_id`, `payment_type_id`, `show_tariff_1`, `show_tariff_2`, `show_tariff_3`) VALUES
(300, 'Сухая кожа у ребенка - в чем причина и как ухаживать', '<p>Сухость кожи встречается примерно у трети всех детей. Цель этого видео - рассказать о правильном уходе за кожей, склонной к сухости.<br>Вы узнаете:<br>1. Что такое&nbsp; “физиологическая сухость кожи младенцев”;<br>2. Почему часто причина ксероза – атопический дерматит;<br>3. Как проявляется заболевание кожи ”Ихтиоз”;<br>4. Что представляют собой эмоленты и как их выбрать правильно;<br>5. Какие продукты необходимо включить в питание при сухости кожи.</p>', 'images/lectures/HRbNcXaGw1Vvddj20aZI0heOKndAXN-metaQWRvYmVTdG9ja18zODY0MzM0NDMuanBn-.jpg', '203322423', 52, 72, 1, 0, '2023-05-28 16:02:28', '2023-10-16 23:24:26', 1, 2, 1, 1, 1),
(301, 'Себорея и акне новорожденных. Как лечить?', '<p>В этом видео наша цель - научиться правильно распознавать акне и себорею у младенцев, а также правильно ухаживать за кожей ребенка при этих состояниях.&nbsp;<br>Вы узнаете:&nbsp;<br>1. Что такое акне новорожденных: определение, причины и проявления;&nbsp;<br>2. С чем можно перепутать младенческие акне – распознаем правильно!&nbsp;<br>3. Рекомендации по уходу за кожей при акне новорожденных;<br>4. Себорейные корочки – что это и нужно ли лечить;<br>5. Уход за кожей головы при себорее у младенца.</p>', 'images/lectures/5YSaAO3h4RGlqO3ALoGxA1FWhIV91F-metaQWRvYmVTdG9ja180MzM4NTM0MjEuanBn-.jpg', '203322413', 52, 72, 1, 0, '2023-05-28 16:04:02', '2023-10-16 23:23:29', 1, 2, 1, 1, 1),
(302, 'Вакцинация новорожденных', '<p>Вакцинация - это слово, которое вызывает множество эмоций у современных родителей, особенно когда речь заходит о прививках для новорожденных детей. В нашей лекции мы расскажем, какие прививки должен получить малыш в роддоме, чтобы быть защищенным от серьезных заболеваний, расскажем о распространенных мифах, окружающих вакцинацию, чтобы будущие родители были максимально осведомлены и подготовлены к моменту рождения ребенка.</p>', 'images/lectures/k6dZUJg1mRGEwtafG8pPqld60rAtVo-metaY2RjLUNPVjAwbEVWM2ZNLXVuc3BsYXNoLmpwZw==-.jpg', '203322408', 39, 71, 1, 0, '2023-05-28 16:08:53', '2023-06-25 18:49:08', 1, 2, 1, 1, 1),
(303, 'Режутся зубки? Есть решение!', '<p>В лекции будет рассмотрен процесс прорезывания зубов, периоды, когда происходит это событие и сколько зубов должны прорезаться у младенца. Также будут обсуждаться симптомы прорезывания зубов, что помогает облегчить симптомы, что не следует использовать и как ухаживать за первыми зубами.</p>', 'images/lectures/AXjzYY2dCSGgeLr0Bj6qlbJwR9wqYR-metacGV4ZWxzLXBpeGFiYXktNDcwOTAuanBn-.jpg', '203322514', 55, 74, 1, 0, '2023-05-28 16:27:47', '2023-06-25 19:50:02', 1, 2, 1, 1, 1),
(304, 'Плавание для грудников - мода или польза? Часть 1', '<p>В этой теме изложено, что представляет из себя грудничковое плавание, благодаря кому и как оно развивалось, стало популярным и закрепилось в медицинских рекомендациях. Какую пользу для малыша несёт грудничковое плавание и какие к нему существуют показания, в чем плюсы и минусы такого плавания.</p>', 'images/lectures/O9ija3ER9x60ReCpKlBHnnJ1bMsVGj-metaNTRfMS5qcGc=-.jpg', '203322497', 29, 75, 1, 0, '2023-05-28 16:30:45', '2023-06-25 19:53:25', 1, 2, 1, 1, 1),
(305, 'Плавание для грудников - мода или польза? Часть 2', '<p>Как обеспечить здоровье и правильное развитие вашего ребенка с самого раннего возраста? Узнайте, на чем основаны главные принципы грудничкового плавания и какие возрастные ограничения следует учитывать при занятиях. Ознакомимся с противопоказаниями и ограничениями для занятий, а также узнаем где лучше начинать занятия, в домашней ванне или специальной бассейне. Вы узнаете, как проходят занятия, какие упражнения выполняются и как они влияют на физическое и психологическое развитие малышей.&nbsp;</p>', 'images/lectures/KVB0Laq3liDDk4cQpJ7gN1lKFmOswO-metacGV4ZWxzLXlhbi1rcnVrYXUtNDY2ODk1NS5qcGc=-.jpg', '203322499', 29, 75, 1, 0, '2023-05-28 16:36:29', '2023-06-25 19:53:56', 1, 2, 1, 1, 1),
(306, 'Нужно ли пеленать ребенка? Разбираемся вместе', '<p>Пеленание - пережиток прошлого или эффективный метод успокоения ребенка? Чем пеленание может помочь в уходе за грудничком? Какой способ пеленания выбрать и почему? Какие недостатки у этого метода и как обеспечить безопасность? Кому такой способ подходит, а кому – нет?&nbsp;</p>', 'images/lectures/lbqpXwQegrSWviHTREpJdtr9pBB7KK-metaamltbXktY29ub3Zlci1MdEtvVzZraDJlRS11bnNwbGFzaC5qcGc=-.jpg', '203322485', 55, 74, 1, 0, '2023-05-28 16:51:48', '2023-06-25 19:48:51', 1, 2, 1, 1, 1),
(307, 'Виды прикормов. С чего начать? Часть 2', '<p>В этой лекции мы познакомфимся с правилом постепенного увеличения объема прикорма, как вводить новые продукты в питание малыша. Узнаем какие последствия есть у раннего и позднего введения прикорма, с какими трудностями могут столкнуться родители? Что лучше и полезнее, продукты промышленного производства или собственного приготовления, в чем сложность?</p>', 'images/lectures/pZcsfD3r8AklKtbkHQe2CjIcpoyQpc-metacGV4ZWxzLXlhbi1rcnVrYXUtNDY2OTAyMC5qcGc=-.jpg', '203322478', 29, 73, 1, 0, '2023-05-28 16:53:22', '2023-06-25 19:42:26', 1, 2, 1, 1, 1),
(308, 'Виды прикормов. С чего начать? Часть 1', '<p>Введение прикорма важное событие в каждой жизни малыша, таким образом мы знакомим ребенка с новыми продуктами, открываем ему мир других вкусов, следим за его развитием. В этой лекции мы познакомимся с основными принципами введения прикорма, с чего следует начать, какой будет первый продукт и как его выбрать. Как введение прикорма связанно с развитием аллергии. А также разберем, какие продукты не следует давать ребенку до года.</p>', 'images/lectures/5YWQLxHHIR1QncqU7ZU5nE0C98TSfb-metacGV4ZWxzLWhlbGVuYS1sb3Blcy00NDA5MjQ1LmpwZw==-.jpg', '203322465', 29, 73, 1, 0, '2023-05-28 16:54:59', '2023-06-25 19:41:13', 1, 2, 1, 1, 1),
(310, 'АЛЛЕРГИЯ У РЕБЕНКА: как понять, в чем причина', '<p>Проявления аллергии у детей крайне многообразны. Как понять, что происходит с ребенком, какие анализы сдавать и как лечить -&nbsp; ответы на эти вопросы Вы получите в данной лекции.<br>Вы узнаете:<br>1. что такое аллергия и почему она развивается;<br>2. как проявляется аллергия у детей – основные симптомы со стороны кожи и слизистых;<br>3. как найти аллерген: современные анализы крови и кожные тесты у аллерголога на приеме;<br>4. поллиноз, аллергия на домашних животных, клещей домашней пыли, плесень – что делать;<br>5. какие препараты и с какого возраста разрешены детям, что такое АСИТ.</p>', 'images/lectures/8F16qOt2X1bw1Vp4VmSfGliLXUrPzC-metaQWRvYmVTdG9ja18zMzMwMjY1NTEuanBn-.jpg', '203322376', 52, 72, 1, 0, '2023-05-28 17:01:40', '2023-10-16 23:22:52', 1, 2, 1, 1, 1),
(311, 'Атопический дерматит  у детей первого года жизни. Важные аспекты. ', '<p>Атопический дерматит – очень частое заболевание у детей первых лет жизни. В этом видео научимся правильно и во время распознавать симптомы атопического дерматита у ребенка.&nbsp;<br>Вы узнаете:&nbsp;<br>1. о распространенности атопического дерматита сегодня в мире;<br>2. как врачи ставят диагноз и какие критерии диагностики используются;&nbsp;<br>3. как проявляется атопический дрематит у детей первого года жизни и как оценить степень тяжести;<br>4. какие анализы сдавать и с какого возраста;<br>5. питание – нужно ли соблюдать диету и какую.</p>', 'images/lectures/N0cl17mV2QfmtSLldgxSRal0o3hxFe-metaQWRvYmVTdG9ja18xNzcxOTUwOTcuanBn-.jpg', '203322375', 52, 72, 1, 0, '2023-05-28 17:02:36', '2023-10-16 23:25:37', 1, 2, 1, 1, 1),
(312, 'Рождение ребенка - счастье или кризис в семье?', '<p>Младенец - это новый член семьи, который должен занять в ней свое место. С рождением ребенка жизнь супругов идет по новому сценарию. Меняются отношения, роли в семье, семейные обязанности и досуг. Пережить кризис рождения ребенка и сохранить теплые отношения в паре поможет наша лекция.</p>', 'images/lectures/tjSrbAPFaICRcJfWxv6vWxzQGa2HNf-metaQWRvYmVTdG9ja18yODY1OTgzMDUuanBn-.jpg', '203469126', 35, 60, 1, 0, '2023-05-28 18:55:04', '2023-06-27 05:57:12', 1, 2, 1, 1, 1),
(313, 'Родительское выгорание. Что делать, если оно наступило и как его избежать.', '<p>Как не допустить выгорания в родительстве и что делать, если оно уже наступило? Можно уволиться с нелюбимой работы, но невозможно перестать быть родителем. Вы увидите разницу между обычной усталостью, выгоранием и депрессией. Научитесь по ранним признакам определять приближающееся эмоциональное истощение. Поймете, как отыскать ресурс внутри себя, чтобы воспитание ребенка приносило радость</p>', 'images/lectures/Tlg9qtrpH6uYABQmHdqlFRuHZP4dc8-metaQWRvYmVTdG9ja181MTk1Nzk3NzMuanBn-.jpg', '203469121', 35, 60, 1, 0, '2023-05-28 18:56:25', '2023-06-27 05:59:15', 1, 2, 1, 1, 1),
(314, 'Психическое развитие ребенка от рождения до 3х лет', '<p>Ранний возраст - чрезвычайно важный период для развития ребенка. В этом возрасте закладываются способности, представления о мире, зарождается игра и речь. В лекции мы рассмотрим основные показатели развития ребенка. Обозначим, что является нормой развития, а что - поводом для обращения к специалисту. Лекция содержит рекомендации, как самостоятельно создать для ребенка развивающую среду.</p>', 'images/lectures/sRsuU0Zslj6Pgf8wffdonLoTCU8npU-metacGV4ZWxzLWl2YW4tc2Fta292LTg1MDQyOTAuanBn-.jpg', '203469104', 35, 59, 1, 0, '2023-05-28 18:57:57', '2023-06-27 05:39:36', 1, 2, 1, 1, 1),
(315, 'Природа родительской любви. Типы привязанности и как они формируются.', '<p>Привязанность — это наш самый ранний опыт близких отношений, который влияет на всю нашу жизнь. Как сделать отношения с ребенком более близкими и надежными? Как определить, какой тип привязанности формируется между вами и вашим малышом и вовремя скорректировать родительское поведение? Лекция поможет лучше понимать сигналы ребенка в первый год жизни и отвечать на них верно.</p>', 'images/lectures/v323MdAyzombDJkpUh87vemDUe6gre-metacGV4ZWxzLXZsYWRhLWthcnBvdmljaC00NjA5MDQ2LmpwZw==-.jpg', '203469103', 35, 59, 1, 0, '2023-05-28 19:00:10', '2023-06-27 05:42:11', 1, 2, 1, 1, 1),
(316, 'Природа родительской любви. Инстинкты', '<p>Как правильно реагировать на крик ребенка? Что значит быть “достаточно хорошей матерью”? Почему отсутствие контакта ребенка с матерью ведет к тяжелейшим нарушениям психического здоровья? Как эволюция позаботилась о том, чтобы мы были заботливыми родителями? Ответы вы найдете в лекции “Природа родительской любви. Инстинкты”.&nbsp;</p>', 'images/lectures/qRuWntByd28Of5CXDsh9uurogHlnz1-metacGV4ZWxzLXBhdmVsLWRhbmlseXVrLTcyMjA1MDQuanBn-.jpg', '203469075', 35, 59, 1, 0, '2023-05-28 19:01:22', '2023-06-27 05:43:42', 1, 2, 1, 1, 1),
(317, 'Нужно ли сравнивать ребенка?', '<p>Многие родители привыкли сравнивать своих детей с другими, ведь они убеждены, что таким образом смогут мотивировать его на развитие. Дает ли сравнение нужный эффект? На лекции мы поговорим о том, какие последствия вызывает сравнение, поймем, почему все дети такие разные и научимся позитивным родительским высказываниям, которые будут настраивать ребенка на успех.</p>', 'images/lectures/RM0VOYkRg2QurQ6bat5EuIilAoaMnb-metacGV4ZWxzLWl2YW4tc2Fta292LTg1MDQzMzUuanBn-.jpg', '203469074', 35, 59, 1, 0, '2023-05-28 19:02:32', '2023-06-27 05:48:18', 1, 2, 1, 1, 1),
(318, 'Психологические проблемы женщин родивших с помощью Кесарева сечения', '<p>Кесарево сечение – один из самых распространенных методов родовспоможения, который может применяться в случае необходимости сохранения жизни матери или ребенка. Однако и после успешного проведения операции женщинам, родившим с помощью кесарева сечения, могут возникать психологические проблемы. Эти проблемы могут быть связаны как с самим процессом операции и периодом восстановления, так и с вопросами воспитания и ухода за ребенком, а также социальной адаптации в новых ролях матери и супруги. В рамках данной лекции будут рассмотрены основные психологические проблемы женщин, которые родили с помощью кесарева сечения, и методы их решения.&nbsp;</p>', 'images/lectures/NF9MCNdf2QP11jGtZYFOtmY2Wv2euu-metacGV4ZWxzLWVtbWEtYmF1c28tMzU4NTgxMS5qcGc=-.jpg', '203881608', 34, 51, 1, 0, '2023-05-29 17:58:15', '2023-06-25 16:21:37', 1, 2, 1, 1, 1),
(319, ' 3 триместр -психологические особенности беременности', '<p>Это время, когда вы начинаете готовиться к родам как физически, так и эмоционально. Это время, когда вы ожидаете рождения ребенка и испытываете повышенное беспокойство и беспокойство по поводу родов. Вы можете испытывать более сильную физическую боль в шее, ногах и спине, что может ухудшить ваше настроение. С растущим дискомфортом растет и уровень вашего разочарования.&nbsp; Становится более важным сохранять спокойствие, поскольку все эти эмоциональные изменения могут повлиять на ребенка. Беременность - это опыт трансформации, развития и обогащения. Для профилактики нежелательных осложнений беременности Вам необходимо лишь вовремя «постелить соломку», чтобы не упасть, а если уж падать, то очень мягко и не больно.&nbsp;</p>', 'images/lectures/vOatBpvH0S08Mrdb0HPhWfXkN9OQUs-metaMzlfMi5qcGc=-.jpg', '203881603', 34, 60, 1, 0, '2023-05-29 18:00:01', '2023-06-29 07:48:23', 1, 2, 1, 1, 1),
(320, '1 триместр -психологические особенности беременности', '<p>Как меняется тело во время беременности известно многим. А что же в этот момент происходит в психологическом пространстве женщины? Какую гамму чувств и эмоций переживает будущая мама на протяжении долгих месяцев ожидания своего малыша? Правда ли, что будущая мама должна испытывать только позитивные эмоции? Поговорим о вопросах принятия решения, осознания беременности.</p>', 'images/lectures/25ON0uFjnB6jeBGwaIB6ibab3RHgHQ-metaQWRvYmVTdG9ja181NDQ4NTc4MDcuanBn-.jpg', '203383526', 34, 60, 1, 0, '2023-05-29 18:01:47', '2023-06-29 07:47:51', 1, 2, 1, 1, 1),
(321, ' 2 триместр -психологические особенности беременности', '<p>Второй триместр беременности женщина живёт довольно активной жизнью. Любое событие, которое ведёт к глобальным переменам в нашей жизни (т.е. так, как раньше, уже больше никогда не будет), радостное оно или печальное является для психики травматическим. Беременность, как вы уже догадались, относиться к данной категории, поскольку меняет жизнь женщины кардинально. Мы поговорим об ощущении внутреннего спокойствия и поиске утраченных возможностей.</p>', 'images/lectures/C9avMd80PV0Cwfd87VFUnUcYqnfh4H-metaQWRvYmVTdG9ja180ODEzNTI3MDkuanBn-.jpg', '203383513', 34, 60, 1, 0, '2023-05-29 18:29:55', '2023-06-29 07:44:12', 1, 2, 1, 1, 1),
(322, 'Психологическая подготовка к родам', '<p>Очень важно познакомить беременных женщин&nbsp; с аспектами психологической подготовки к родам . Также в рамках данной темы рассмотрим взаимоотношения родителей и подготовку старших детей к рождению малыша. Мы рассмотрим уровни подготовленности к родам,&nbsp; определим составляющие готовности к родам, рассмотрим советы для папы, поговорим&nbsp; о том как подготовить старшего ребенка к рождению малыша. Мы делим уровень подготовленности к родам на три степени. Вы сможете попробовать оценить собственный уровень подготовки, даже если до родов вам еще далеко.&nbsp;</p>', 'images/lectures/HAqwnr2vVZW1z4uUQ9lccn7vKBugzw-metaNDlfMS5qcGc=-.jpg', '203383494', 34, 60, 1, 0, '2023-05-29 18:34:21', '2023-06-29 07:36:40', 1, 2, 1, 1, 1),
(323, 'Послеродовая депрессия - как помочь себе?', '<p>В продолжении разговора о послеродовой депрессии, хотелось бы остановиться на том как Вы можете помочь себе на ранних стадиях самостоятельно. Мы все живем в огромном мегаполисе и зачастую физически не можем мгновенно попасть на прием к узкому специалисту. Сегодня я расскажу Вам о том, что Вы можете делать дома самостоятельно, не причинив себе вред и не усугубив состояние. Разберем примеры, структурируем действия. Затронем такое понятие как «когнитивные искажения» и на что они влияют.</p>', 'images/lectures/4INbZMEquJwApvw1IIR1pTHTGgYDK5-metaQWRvYmVTdG9ja180NDc2NjgwMzEuanBn-.jpg', '203383493', 34, 60, 1, 0, '2023-05-29 18:40:23', '2023-06-27 05:51:55', 1, 2, 1, 1, 1),
(324, 'Послеродовая депрессия - это неизбежность?', '<p>Что же такое послеродовая депрессия, каковы ее виды и способы решения? Поговорим о видах постнатальных расстройств, причинах, симптомах, проявлениях и затронем лечение этого недуга. Именно лечение, так как <strong>послеродовая депрессия - это медицинский диагноз</strong>. Согласно диагностическим критериям МКБ-10, диагноз постнатальной депрессии устанавливается, если&nbsp; депрессивный синдром, соответствующий критериям депрессивного расстройства, развился в течение 6 недель после родов. Рассмотрим Эдинбургскую шкалу послеродовой депрессии. Это клиническая скрининговая методика в виде самоопросника, предназначенная для выявления депрессивный расстройств в послеродовом периоде.</p>', 'images/lectures/VYsC5Ud91MZm6LndkuOLqiRrE3U8Vo-metacGV4ZWxzLWFuZHJlYS1waWFjcXVhZGlvLTM4MTI3NDYuanBn-.jpg', '203383477', 34, 60, 1, 0, '2023-05-29 18:42:23', '2023-06-27 05:51:22', 1, 2, 1, 1, 1),
(325, 'Популярные страхи беременной женщины. Как с ними бороться?', '<p>Целью данной темы является рассказать Вам о том, что тревоги и страхи во время беременности могут возникать, но важно дифференцировать их влияние на течение беременности. В ходе раскрытия темы обязательно дадим определение таких понятий как страх, тревога. Выявим причины страхов, а также распределим их в группы. Дадим советы беременной женщине склонной к чрезмерному беспокойству. А также поговорим о том, какая работа проводится в рамках психологического сопровождения беременности.</p>', 'images/lectures/shED8ETEkG6JYodtglKX1DDlVV9nAF-metaQWRvYmVTdG9ja18yOTE5NTg4ODAuanBn-.jpg', '203383474', 34, 60, 1, 0, '2023-05-29 18:43:49', '2023-06-27 05:54:48', 1, 2, 1, 1, 1),
(326, 'Создание неразрывной связи: вклад грудного вскармливания в эмоциональную связь матери и ребенка', '<p>Какое же влияние этого процесса&nbsp; на развитие ребенка? Мы с Вами рассмотри эту тему в рамках психологии, в рамках тех связей которые формируются у мамы и у ребенка. Моя задача заключается в том чтобы&nbsp; рассказать Вам о том, как грудное вскармливание и психическое здоровье матери и ребенка взаимосвязаны между собой. Рассмотрим психологические причины проблем с грудным вскармливанием, психоэмоциональные аспекты. А также обсудим правильную организацию грудного вскармливания.</p>', 'images/lectures/jJhUomQdYGISKXbfb3uFjf6zjm8v5e-metaaGVsZW5hLWxvcGVzLXVkb2Zfcm9FSG5rLXVuc3BsYXNoLmpwZw==-.jpg', '203383445', 34, 60, 1, 0, '2023-05-29 18:46:24', '2023-06-27 05:52:43', 1, 2, 1, 1, 1),
(327, 'Взгляд мужчины на рождение и воспитание ребенка ', '<p>Поговорим о мужской психологии. В рамках данной темы рассмотрим что чувствует мужчина, становясь папой.&nbsp; Рассмотрим первую реакцию мужчины, ожидание на новость о беременности; поговорим о родах и беременности глазами мужчин; а также о самом важном, о чем переживают будущие папы; поговорим о чувствах молодого папы; проговорим ожидания от первой встречи с малышом после рождения; рассмотрим разные типы отцов. Тема нашей встречи обширная, интересная. Рассмотрим беременность с позиции мужчин.</p>', 'images/lectures/QU3Z2EJ7hBLuey390Cfab5c66D0z2w-metaQWRvYmVTdG9ja18zMDUwMTAxNjEuanBn-.jpg', '203383444', 34, 60, 1, 0, '2023-05-29 18:48:49', '2023-06-27 05:50:06', 1, 2, 1, 1, 1),
(328, 'Дыхание в родах', '<p>Дыхание в родах - это тот самый инструмент,который поможет вам не только расслабить организм, но и облегчить боль, и даже укоротить период схваток. Подготовленная к родам женщина - это уже большой процент успеха и положительного исхода. Этот вебинар поможет вам в самом важном этапе жизни.</p>', 'images/lectures/K3VKi0wYYCuSjtwnfJEnCkVSuBlBSg-metaQWRvYmVTdG9ja18yNTI4MTMzNzQuanBn-.jpg', '203881756', 27, 64, 1, 0, '2023-05-30 17:54:54', '2023-06-25 16:46:32', 1, 2, 1, 1, 1),
(329, ' Восстановление интимной зоны после родов. Эстетическая гинекология.', '<p>Вне зависимости от возраста мечта каждой женщины оставаться всегда привлекательной и сексуальной, как для себя, так и для своего партнера. Эстетическая гинекология - это как раз про это. Каждая женщина после родов интересовалась вопросами коррекции интимной зоны, а в этой лекции&nbsp; мы как раз обсудим причины приводящие к изменениям интимной зоны и современные методы лечения, применяемые в эстетической гинекологии для коррекции послеродовых изменений.</p>', 'images/lectures/ztvgWpiaqr6PUeeMCdv7WHWLPNsBVe-metacGV4ZWxzLWthcm9saW5hLWdyYWJvd3NrYS03MjgxNDE1LmpwZw==-.jpg', '203600803', 31, 61, 1, 0, '2023-05-30 17:56:38', '2023-06-25 16:23:28', 1, 2, 1, 1, 1),
(330, 'Сумка в роддом. Что взять с собой?', '<p>Подготовка к родам, очень волнительное и важное событие. Нужно продумать всё до мелочей. А вы уже собрали сумку в роддом? Решили, какие вещи пригодятся в предродовом отделении? А что можно брать с собой в родильный зал? Что вам и малышу пригодится после родов и на выписку? Мы с радостью поможем вам разобраться в этих вопросах. Соберем сумку в роддом вместе, чтобы ваше пребывание в роддоме было спокойным и комфортным!</p>', 'images/lectures/R58JZmwKjU9kIgtDsePo20gYyHE447-metaNTAuanBn-.jpg', '203600707', 36, 62, 1, 0, '2023-05-30 18:00:01', '2023-06-25 16:34:15', 1, 2, 1, 1, 1),
(331, 'Узкий таз и роды: стоит ли переживать?', '<p>При осмотре в женской консультации у вас диагностировали узкие размеры таза. Что же делать? На сколько это страшно? В рамках данного занятия мы разберем с вами наиболее часто возникающие и волнующие вас вопросы. В результате нашей беседы Вы поймете можете ли вы родить самостоятельно или нет.</p>', 'images/lectures/jhcYRmcD7SrUqCyaqXEMfMNoVXj9NT-metacGV4ZWxzLXBvbGluYS16aW1tZXJtYW4tMzk1ODU3NS5qcGc=-.jpg', '203600698', 41, 63, 1, 0, '2023-05-30 18:02:05', '2023-06-25 16:19:50', 1, 2, 1, 1, 1),
(332, 'Секс после родов - реальность или миф?', '<p>Почему после родов у женщины может снизиться либидо? С какими проблемами вы можете столкнуться в интимной жизни после рождения малыша, как их избежать и что делать, если это случилось с вами?</p>', 'images/lectures/oopL3Mh1RZxwgqcvniEASKZv9tdcUf-metacGV4ZWxzLWNvdHRvbmJyby1zdHVkaW8tNDk4MDMxNC5qcGc=-.jpg', '203600618', 42, 61, 1, 0, '2023-05-30 18:03:36', '2023-06-25 16:27:46', 1, 2, 1, 1, 1),
(333, 'Новое начало: Рождение плаценты и первое прикладывание к груди', '<p>Поговорим о завершении родового процесса и раннем послеродовом периоде. Разберем&nbsp; принципы \"золотого часа\" и первое прикладывание к груди с точки зрения современных принципов ведения родов.</p>', 'images/lectures/pGUskB5W8YqDMq0mM2EuUSLOTUIORX-metaam9hby1wYXVsby1kZS1zb3V6YS1vbGl2ZWlyYS1SWEc5SVF4ZmhlYy11bnNwbGFzaC5qcGc=-.jpg', '203600583', 45, 63, 1, 0, '2023-05-30 18:06:06', '2023-06-25 15:52:32', 1, 2, 1, 1, 1),
(334, 'Роды без боли. Медикаментозные техники обезболивания родов. Взгляд анестезиолога.', '<p>Лекция познакомит вас с основными методами обезболивания в родах. Анестезиолог представит различные медикаментозные подходы к облегчению боли во время родов, в том числе спинальная анестезия, эпидуральная анестезия и другие методы. Кроме того, будут обсуждаться плюсы и минусы этих методов, а также стратегии, которые позволяют достичь наилучшего результата в каждом конкретном случае.&nbsp; В рамках лекции анестезиолог затронет&nbsp; распространенные заблуждения и сомнения, связанные с методами обезболивания в родах.&nbsp;</p>', 'images/lectures/GjLcpPhxqffjYE28ZRB4MpDSXnGdb3-metaQWRvYmVTdG9ja18xMDA3OTk1NzMuanBn-.jpg', '203600547', 37, 64, 1, 0, '2023-05-30 19:09:33', '2023-06-25 18:20:59', 1, 2, 1, 1, 1),
(335, 'Роды без страха - роды без боли. Взгляд акушера-гинеколога ', '<p>Возможно ли родить без боли или, по крайней мере, существенно её облегчить? В своём выступлении акушер-гинеколог расскажет, от чего зависит боль в родах и как можно её избежать. Также вы узнаете техники облегчения самочувствия в родах и как лучше всего к ним подготовиться.</p>', 'images/lectures/XiuLhW3C2yy1YNoIB1zOZ8INy8lX7z-metaNDYuanBn-.jpg', '203600497', 44, 64, 1, 0, '2023-05-30 19:12:40', '2023-06-25 18:22:14', 1, 2, 1, 1, 1),
(337, 'Роды, как процесс : к чему быть готовой?', '<p>Роды заключительный и самый ответственный этап беременности. Чтобы максимально осознанно подготовиться к этому событию необходимо понимание того,&nbsp; что происходит в тот или иной момент родов с Вами и ребенком. Тогда Вы сможете взять некий контроль над процессами происходящими в родах и помочь себе наиболее благоприятно прожить этот момент.</p>', 'images/lectures/3DypK5a8jC5twvrFeKD6oWWRKFCYp7-metaQWRvYmVTdG9ja18zMTYyMjA3NTcuanBn-.jpg', '203600348', 46, 63, 1, 0, '2023-05-30 19:20:28', '2023-06-25 15:54:00', 1, 2, 1, 1, 1),
(338, 'Преждевременные роды: опасность для малыша и мамы', '<p>Преждевременные роды являются тревожным событием в жизни любой семьи. Основной стресс, который испытывают родителями, связан с разлучением со своим ребенком, когда он находится на лечении. В ходе нашей беседы мы выясним основные причины преждевременных родов, для точного понимания происходящего с вами. Помните, для благополучного исхода вы должны владеть всей необходимой информацией, реально оценивать ситуацию, а не поддаваться панике. Ведь зачастую совсем крошечные малыши под наблюдением и лечением врачей набирают вес, учатся самостоятельно сосать, и проведя в больнице некоторое время выписываются, где благополучно развиваются, со временем догнав своих сверстников.</p>', 'images/lectures/pqG2X5rIwQbBs0CDAsKQTLB0RzYXTx-metaYWxleGFuZGVyLWdyZXktNzQtN2o1dDRzRzAtdW5zcGxhc2guanBn-.jpg', '203600323', 41, 65, 1, 0, '2023-05-31 19:13:05', '2023-06-25 20:21:30', 1, 2, 1, 1, 1),
(339, 'Предвестники родов. Как не опоздать в роддом?', '<p>Расскажем, как определить начались ли роды? Какие существуют предвестники родов. На что надо обращать внимание, что может стать поводом для беспокойства. Какие схватки называются тренировочными. Какие есть периоды родов и что в них происходит. Сколько могут длится роды. Как правильно дышать во время родов.</p>', 'images/lectures/J8a7aKsuRAg50JaNdmWtpr8WZlcIQ8-metaQWRvYmVTdG9ja180NTExODM3MTQxMTExLmpwZw==-.jpg', '203600173', 33, 62, 1, 0, '2023-06-01 06:54:03', '2023-06-25 16:43:41', 1, 2, 1, 1, 1),
(340, 'Послеродовая контрацепция - это важно', '<p>Нужна ли послеродовая контрацепция?<br>Возможно ли забеременеть во время грудного вскармливания?<br>Все ли контрацептивы одинаково безопасны во время лактации?<br>Какой самый эффективный метод контрацепции во время лактации?<br>Как выбрать метод,который подходит именно Вам?<br>И когда же стоит планировать следующую беременность?<br>Много честных ответов о контрацепции от акушера-гинеколога в нашем вебинаре.</p>', 'images/lectures/tX0pFtIW5FttzAAXtMpTJgPIFNhErm-metacGV4ZWxzLXBpeGFiYXktMjQ4MTQ4LmpwZw==-.jpg', '203600167', 50, 61, 1, 0, '2023-06-01 06:55:21', '2023-06-25 16:31:37', 1, 2, 1, 1, 1),
(341, 'Подготовка шейки матки к родам и родовозбуждение ', '<p>Вы доносили беременность, а роды спонтанно не начинаются, что же делать?<br>Данная лекция является некоторым продолжением нашей беседы на тему «Перенашивание беременности».&nbsp; В рамках сегодняшней беседы мы познакомимся с методиками проведения подготовки шейки матки к родам, определимся кому показана данная процедура, найдем ответы на наиболее часто возникающие у вас вопросы. И выясним возможно ли грудное вскармливание после подготовки родовых путей?</p>', 'images/lectures/WZqsDiJgxGi3OIwidclyY2uZ6GVdq7-metacGV4ZWxzLWNvdHRvbmJyby1zdHVkaW8tNjQ3MTQyNC5qcGc=-.jpg', '203600078', 41, 63, 1, 0, '2023-06-01 06:58:47', '2023-06-25 15:49:36', 1, 2, 1, 1, 1),
(342, 'Периоды родов. Что происходит во время родов?', '<p>Роды-удивительный процесс появления нового человека, каждый период в нем имеет свои особенности. Давайте пройдём этот путь от начала до конца.</p>', 'images/lectures/hA6st9rBzuIiBjppwasNW3NZNiksgf-metaQWRvYmVTdG9ja18xODA2NTAzODcuanBn-.jpg', '203600017', 33, 63, 1, 0, '2023-06-02 09:08:39', '2023-06-25 15:46:43', 1, 2, 1, 1, 1),
(343, 'Партнерские роды: мода или необходимость?', '<p>Как партнёру эффективно подготовиться к родам? Что важно освоить, чтобы помочь женщине родить наиболее комфортно? Когда лучше отказаться от совместных родов? На эти и другие вопросы в своём выступлении рассказал акушер-гинеколог Дмитрий Николаевич Логинов.</p>', 'images/lectures/dikFljdkb0UPtzKwyc6EvX8dtAk3qb-metacGV4ZWxzLWxldHRpY2lhLW1hc3NhcmktMTQ1ODQ5NTAuanBn-.jpg', '203599931', 44, 63, 1, 0, '2023-06-02 09:10:17', '2023-07-11 11:44:50', 1, 2, 1, 1, 1),
(344, 'Выпадают волосы после родов. Причины, анализ, лечение', '<p>Выпадение волос после беременности, родов и периода кормления грудью – проблема, с которой сталкивается почти каждая женщина.&nbsp;</p><p>В этом видео Вы узнаете:<br>1. что такое алопеция;<br>2. почему волосы выпадают после беременности;<br>3. какие анализы сдавать и какое обследование можно пройти;<br>4. как скорректировать свое питание;<br>5. какие методы действительно работают для роста волос.</p>', 'images/lectures/Ir3RDatOfTOe6wlWQ2pxRr348YwB1X-metacGV4ZWxzLWVsZW1lbnQtZGlnaXRhbC05NzM0MDEuanBn-.jpg', '203599779', 52, 61, 1, 0, '2023-06-02 09:11:20', '2023-06-25 13:18:18', 1, 2, 1, 1, 1),
(345, 'Как проходит операция кесарево сечение?', '<p>Мы приглашаем будущих родителей на уникальную лекцию, посвященную этапам проведения операции кесарево сечение. Вы узнаете о том, как определить оптимальный срок для проведения операции, а также о новом подходе к предоперационной подготовке. Мы расскажем вам о разных видах разрезов, этапах операции и том, как извлекают малыша. Вы также узнаете о методах наложения послеоперационных швов. Не упустите возможность узнать о всех этапах проведения операции кесарево сечения от ведущих экспертов в области родовспоможения!</p>', 'images/lectures/h6ACj05aD04xTFOT9wlRcF81Qg9QBQ-metaam9uYXRoYW4tYm9yYmEtRGlsc1dtZkVveFEtdW5zcGxhc2guanBn-.jpg', '203599778', 50, 51, 1, 0, '2023-06-02 09:13:38', '2023-09-20 11:07:48', 1, 2, 1, 1, 1),
(347, 'Контрацепция и грудное вскармливание', '<p>Да,на грудном вскармливании можно забеременеть, это легче,чем кажется, и далеко не каждая мама хочет иметь погодок. Контрацепция должна быть безопасной не только для мамы, но и для малыша. В этом вебинаре врач акушер-гинеколог просто, доступно и доказательно расскажет о контрацепции в период грудного вскармливания.</p>', 'images/lectures/6Vuj184hP7L9HxIlsPu6SnghYBneYo-metaMTMuanBn-.jpg', '204362686', 27, 36, 1, 0, '2023-06-06 18:42:50', '2023-09-20 11:08:04', 1, 2, 1, 1, 1),
(349, 'Аптечка для новорожденных', '<p>В лекции обсуждаются основные моменты, которые следует учитывать при сборке аптечки, такие как выбор необходимых медицинских препаратов, маркировка и хранение медикаментов, а также правила их применения.&nbsp;</p>', 'images/lectures/5V7DOYt3CjYRpG82wF0jCa5uhZET1I-metaNTRfMi5qcGc=-.jpg', '203322463', 57, 74, 1, 0, '2023-06-13 08:48:02', '2023-09-20 11:07:59', 1, 2, 1, 1, 1),
(350, 'Грудное вскармливание после кесарева сечения', '<p>В Российской Федерации 30% родов приходится на долю операции кесарево сечение,то есть каждая третья женщина теоретически может столкнуться с таким исходом. И это не хорошо и не плохо.В этой лекции мы разберем все трудности,с которыми может столкнуться кормящая мама после кесарева сечения,и конечно же дадим советы,как их избежать.</p>', 'images/lectures/snIXuXGAhhye9x8VkAOQEXG21HUisJ-metaQWRvYmVTdG9ja18yNjY3MDAxOTAuanBn-.jpg', '204364805', 27, 51, 1, 0, '2023-06-28 18:52:20', '2023-09-20 11:07:54', 1, 2, 1, 1, 1),
(351, 'Послеоперационный период после Кесарева сечения', '<p>Мы приглашаем будущих родителей на уникальную лекцию «Послеоперационный период после Кесарева сечения». Мы подробно расскажем, что происходит после операции, сколько времени необходимо провести в реанимации и как избежать спаечного процесса. Вы узнаете, как правильно питаться после операции, а также получите рекомендации по уходу за швами. Мы поможем вам понять, на что обратить внимание в послеоперационный периоде и ответим на вопрос, когда вы сможете вернуться к своей обычной жизни. Не упустите возможность получить все необходимые знания для комфортного и успешного восстановления после кесарева сечения. Присоединяйтесь к просмотру!</p>', 'images/lectures/rJrUxI16o6D2lUK7BdisTgRFna99H6-metaQWRvYmVTdG9ja180NDcwODkwNjUuanBn-.jpg', '204364812', 50, 51, 1, 0, '2023-06-28 19:36:19', '2023-09-22 11:59:23', 1, 2, 1, 1, 1),
(352, 'Плановые и экстренные показания к кесареву сечению. Какие бывают осложнения для матери и плода?', '<p>Кесарево сечение - одна из самых распространенных операций в акушерстве. Оно используется тогда, когда роды естественным путем невозможны или противопоказаны. В данной лекции рассмотрим показания к проведению кесарева сечения - как плановые, так и экстренные. Большое внимание уделим возможным осложнениям для матери и плода во время и после операции.</p>', 'images/lectures/DbieQTLQiXdopWP3uTHqcvgn3Gw7W1-metacGF0cmljaWEtcHJ1ZGVudGUtLVAyZGpxQXdNOFUtdW5zcGxhc2guanBn-.jpg', '204364813', 50, 51, 1, 0, '2023-06-28 19:43:46', '2023-09-22 12:41:56', 1, 2, 1, 1, 1),
(354, 'Зачем делать УЗИ во втором триместре?', '<p>Во время наблюдения беременности будущая мама проходит&nbsp; множество исследований. Наша лекция посвящена одному из важнейших - УЗИ во втором триместре беременности. Мы расскажем максимально подробно о том, зачем проводится второй ультразвуковой скрининг, как к нему готовится и также изучим, как же можно достоверно определить пол будущего малыша.&nbsp;</p>', 'images/lectures/CBMVdodPTDZGgKad8uzJ21Fg6uJ6Kd-metaQWRvYmVTdG9ja180Mjc3MDgzMDEuanBn-.jpg', '0dZV1Q8Ja8TCuT8q3u7pn6', 39, 69, 1, 0, '2023-10-05 10:44:30', '2023-10-16 22:56:12', 1, 2, 1, 1, 1),
(355, 'Индивидуальный план родов', '<p>Ваш план родов - это ваш шанс обдумать, как бы вы хотели, чтобы прошел процесс родов. В этой видеолекции, врач-акушер-гинеколог подробно объяснит не только то, как составить эффективный план родов, но и подчеркнет, почему этот процесс столь важен для каждой будущей мамы.<br><br>Лекция позволит узнать:<br><br>1. Какие ключевые моменты следует учесть при планировании родов.<br>2. Как ваши предпочтения могут влиять на различные аспекты родов, включая методы смягчения боли, позы для родов, вовлеченность партнера и многое другое.<br>3. Как обсуждать план родов с вашим врачом и как принимать неожиданные решения во время родов.<br>4. Почему важно оставаться гибкими в плане родов и какие адаптации могут потребоваться на разных стадиях.<br>5. Как план родов поможет вам контролировать процесс и делает роды более предсказуемым и комфортным опытом.<br><br>Эта видеолекция была создана для того, чтобы обеспечить женщинам информацией и средствами, которые позволяют им принимать информированные решения о своем теле и это новый большом этапе их жизни. Присоединяйтесь к нам, чтобы приблизиться к родам, которые соответствуют вашим представлениям о комфорте и безопасности.</p>', 'images/lectures/clSHy9iBa2qDqNYBN3YUtju8kEYANB-metabHVtYS1waW1lbnRlbC0xdm5CMmw3ajNiWS11bnNwbGFzaC5qcGc=-.jpg', '7WX2DRRRwfKmZdNDQCpVkF', 27, 39, 1, 1, '2023-10-05 11:34:12', '2023-10-16 17:57:13', 1, 1, 1, 1, 1),
(356, 'Заложенность носа (ринит) во время беременности', '<p>Заложенность носа – очень частая жалоба женщин во время беременности. Цель этого видео - рассказать о причинах заложенности носа во время беременности для того, чтобы правильно подходить к лечению. Вы узнаете о механизмах развития ринита, как отличить Ринит беременных от Аллергического ринита, а что можно использовать для облегчения симптомов.&nbsp;</p>', 'images/lectures/wPzAN7JqjP1m5nwLxlLQDatSWz75b4-metaQWRvYmVTdG9ja180Njk0NTExMTcuanBn-.jpg', 'xAohEzmV1tbaRPyt4ZMmea', 52, 66, 1, 0, '2023-10-05 11:40:21', '2023-10-16 17:57:42', 1, 2, 1, 1, 1),
(357, 'Интимная и сексуальная гигиена. Почему это важно?', '<p>Интимная и сексуальная гигиена - это неотъемлемая часть здорового образа жизни каждого человека. Одна из главных причин, почему интимная и сексуальная гигиена важна, заключается в предотвращении различных инфекций и болезней, связанных с этой областью нашего тела. Неправильный уход может привести к развитию вагинальных инфекций, молочницы, мочеполовых инфекций и других неприятных состояний. Мы расскажем вам о важности регулярного мытья, использовании безопасных гигиенических средств и поддержании здоровой флоры в этой области. Кроме того, интимная и сексуальная гигиена играют важную роль в поддержании комфорта и уверенности в себе. Правильный уход помогает предотвратить неприятные запахи, раздражения и дискомфорт, что влияет на наше самочувствие и уверенность в интимных отношениях. В этом видео вы узнаете о правильных методах ухода, использовании подходящих продуктов и средств для интимной гигиены, а также о том, как улучшить качество своих сексуальных отношений.&nbsp;</p>', 'images/lectures/9m9DKxEc2z6lAKpzeMmUvogeemEpWQ-metacGV4ZWxzLXNvcmEtc2hpbWF6YWtpLTU5MzgzODAuanBn-.jpg', 'od2VRfKQKPhmGMRbGGjhTn', 40, 70, 1, 0, '2023-10-05 11:56:27', '2023-10-16 18:00:30', 1, 2, 1, 1, 1),
(358, '15 самых актуальных мифов о детском сне', '<p>Многие слышали, когда людей в зависимости от предпочтения времени бодрствования делят на жаворонков и сов, а можно ли делить на эти категории малышей? В этой лекции мы будем разбирать актуальные мифы про сон у деток.&nbsp; Например, нужно ли утомлять ребенка для лучшего сна?</p>', 'images/lectures/9Ls5d09eQmPUbFSKexL1knfoj8qrZ9-metaQWRvYmVTdG9ja18yMTU2MTkxOTAuanBn-.jpg', 'fioUD6SsyjZiNANAnHkTw4', 29, 78, 1, 0, '2023-10-16 18:04:17', '2023-10-16 18:30:11', 1, 2, 1, 1, 1),
(359, 'Ритмы сна и бодрствования', '<p>Сон - это активный физиологический процесс, который играет ведущую роль в развитии малыша, поэтому важно основательно подойти к вопросам организации детского сна, а также знать особенности младенческого сна, его отличиях в зависимости от возраста. Данные знания, позволят родителям более грамотно помогать выстраивать малышам режим, обеспечат более лёгкое засыпание, а также помогут замечать некоторые нарушения и вовремя их устранять.</p>', 'images/lectures/lE1jBd6LeqbCR5xef6TkLhcbcSyFT9-metaQWRvYmVTdG9ja18zNDY2NDc1MDcuanBn-.jpg', 'eVwyxPUzbnqXHxo8AoJYYS', 29, 78, 1, 0, '2023-10-16 18:39:31', '2023-10-16 18:40:46', 1, 2, 1, 1, 1),
(360, 'Сон младенца от 0 до 3 месяцев', '<p>Теперь зная физиологию сна, мы маленькими шагами продвигаемся в изучении и особенностях детского сна.&nbsp; Поэтому, чтобы лучше понимать своего малыша, мы остановимся на основных периодах роста ребенка. Разберем с вами с какими трудностями можно встретиться в каждый месяц ребенка, чем будет отличаться сон месячного ребенка от 3-х месячного. Вспомним нормы сна и как можно малышу помочь лучше спать.</p>', 'images/lectures/R3qiYCfjp9nuMOhI03ipYf0B4fsdGd-metaQWRvYmVTdG9ja18zMjE4NDk5MjIuanBn-.jpg', 'ioon4si3frQAXvQwfyuonm', 29, 78, 1, 0, '2023-10-16 19:52:58', '2023-10-16 21:38:59', 1, 2, 1, 1, 1),
(361, 'Сон младенца от 3 до 6 месяцев', '<p>Мы с вами продолжаем раскрывать тему сна малышей, узнаем все больше информации, теперь мы готовы двигаться дальше и смотреть как меняется сон ребенка к 6 месяцам. Поведенческие реакции меняются и то, что раньше нравилось вашему малышу, может разонравиться, придется возобновлять поиск новых средств засыпаний и хорошего полноценного сна. Будем вместе разбираться в этом вопросе.</p>', 'images/lectures/dC15vdpCYzfrmmvPIGXRZsma13hZDC-metaQWRvYmVTdG9ja181MTUyOTY3NTAuanBn-.jpg', '5nyS1xqsarN8mnawjx947x', 29, 78, 1, 0, '2023-10-16 21:42:12', '2023-10-16 21:42:12', 1, 2, 1, 1, 1),
(362, 'Сон младенца от 6 до 9 месяцев', NULL, 'images/lectures/LTCiwhVjPuMERuc2U2AaUEg4cks1MH-metaQWRvYmVTdG9ja18xMTEzNjQ1NzEuanBn-.jpg', 'xj9pHDdVeqheEjH5qr1b5T', 29, 78, 1, 0, '2023-10-16 21:44:13', '2023-10-16 21:44:13', 1, 2, 1, 1, 1),
(363, 'Сон младенца от 9 до 12 месяцев', NULL, 'images/lectures/X3eJLtXe4GNK22OHEEY09ispzsMGG1-metaQWRvYmVTdG9ja181MjAxOTM0NzMuanBn-.jpg', '565dfjD7ERmEvY9DJAHhf5', 29, 78, 1, 0, '2023-10-16 21:50:04', '2023-10-16 21:50:04', 1, 2, 1, 1, 1),
(364, 'Как правильно проводить гигиену малышу? Часть 1', '<p>&nbsp;Появление ребенка в семье - радостное событие.&nbsp; Молодым родителям следует заранее ознакомиться с множественной информацией о малышах, прежде чем маму с ребенком выпишут из роддома.&nbsp; Теоретические знания, которые мы вам даем, в дальнейшем подкрепляются практикой.&nbsp; Новорожденный ребенок требует должного внимания. В этой лекции, мы с вами узнаем основные аспекты ухода за малышами, как правильно обрабатывать пупочный остаток, когда можно начинать купание и как правильно это делать, что при этом необходимо. Нужно ли пользоваться детской косметикой? Также затронем тему о «молочных» корочках, кто и как должен подстригать ногти малышу.</p>', 'images/lectures/Kis4v3FdshCZkCmU91381iwB3CImqA-metaQWRvYmVTdG9ja18xNjg3MzA0ODguanBn-.jpg', 'x4kcacjGYF4JtFC3Su6bYD', 29, 77, 1, 0, '2023-10-16 21:58:35', '2023-10-16 21:58:35', 1, 2, 1, 1, 1),
(365, 'Как правильно проводить гигиену малышу? Часть 2', '<p>В первой лекции, мы подробно разобрали основные аспекты ухода за новорожденным ребенком, с которыми должен ознакомиться каждый родитель. В этой лекции мы узнаем правильность ухода за глазами, носом и ушами. В чем отличия гигиены мальчиков от гигиены девочек, как важно правильно подмывать ребенка.&nbsp;Расскажем о литературе, которая дополнит знания молодых родителей, чтобы они были максимально готовы к появлению нового члена семьи.</p>', 'images/lectures/CbyM2PM21BPEc20AuJxj9HPwVx8aTL-metaQWRvYmVTdG9ja18zMzQ0NjYyNzguanBn-.jpg', 'fessuAvQ4P9pSze88voxkj', 29, 77, 1, 0, '2023-10-16 22:06:50', '2023-10-16 22:06:50', 1, 2, 1, 1, 1),
(366, 'Переходные состояния  у младенцев', '<p>Многие родители после рождения ребенка, сталкиваются с «особыми» состояниями малыша, которые могут их напугать. Чтобы было не так страшно, мы Вам расскажем, что это за состояния, их называют еще переходными, пограничными или транзиторными. Эти состояния обуславливают перестройку и адаптацию маленького организма к новым условиям среды. Для этого малышу потребуется время, а родителям требуются знания и внимательность.</p>', 'images/lectures/tldW5zj3T77BzXL2YA8djqx2TGNQXG-metacGV4ZWxzLWdhYnJpZWwtdGFwaWEtMTM2Mzg5MDAuanBn-.jpg', 'hDgZLSsVN8hnZ69RiPLREK', 29, 74, 1, 0, '2023-10-16 22:25:32', '2023-10-16 22:25:32', 1, 2, 1, 1, 1),
(367, 'Развитие речи малыша. Когда нужен логопед?', '<p>В этой лекции мы с вами обсудим одну из важных коммуникативных функций нашего организма - это речь. Мы изучим, какие этапы проходит малыш осваивая навык общения. &nbsp;<br>В последнее время частота обращений к логопедам растет, мы попытаемся разобраться в этом вопросе, почему так происходит, с какой целью обращаются к логопеду, только ли при наличии нарушений речи или логопед нужен здоровым деткам?&nbsp; Согласитесь, один из самых трепетных моментов в родительстве - первое слово малыша. Когда ребенок длительно не произносит слова, не говорит, это пугает родителей, в лекции мы обратим внимание, когда необходим осмотр специалиста, для уточнения причин задержки речи.</p>', 'images/lectures/ZT7JOajWglOmklKJcM9umHGrZa27L0-metaQWRvYmVTdG9ja180NTYzMDI0NzQuanBn-.jpg', 'witUQDwXwFKBEJrpsHUjuK', 29, 75, 1, 0, '2023-10-16 22:30:20', '2023-10-16 22:30:20', 1, 2, 1, 1, 1),
(368, 'Подготовка к беременности после Кесарева сечения', '<p>Около 30% процентов родов происходят путем операции Кесарево сечение, и большая часть из этих женщин планируют беременность повторно. Именно поэтому, мы записали этот вебинар для вас с практикующим врачом акушером-гинекологом. Здесь вы найдете ответы на все вопросы, поймете, почему важно планировать беременность, почему важно делать УЗИ, а самое главное получите ответ, как минимизировать риски данной беременности.</p>', 'images/lectures/6LUu3kjE392JiLE88YTmMrdQ9N7vIp-metaQWRvYmVTdG9ja18yODIwMjEwNzcuanBn-.jpg', 'nfPTAAAa31JZKmPURHzfw3', 27, 51, 1, 0, '2023-10-16 22:34:41', '2023-10-16 22:34:41', 1, 2, 1, 1, 1),
(369, 'Опасно ли УЗИ для ребенка и мамы?', '<p>Для подтверждения беременности и динамического наблюдения за течением беременности неотъемлемым методом исследования является ультразвуковая диагностика .&nbsp;<br>В рамках данного видео мы ответим на ряд вопросов, которые часто волнуют будущих мам – когда нужно сделать первое УЗИ? Как часто можно и нужно проводить данное исследование? Несет ли вред здоровью ребенка УЗИ?</p>', 'images/lectures/ZewRUjThKGP6sMe2ohfRpzk07XSxow-metacGV4ZWxzLW1hcnQtcHJvZHVjdGlvbi03MDg5MDQ3LmpwZw==-.jpg', 'wu2nKAAfR5CVyrPC7eLTXZ', 46, 69, 1, 0, '2023-10-16 22:37:56', '2023-10-16 23:07:23', 1, 2, 1, 1, 1),
(370, 'Эстетическая гинекология что это и для кого?', '<p>Откройте для себя удивительный мир эстетической гинекологии и избавьтесь от дискомфорта во время полового контакта, фитнеса или интимных моментов. Узнайте, как избавиться от неприятного звука \"хлюпания\" и излишнего воздуха. Восстановите яркость своей сексуальной жизни после родов и избавьтесь от обильных выделений разной интенсивности. Присоединяйтесь к просмотру видео по эстетической гинекологии и обретите комфорт и уверенность в своем теле.</p>', 'images/lectures/OIklYJKxaYbynEz8UhkgEuL6sOhoYP-metabWFyaWEtdGFsa3MtbkVoQXdHS0dYYm8tdW5zcGxhc2guanBn-.jpg', 'wZy5BhiK7YW5HzYbZPaCa4', 40, 70, 1, 0, '2023-10-16 23:11:21', '2023-10-16 23:11:21', 1, 2, 1, 1, 1),
(371, 'Крапивница у ребенка: что делать?', '<p>Приглашаем вас на увлекательную лекцию о крапивнице у детей! В этом информативном видео вы узнаете всё о причинах, проявлениях и алгоритме действия при крапивнице у вашего ребенка. Мы расскажем вам о определении и симптомах, о распространенности и классификации этого неприятного явления. Вы также познакомитесь с причинами возникновения крапивницы и узнаете о методах аллергодиагностики. Присоединяйтесь!</p>', 'images/lectures/uLTWEqxYBOkwP4gYJV1ac4EOB99lrW-metaQWRvYmVTdG9ja18zODMzOTI2MzcuanBn-.jpg', 'u4zrKrii5xXd7qKS5VCgYW', 52, 72, 1, 0, '2023-10-16 23:21:07', '2023-10-16 23:21:07', 1, 2, 1, 1, 1),
(372, 'Положения при кормлении грудью. Какие и зачем?', '<p>Удобство мамы во время кормления - залог длительного грудного вскармливания. Ведь если удобно, комфортно и не больно, то нет причин не кормить. Вебинар наполнен картинками, схемами, видеоматериалами и комментариями лектора, что-то не понять - не получится.</p>', 'images/lectures/yZzcIw17sFDaQe4IQuUzlhVKrjMvoY-metacGV4ZWxzLW1vbmljYS10dXJsdWktMTU4NTUyMDUuanBn-.jpg', 'dDqAuZs19GEiPeWLuuiWV8', 27, 39, 1, 0, '2023-10-30 21:42:42', '2023-10-30 21:42:42', 1, 1, 1, 1, 1),
(373, 'Сумка в роддом. Что взять с собой?', '<p>Подготовка к родам, очень волнительное и важное событие. Нужно продумать всё до мелочей. А вы уже собрали сумку в роддом? Решили, какие вещи пригодятся в предродовом отделении? А что можно брать с собой в родильный зал? Что вам и малышу пригодится после родов и на выписку? Мы с радостью поможем вам разобраться в этих вопросах. Соберем сумку в роддом вместе, чтобы ваше пребывание в роддоме было спокойным и комфортным!</p>', 'images/lectures/uuht4Cf7Ndlnu3QMu2UHcSDaBU7l8Z-metaNTAuanBn-.jpg', '9VySvLmgAxXpnTdFen52jV', 36, 39, 1, 0, '2023-10-30 21:48:11', '2023-10-30 21:48:11', 1, 1, 1, 1, 1),
(374, 'Развитие речи малыша. Когда нужен логопед?', '<p>В этой лекции мы с вами обсудим одну из важных коммуникативных функций нашего организма - это речь. Мы изучим, какие этапы проходит малыш осваивая навык общения. &nbsp;<br>В последнее время частота обращений к логопедам растет, мы попытаемся разобраться в этом вопросе, почему так происходит, с какой целью обращаются к логопеду, только ли при наличии нарушений речи или логопед нужен здоровым деткам?&nbsp; Согласитесь, один из самых трепетных моментов в родительстве - первое слово малыша. Когда ребенок длительно не произносит слова, не говорит, это пугает родителей, в лекции мы обратим внимание, когда необходим осмотр специалиста, для уточнения причин задержки речи.</p>', 'images/lectures/DfVWYs1GFUl9VM8mh42K4NpsfNGjRM-metaQWRvYmVTdG9ja180NTYzMDI0NzQuanBn-.jpg', 'p72rj8SrUrFeJ2MmBDwTwd', 29, 39, 1, 0, '2023-10-30 21:53:10', '2023-10-30 21:53:10', 1, 1, 1, 1, 1),
(375, '\"Beauty-процедуры\" во время беременности и лактации', '<p>Такая важная тема и так мало информации о ней. В 21 веке сфера красоты развивается с огромной скоростью, и конечно, каждая женщина задается вопросом: <strong>«А можно ли во время беременности или грудного вскармливания делать ту или иную процедуру?»</strong> В этой лекции мы рассказываем про большую часть услуг в сфере красоты, начиная со стрижки и окрашивания волос до инъекционных процедур. И конечно, все подкрепляем научными объяснениями, почему эту процедуру можно делать, а другую нельзя. Приятного просмотра, надеемся, вы найдёте ответы на все ваши вопросы.</p>', 'images/lectures/oRcVehwKCQgivGN1n7zfdzdhdtVfXP-metacGV4ZWxzLWFubmEtc2h2ZXRzLTUwNjk1MDYuanBn-.jpg', '5BJTZkXPK8QX4Q95NSooof', 27, 39, 1, 0, '2023-10-30 21:56:43', '2023-10-30 21:56:43', 1, 1, 1, 1, 1),
(376, 'Что ждёт после родов', '<p>Что ждёт после родов? Такой простой вопрос, а ответ на него получился на целую лекцию. Здесь по порядку про каждый этап послеродового периода, начиная от момента рождения вашего малыша и до приезда домой. Обсудим ключевые моменты и дадим рекомендации, как действовать при разных ситуациях.</p>', 'images/lectures/sLbYiztVaTHAso9LALobqC6VxspObU-metaNTJfMi5qcGc=-.jpg', 'gAENjP3wWRopbiD6jSMnao', 27, 39, 1, 0, '2023-10-30 22:07:34', '2023-10-30 22:07:34', 1, 1, 1, 1, 1);
