INSERT INTO `lecture_categories` (`id`, `parent_id`, `title`, `slug`, `description`, `info`, `preview_picture`, `is_promo`, `created_at`, `updated_at`) VALUES
(2, 0, 'Роды', 'rody', '<p>Это сборник материалов и ресурсов, посвященных подготовке к родам и послеродовому периоду. Здесь вы найдете информацию о физиологии родов, техниках расслабления и дыхания, а также о самых эффективных позах для родовой деятельности. Это полезный инструмент для всех, кто ждет своего малыша и хочет быть максимально готовым к этому важному и ответственному моменту в своей жизни.</p>', 'В этой категории вы найдете лекции, которые охватывают всевозможные темы, связанные с родами и послеродовым периодом, в том числе лекции о Кесаревом сечении, подготовке к родам и техниках дыхания и расслабления. Эти лекции будут полезны не только для новых, но и для опытных родителей, которые ищут дополнительные советы и материалы для повышения своих знаний в этой области.', 'images/categories/1N2XcBWBKSWOI9NKMH7xMqW7npB5Q7-metaMS5wbmc=-.png', 1, '2023-03-21 10:43:05', '2023-06-21 12:14:26'),
(3, 0, 'Грудное вскармливание', 'grudnoe-vskarmlivanie', '<p>Грудное вскармливание играет важную роль в здоровье новорожденных. Грудное молоко содержит все необходимые питательные вещества для правильного развития ребенка.&nbsp;</p><p>Мы являемся сторонниками естественного вскармливания и считаем, что каждая мама должна иметь возможность кормить своего ребенка грудью, если это возможно. Наша школа помогает молодым мамам научиться правильно кормить грудью, ухаживать за грудью и преодолевать возможные проблемы, связанные с грудным вскармливанием.</p><p>Приглашаем всех желающих присоединиться к нашей программе и получить необходимые знания и навыки для успешного грудного вскармливания. Наша цель - помочь создать здоровое и крепкое поколение, начиная с самого раннего детства.</p>', 'Рассмотрим такие вопросы, как уникальный состав грудного молока, преимущества грудного вскармливания для ребенка и кормящей мамы, правильное прикладывание ребенка к груди, особенности грудного вскармливания в разные возрасты малыша, проблемы, связанные с этим процессом, а также многое другое. Наша школа направлена на то, чтобы помочь мамам научиться основам грудного вскармливания: правильно прикладывать ребенка к груди, ухаживать за грудью и преодолевать возможные проблемы, связанные с грудным вскармливанием.', 'images/categories/pZ6TrJP0GijV2Gc9JdHofZ1jUgJ0pG-meta0KDQntCU0KsgKDUpLnBuZw==-.png', 1, '2023-03-21 10:43:05', '2023-06-23 16:58:46'),
(4, 0, 'Все о малыше', 'vse-o-malyse', '<p>Блок лекций, который включает в себя темы о правильном питании малыша на каждой стадии его развития, о гигиене и уходе за ним, о том, как формировать здоровый сон, о мерах безопасности, которые необходимо принимать в повседневной жизни, а также о здоровье, заболеваниях и их профилактике. В рамках этого блока лекций Вы сможете получить полную информацию о том, как создать благоприятные условия для развития Вашего малыша и обеспечить его здоровье и безопасность.</p>', 'Категория лекций \"Всё о малыше\" включает широкий спектр тем, связанных с уходом и воспитанием ребенка в первые годы жизни. Некоторые из них включают в себя: уход за новорожденным, введение первого прикорма, гигиена малыша, колики у малыша, развитие речи и сон малыша и его безопасность.', 'images/categories/DzE5aW8TQbKm39t0bZR991NXVmyMIH-metaMy5wbmc=-.png', 1, '2023-03-21 10:43:05', '2023-06-29 08:24:44'),
(6, 38, 'Онкопрофилактика', 'onkoprofilaktika', '<p>Подкатегория лекций на тему \"Онкопрофилактика\" предназначена для женщин, которые хотят научиться заботиться о своем здоровье и предотвращать возникновение онкологических заболеваний. Эти лекции доступны бесплатно и содержат множество полезной информации.</p>', 'Доступ к материалам ограничен одним видео в сутки. Доступ к остальным видео в других разделах не зависит от данного ограничения.', 'images/categories/99VVBxvVExc3jSsw9iWEAERbWYb8ec-metacGV4ZWxzLWFubmEtdGFyYXpldmljaC01NDgzMDE3LmpwZw==-.jpg', 0, '2023-03-21 10:43:05', '2023-06-26 14:22:11'),
(36, 3, 'Материалы врача-эксперта по грудному вскармливанию', 'materialy-vraca-eksperta-po-grudnomu-vskarmlivaniiu1', '<p>....я врач акушер-гинеколог и уже несколько лет являюсь консультантом по грудному вскармливанию. Имею опыт организации грудного вскармливания в родильном доме, активно консультирую женщин в очном и онлайн форматах. Так же имею собственный опыт кормления грудью. Как вы поняли, я являюсь активным сторонником грудного вскармливания и это является огромной областью моих интересов. Помощь кормящим женщинам доставляет мне огромное удовольствие, именно поэтому я сейчас здесь с вами....</p>', NULL, 'images/categories/dvDri0i0BhtNCuNax2boqlins1kHcM-metacGV4ZWxzLdCw0L3QsNGB0YLQsNGB0LjRjy3QstC+0LnRgtC6MDAwMDAwMDAw0L4tMTA5NTY5ODUuanBn-.jpg', 1, '2023-03-22 08:25:04', '2023-06-22 12:13:56'),
(38, 0, 'Бесплатные материалы', 'free', '<p>Раздел \"Бесплатные материалы\" позволяет всем желающим получить доступ к уникальным лекциям и видеоурокам абсолютно бесплатно! Все видео доступны онлайн, а значит, вы сможете учиться в удобное для вас время и в любом месте!</p>', 'Доступ к бесплатным материалам открыт из расчета не более 1 видео в день. Более точное указание периода доступа указывается в Вашем личном кабинете - указана дата следующего доступа и идет обратный отсчет. ', 'images/categories/E5hNLdDqnNZ7YiQCluxP9QwPsBxAWf-metaNC5wbmc=-.png', 0, '2023-03-28 12:24:47', '2023-06-22 06:16:57'),
(39, 38, 'Это важно знать!', 'eto-vazno-znat', '<p>Посмотрите бесплатные видеоматериалы, которые расскажут о важных темах.&nbsp; Берегите свое здоровье и здоровье своего малыша!</p>', 'Доступ к материалам ограничен одним видео в сутки. Доступ к остальным видео в других разделах не зависит от данного ограничения.', 'images/categories/JtxyaVBLOrTcbj4htq5PO7nMYiAPnF-metaanVsaS1rb3NvbGFwb3ZhLWxNMmRGakhjY0pzLXVuc3BsYXNoICgyKTIyLmpwZw==-.jpg', 0, '2023-03-28 12:27:51', '2023-06-13 08:53:29'),
(50, 0, 'Беременность', 'beremennost', '<p>Эта категория представляет собой полезный ресурс для будущих родителей, которые желают получить достоверную информацию о беременности и всех ее аспектах. Эта категория лекций содержит обширную информацию о росте и развитии ребенка в материнской утробе, возможных осложнениях во время беременности и как их предотвратить, советы по правильному питанию и режиму дня. Лекции проводятся опытными врачами, которые поделятся своим опытом и знаниями, а также ответят на ваши вопросы. Все материалы в категории \"Беременность\" разработаны таким образом, чтобы помочь будущим родителям подготовиться к этому важному этапу жизни с уверенностью и заботой.</p>', 'Категория лекций \"Беременность\" разделена на подкатегории: Здоровье мамы, Здоровье плода, Осложнения беременности, Всё о коже мамы, Скрининги и обследования, Здоровье интимной зоны', 'images/categories/Km8YTd6v4WiysuOf5NgvfzgDvs0HQk-metaMi5wbmc=-.png', 1, '2023-05-10 12:54:39', '2023-06-29 08:26:39'),
(51, 2, 'Кесарево сечение', 'kesarevo-secenie', '<p>Хотите быть уверены в безопасности вашего будущего малыша и комфорте ваших родов? Тогда данная категория лекций именно то, что вам нужно!</p>', ' Здесь вы найдете не только информацию о самой операции и подготовке к ней, но и множество других полезных тем, таких как восстановление после родов, грудное вскармливание после Кесарева сечения, психологические особенности женщин, родивших с помощью Кесарева сечения и тд. Наши эксперты помогут вам получить все необходимые знания и навыки для максимально комфортного и безопасного прохождения процедуры.', 'images/categories/S7BPtzZwHYxE6j1glaBOkcMHac9k4p-metacGV4ZWxzLWpvbmF0aGFuLWJvcmJhLTMyNTk2MjguanBn-.jpg', 1, '2023-05-10 12:59:55', '2023-06-27 08:27:11'),
(58, 0, 'Психология', 'psixologiia', '<p>Категория \"Психология\" включает в себя широкий спектр тем, связанных с психологическими аспектами беременности, рождения ребенка, его воспитания и развития.&nbsp;</p>', 'В ней можно найти информацию общего характера о природе родительской любви, инстинктах, типах привязанности и их формировании у ребенка. Также здесь рассматриваются психологические особенности беременности в разные периоды, вопросы психологической подготовки к родам, дискуссии о популярных страхах беременной женщины, послеродовой депрессии и родительском выгорании.', 'images/categories/4fEBLOW3KvywWmRyYDXSaDIgpXqPBV-meta0KDQntCU0KsgKDgpLnBuZw==-.png', 1, '2023-05-11 18:38:39', '2023-06-22 11:40:10'),
(59, 58, 'Психология ребенка', 'psixologiia-rebenka', '<p>Добро пожаловать на серию лекций \"Психология ребенка\"! Эта программа поможет Вам раскрыть тайны психического развития ребенка и открыть для себя новые аспекты воспитания и развития детей.<br><br></p>', 'В рамках нашей программы мы обсудим психическое развитие ребенка, природу родительской любви и типы привязанности – основные аспекты, которые были исследованы специалистами в области детской психологии. Наши высококвалифицированные лекторы поделятся с Вами своими знаниями и опытом и помогут разобраться в том, как поведение Вашего ребенка связано с его психическим развитием.\n\nВ ходе лекций Вы узнаете, как предоставить ребенку условия для психологического развития, как избежать ошибок воспитания и как правильно формировать привязанность между собой и Вашим ребенком. Вы также раскроете секреты работы с детьми разного возраста, от рождения до подросткового возраста.\n\nПрисоединитесь к нашим лекциям и станьте более компетентным и заботливым родителем, улучшите свои навыки взаимодействия с ребенком и получите ценные знания, которые помогут Вам создать счастливое и здоровое окружение для Вашей семьи. ', 'images/categories/CVJPpsSjhGhY7dC9weDsuLQS6bbyLR-metacGV4ZWxzLXBpeGFiYXktNTA2OTIuanBn-.jpg', 1, '2023-05-11 18:39:06', '2023-06-27 06:00:34'),
(60, 58, 'Психология родителей', 'psixologiia-roditelei', '<p>Приглашаем Вас на уникальную серию лекций \"Психология родителей\", которая поможет Вам понять психологические аспекты процесса родительства и научиться избегать неприятных ситуаций, связанных с рождением ребенка.</p>', 'Вы познакомитесь с важными советами и изучите психологическую сторону родительства: взаимоотношения между родителями, родительское выгорание, взгляд мужчины на рождение ребенка, психологическая подготовка к родам, психологические особенности беременности в разных триместрах, страхи беременной женщины и психология грудного вскармливания.\n\nНаши лекторы - эксперты в области психологии, обладающие глубокими знаниями в этой области и опытом работы с беременными и родившими. Они помогут Вам лучше понять, что происходит в Вашей голове и в голове Вашего партнера и как взаимоотношения между Вами могут измениться в период беременности и рождения ребенка.\n\nВы узнаете, как избежать стресса и напряжения, связанных с родительством и как создать укрепляющую атмосферу в семье для Вашего малыша. ', 'images/categories/zbHEMQzDL8Xvdl4HkqHKa8Pnomkioz-metadG9hLWhlZnRpYmEtY0wyOUNHY0p5eWMtdW5zcGxhc2guanBn-.jpg', 1, '2023-05-11 18:39:26', '2023-06-22 11:58:06'),
(61, 2, 'После родов', 'posle-rodov', '<p>Добро пожаловать на нашу подкатегорию лекций \"После родов\". Здесь вы найдете все необходимые знания, чтобы вернуться к привычному ритму жизни и избавиться от проблем, связанных с периодом после родов.</p>', 'Категория включает лекции по послеродовой контрацепции, которые помогут вам выбрать наиболее подходящие средства защиты от нежелательной беременности. Вы также узнаете о безопасности каждого метода и сможете принять осознанное решение.\n\nЛекции о похудении помогут вам вернуть привлекательную форму тела и укрепить здоровье после родов. Наши специалисты расскажут о правильном питании, эффективных упражнениях и других способах достижения идеальной формы.\n\nРаздел о восстановлении интимной зоны и сексуальной жизни после родов уделяет особое внимание вопросам женского здоровья. Наши лекторы расскажут о доступных способах увеличения сексуального наслаждения и повышения уверенности в себе.\n\nНе менее важный вопрос - выпадение волос в этот период, об этой проблеме мы также подготовили специальную лекцию. Узнайте, как уменьшить выпадение волос и сделать их более здоровыми и красивыми.', 'images/categories/xOuzYLONvTUMQ3J3u6qwt4GitNhE0Q-metacGV4ZWxzLXBhdmVsLWRhbmlseXVrLTcyMjA1MjkuanBn-.jpg', 1, '2023-05-11 18:52:30', '2023-06-29 08:29:18'),
(62, 2, 'Подготовка к родам ', 'podgotovka-k-rodam', '<p>Готовьтесь к самому прекрасному мгновению в вашей жизни вместе с нашими лекциями по подготовке к родам! Узнайте о необходимых вещах, которые стоит положить в сумку для роддома и на какие предвестники родов следует обратить внимание. А самое главное - наши эксперты помогут вам рассчитать срок родов! Получите необходимые знания и уверенность для благополучного и комфортного родового процесса.</p>', NULL, 'images/categories/7L2rHO6r1CbRjQOBtp0VLPSb3xLCWT-metaMjZfMi5qcGc=-.jpg', 1, '2023-05-12 08:38:42', '2023-06-29 08:30:07'),
(63, 2, 'Роды', 'rody1', '<p>Готовьтесь к родам вместе с нашими лекциями! Узнайте о периодах родов и процессах, происходящих во время родов, партнерских родах и узком тазе. Экспертные лекторы помогут вам получить необходимые знания и навыки для того, чтобы рождение вашего малыша прошло успешно и с минимальными рисками.</p>', NULL, 'images/categories/xzbENkQd7mv6P7ayHHvaVvlLJpDwrC-metabW90aGVyLW9mLXdpbGRlLVpaNmRHNTRhT3ZVLXVuc3BsYXNoLmpwZw==-.jpg', 1, '2023-05-12 08:38:59', '2023-06-29 08:31:06'),
(64, 2, 'Как  облегчить боль и правильно дышать?', 'kak-oblegcit-bol-i-pravilno-dysat', '<p>Эта подкатегория лекций предназначена для тех, кто ищет способы облегчения боли во время родов и&nbsp; правильного дыхания во время этого важного момента в жизни.</p>', ' В ходе лекций вы узнаете о различных методах управления болью, включая медикаментозные и не медикаментозные методы. Здесь вы найдете необходимые знания и навыки, чтобы справиться с родами максимально комфортно и эффективно.', 'images/categories/90oZMdR1FeUAcwwlnS1M1T1pnQ0EDK-metaamltbXktY29ub3Zlci1SNXlvSlNZRERmSS11bnNwbGFzaC5qcGc=-.jpg', 1, '2023-05-12 08:39:21', '2023-06-29 08:35:26'),
(65, 50, 'Осложнения беременности ', 'oslozneniia-beremennosti', '<p>Лекции на тему \"Осложнения беременности\" - это уникальная возможность узнать все о проблемах, которые могут возникнуть во время беременности.&nbsp;</p>', 'В рамках этих лекций, вы узнаете о различных осложнениях беременности, таких как высокое давление, отеки, сахарном диабете беременных, истмико-цервикальной недостаточности, преждевременных родах, токсикозе, проблемах с печенью. А также узнаете об операциях во время беременности. Наши лекции проводятся опытными специалистами в области акушерства и гинекологии, гарантирующими высокую медицинскую компетенцию и понятность материала для всех слушателей. ', 'images/categories/esQNi5Z7Kmltj5P9cllspkSDVV4BPV-metacGV4ZWxzLXRoaXJkbWFuLTc2NTk1NjQuanBn-.jpg', 1, '2023-05-12 08:40:49', '2023-06-29 08:56:08'),
(66, 50, 'Здоровье мамы', 'zdorove-mamy', '<p>Наши лекции на тему \"Здоровье мамы\" включают в себя наиболее важные темы, связанные с беременностью и здоровьем мамы. Вы сможете узнать о различных эндокринных нарушениях и об их влиянии на беременность. Кроме того, мы также обсудим симптомы, на которые стоит обратить внимание, чтобы своевременно предотвратить возможные осложнения.</p>', 'Наши эксперты поделятся секретами успешной беременности и опытом прохождения беременности при наличии таких состояний, как миома матки и ВПЧ-инфекция. Вы узнаете о свертываемости крови у мамы и о том, какое влияние имеет отрицательный резус фактор на беременность.\n\nМы также обсудим противопоказания и ограничения, которые необходимо учитывать во время беременности, а также о беременности и родах после ЭКО. Наши эксперты ответят на многочисленные вопросы, касающиеся правильного питания беременной.\n\nТаким образом, посещение наших лекций на тему \"Здоровье мамы\" позволит вам получить полное представление о вашем состоянии и о самых актуальных вопросах, связанных с беременностью и здоровьем мамы.', 'images/categories/b7oLM3bese8arU3KLvID3L8HIaKf5C-metaOCAoMikuanBn-.jpg', 1, '2023-05-12 08:41:24', '2023-06-29 08:56:59'),
(67, 50, 'Здоровье плода', 'zdorove-ploda', '<p>Приглашаем Вас на серию лекций по теме \"Здоровье Плода\", где наши эксперты расскажут об основных этапах развития плода и патологии пуповины.</p>', 'Вы узнаете о том, как плод развивается в утробе матери, о том, какие процессы происходят на разных этапах беременности, а также о том, какие проблемы могут возникнуть на пути здорового развития плода.', 'images/categories/a1rrX7Z5rdGhXtKMeQWjPGplnCTb7T-metaQWRvYmVTdG9ja184MjU2MDkzNi5qcGc=-.jpg', 1, '2023-05-12 08:42:04', '2023-06-29 08:58:11'),
(68, 50, 'Всё о коже мамы', 'vse-o-koze-mamy', '<p>Представляем Вам уникальную серию лекций \"Всё о коже мамы\", которые помогут Вам понять как ухаживать за кожей во время беременности и сохранять её в прекрасном состоянии.</p>', 'В рамках лекций наши специалисты поделятся с Вами информацией об особенностях ухода за кожей беременных женщин, отметят наиболее распространённые проблемы, такие как растяжки, акне, зуд кожи, розацеа и другие трудности. Также поговорим о том какие beauty процедуры разрешено делать во время беременности, а какие нет.\n\nВы получите ценные рекомендации и инструменты для ухода за кожей, которые помогут Вам сохранить кожу молодой, здоровой и упругой на протяжении всей беременности.', 'images/categories/NLvILBBf0XytMlpukHcHlo23hY2uZ5-metaNi5qcGc=-.webp', 1, '2023-05-12 08:42:25', '2023-06-29 08:59:01'),
(69, 50, 'Скрининги и обследования', 'skriningi-i-obsledovaniia', '<p>Приглашаем Вас на уникальную серию лекций \"Скрининги и обследования\", которые помогут Вам понять, почему тщательное медицинское наблюдение является настолько важным во время беременности.</p>', 'Наши эксперты расскажут о скринингах и обследованиях, которые помогут Вам контролировать здоровье ребенка и свое здоровье во время беременности. Вам предоставятся полезные советы о том, как и когда лучше проходить скрининги, и о том, каких специалистов нужно посетить в этот период.', 'images/categories/I8xYEVoq4yXK1BByP0KPZerEQVYiqH-metacGV4ZWxzLXJkbmUtc3RvY2stcHJvamVjdC02MTI5MDQzLmpwZw==-.jpg', 1, '2023-05-12 08:42:42', '2023-06-29 09:00:21'),
(70, 50, 'Здоровье интимной зоны', 'zdorove-intimnoi-zony', '<p>Приглашаем Вас на уникальную серию лекций \"Здоровье интимной зоны\", которая поможет Вам узнать больше об особенностях ухода за интимной зоной, предотвращении рисков заболеваний и восстановлении здоровья.</p><p><br></p>', 'Наши эксперты расскажут о вульвовагинитах, зуде, швах и разрывах на промежности и методах их лечения и профилактики. Вы узнаете об интимной гимнастике и как она способна укрепить мышцы интимной зоны, которые помогут в предотвращении подтекания мочи и повышением качества сексуальной жизни.', 'images/categories/R67IpXWquheDzsW19aZM46Sp008ZA5-metaQWRvYmVTdG9ja180Mjc0ODk5ODcuanBn-.jpg', 1, '2023-05-12 08:42:59', '2023-06-29 09:01:10'),
(71, 4, 'Вакцинация', 'vakcinaciia', '<p>В данной категории лекций будет рассказано о важности вакцинации как для индивидуального здоровья, так и для здоровья общества в целом. Вы узнаете, как работают вакцины и какие болезни они предотвращают. Также мы обсудим некоторые общие мифы о вакцинации и ответим на вопросы о возможных побочных эффектах.</p>', NULL, 'images/categories/DBC0W564LpqAQwKSAUWJ8GvAO2KGKy-metacGV4ZWxzLW5hdGFsaXlhLXZhaXRrZXZpY2gtMTExMTExMTExMTExMTExMTExMS5qcGc=-.jpg', 1, '2023-05-12 08:43:27', '2023-06-29 08:37:48'),
(72, 4, 'Аллергия и кожные заболевания', 'allergiia-i-koznye-zabolevaniia', '<p>Данная подкатегория лекций посвящена изучению аллергии и кожных заболеваний, включая такие проблемы, как себорея, акне, опрелости, пеленочный дерматит, аллергия и атопический дерматит. Вы узнаете о причинах возникновения этих заболеваний, эффективных методах их лечения и профилактики. Наши лекторы - профессионалы, имеющие большой опыт работы в данной области, и готовы поделиться с вами своими знаниями и секретами. Присоединяйтесь к нам, чтобы получить доступ к актуальной информации!</p>', NULL, 'images/categories/5v4wRN6yQGCogC55WWPvP82k1QcwiY-metaQWRvYmVTdG9ja18yNzg5NjQ1NjEuanBn-.jpg', 1, '2023-05-12 08:43:45', '2023-10-16 23:30:58'),
(73, 4, 'Как и чем накормить ребенка?', 'kak-i-cem-nakormit-rebenka', '<p>Данная подкатегория лекций поможет родителям разобраться в вопросах питания детей и включает в себя лекции по всему, что связано с кормлением малышей: прикорм, детские смеси, выбор и использование аксессуаров для кормления и многое другое. Вам предоставятся полезные советы и рекомендации от опытных специалистов в этой области, чтобы обеспечить вашему ребенку полноценное и здоровое питание.&nbsp;</p>', NULL, 'images/categories/TKjWkZswIFoT2sFnVDqzlQEUZz5ES7-metaNTdfMi5qcGc=-.jpg', 1, '2023-05-12 08:44:21', '2023-06-29 08:43:56'),
(74, 4, 'Здоровье вашего ребенка', 'zdorove-vasego-rebenka', '<p>Приглашаем родителей на увлекательную серию лекций о здоровье вашего малыша! В рамках данной подкатегории мы рассмотрим такие важные темы, как колики и мифы вокруг них, поговорим о прорезывании зубов у ребенка, а также ответим на вечный вопрос - нужно ли пеленать новорожденного. Наши опытные спикеры не только расскажут о наиболее актуальных вопросах, но и дадут рекомендации, как справиться с неприятными симптомами и сохранить здоровье вашего малыша на долгие годы вперед. Присоединяйтесь к нам и получайте необходимую информацию, которая поможет вам стать самым лучшим родителем для вашего малыша!</p>', NULL, 'images/categories/8DirsG6o8AUeoGurXHQ8w1ovYZqMxp-metaMzcuanBn-.jpg', 1, '2023-05-12 08:45:08', '2023-06-29 08:45:18'),
(75, 4, 'Развитие малыша', 'razvitie-malysa', '<p>Подкатегория лекций \"Развитие малыша\" предназначена для родителей, которые хотят больше узнать о том, как помочь своему ребенку развиваться.</p>', NULL, 'images/categories/GGrcI46eovOum2tzPeDKCDbDzcYdc9-metacGV4ZWxzLW5hdGFsaXlhLXZhaXRrZXZpY2gtNDY0MjI1My5qcGc=-.jpg', 1, '2023-05-12 08:45:28', '2023-06-29 08:48:56'),
(76, 4, 'Безопасность ', 'bezopasnost', '<p>Лекции на тему \"Безопасность\" - это уникальная возможность узнать о том, как обезопасить своего ребенка в различных ситуациях. Наши квалифицированные лекторы расскажут вам об основных правилах безопасности для детей разных возрастов</p>', NULL, 'images/categories/UI7hjgg4oeETC4LlEn0BhZyTtGV70I-metaNTRfMy5qcGc=-.jpg', 1, '2023-05-12 08:45:47', '2023-06-29 08:50:37'),
(77, 4, 'Гигиена', 'gigiena', '<p>Подкатегория лекций на тему Гигиена - это уникальная возможность узнать о том, как правильно ухаживать за ребенком и обеспечить ему свежесть, чистоту и здоровье.&nbsp;</p>', NULL, 'images/categories/nJ0K2uGZSGYc4mk4wbDzLNRvmpfzCZ-metacGV4ZWxzLWNvdHRvbmJyby1zdHVkaW8tNzA4NjIzMy5qcGc=-.jpg', 1, '2023-05-12 08:46:00', '2023-06-29 08:51:52'),
(78, 4, 'Сон малыша', 'son-malysa', '<p>Подкатегория лекций на тему \"Сон малыша\" представляет собой неоценимый инструмент для родителей, желающих узнать, как помочь своим детям получить качественный и полноценный отдых.&nbsp;</p>', 'На лекциях мы рассмотрим, какой сон необходим для вашего ребенка в зависимости от его возраста, а также рассмотрим наиболее эффективные методы создания безопасного места для сна вашего малыша. Вы узнаете, какие ошибки могут привести к недостатку сна и какие меры предпринять, чтобы ваш ребенок мог полноценно отдохнуть. ', 'images/categories/LSBrdFwWQawNbJ6zuymSvFvKluymnW-metacGV4ZWxzLXR1LW5ndXllbi04Nzk0NjIwLmpwZw==-.jpg', 1, '2023-05-12 08:46:13', '2023-06-29 08:52:53'),
(79, 4, 'Прогулки', 'progulki', '<p>Данная категория лекций - идеальное решение для родителей, которые хотят научиться создавать комфортные условия для прогулок своих детей в любую погоду.&nbsp;</p>', 'Вы узнаете, как правильно одевать малыша в зависимости от погоды, чтобы обеспечить ему комфорт и безопасность во время прогулки. На этих лекциях вы также получите советы по выбору правильной одежды и обуви для малыша, а также узнаете, как выбрать подходящие аксессуары, которые помогут защитить вашего ребенка от непогоды. Не откладывайте на завтра то, что можете узнать уже сегодня - присоединяйтесь к нашим лекциям', 'images/categories/m708vKp2FY5sd1js2FmKLsAiyOo695-metacGV4ZWxzLWVsaW5hLWZhaXJ5dGFsZS00NTQzNjc0LmpwZw==-.jpg', 1, '2023-05-12 08:46:29', '2023-06-29 08:55:10'),
(80, 38, 'Как забеременеть?', 'kak-zaberemenet', '<p>Подкатегория лекций на тему \"Как забеременеть\" поможет вам разобраться в тонкостях процесса зачатия и максимально подготовиться к этому важному этапу жизни. На этих лекциях вы узнаете о том, какие факторы могут повлиять на вероятность зачатия, а также какие шаги необходимо предпринять, чтобы повысить эти шансы.</p>', 'Доступ к материалам ограничен одним видео в сутки. Доступ к остальным видео в других разделах не зависит от данного ограничения.', 'images/categories/fUdAT4oi3s8HXjsglu0iZBTNBxVibT-metacGV4ZWxzLWFuYS1tYXJpYS1tb3Jvei0xNzAwNzY4MDAuanBn-.jpg', 0, '2023-05-12 08:47:33', '2023-06-13 09:00:55');
