(1, '[{\"data\": {\"text\": \"Меня зовут\", \"description\": null, \"field_text_1\": \"Имя\", \"field_text_2\": \"Фамилия\"}, \"type\": \"question-type-two-text-field\"}, {\"data\": {\"text\": \"Дата составления плана родов\", \"field_date\": null, \"description\": null}, \"type\": \"question-type-one-date-field\"}, {\"data\": {\"text\": \"Предполагаемая дата родов\", \"field_date\": null, \"description\": null}, \"type\": \"question-type-one-date-field\"}, {\"data\": {\"text\": \"Мой рост, см\", \"description\": \"Введите рост в см\", \"field_text_1\": null}, \"type\": \"question-type-one-number-field\"}, {\"data\": {\"text\": \"Мой вес, кг\", \"description\": \"Введите свой вес в кг\", \"field_text_1\": null}, \"type\": \"question-type-one-number-field\"}, {\"data\": {\"text\": \"Пожалуйста, обратите внимание что:\", \"answers\": [{\"data\": {\"text\": \"У меня есть заболевание сердца\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"У меня есть заболевание глаз\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"У меня сахарный диабет\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"У меня резус отрицательная кровь\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"У меня стрептококк группы В (St.agalactiae)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"У меня нет никаких заболеваний, влияющих на беременность\"}, \"type\": \"answer\"}], \"description\": \"Выберите все то, что соответствует Вам, добавьте свой вариант\"}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Моя группа крови\", \"answers\": [{\"data\": {\"text\": \"Первая группа - I (0)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Вторая группа - II (A)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Третья группа - III (B)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Четвертая группа - IV (AB)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Я не знаю\"}, \"type\": \"answer\"}], \"description\": \"Выберите свой вариант\"}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Мой резус-фактор (Rh) крови\", \"answers\": [{\"data\": {\"text\": \"Положительный Резус-фактор (Rh)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Отрицательный Резус-фактор (Rh)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Я не знаю\"}, \"type\": \"answer\"}], \"description\": \"Выберите свой вариант\"}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Мой город\", \"description\": \"Введите название города где Вы живете (или ближайшего к Вам)\", \"field_text_1\": null}, \"type\": \"question-type-one-text-field\"}, {\"data\": {\"text\": \"Я наблюдаюсь в женской консультации №\", \"description\": \"Введите номер женской консультации и ее адрес\", \"field_text_1\": null}, \"type\": \"question-type-one-text-field\"}, {\"data\": {\"text\": \"Лечащий врач в ЖК\", \"description\": \"Введите ФИО лечащего врача\", \"field_text_1\": null}, \"type\": \"question-type-one-text-field\"}, {\"data\": {\"text\": \"Мой выбор родильного дома\", \"answers\": [{\"data\": {\"text\": \"Я еще не определилась\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Я знаю свой роддом\"}, \"type\": \"answer\"}], \"description\": \"Выберите один из вариантов и впишите название родильного дома в свой вариант\"}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Кто примет мои роды?\", \"answers\": [{\"data\": {\"text\": \"Я еще не определилась\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Я знаю своего врача\"}, \"type\": \"answer\"}], \"description\": \"Впишите фамилию и инициалы врача акушера -гинеколога у которого Вы планируете рожать\"}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"<p><strong>Я прошу </strong>выслать индивидуальный План родов на указанную ниже электронную почту.&nbsp;</p>\"}, \"type\": \"textarea\"}, {\"data\": {\"text\": \"Мой E-mail адрес\", \"description\": null, \"field_text_1\": null}, \"type\": \"question-type-one-text-field\"}, {\"data\": {\"text\": \"<p><strong>Внимательно заполняйте свою электронную почту - на указанный адрес будет выслан Ваш индивидуальный План родов!</strong></p>\"}, \"type\": \"textarea\"}]', 'Мои данные', 2),
(2, '[{\"data\": {\"text\": \"Мне предстоят роды:\", \"answers\": [{\"data\": {\"text\": \"Физиологические роды\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Плановое Кесарево сечение\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Затрудняюсь ответить\"}, \"type\": \"answer\"}], \"description\": \"Выберите один из вариантов\"}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Во время родов мне бы хотелось, чтобы...\", \"answers\": [{\"data\": {\"text\": \"...играла музыка\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \" ...был приглушенный свет\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \" ...в комнате было тихо, насколько это возможно\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \" ...как можно меньше меня беспокоили\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...можно было носить свою одежду\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \" ...носить контактные линзы все время\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...кушать и пить то, что разрешит лечащий врач\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...количество осмотров соответствовало протоколу\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \" ...были осмотры только личным доктором и акушеркой\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...можно было снимать фото и видео с моим партнером\"}, \"type\": \"answer\"}], \"description\": \"Выберите то, что Вам нравится...\"}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Я хочу провести первый этап родов:\", \"answers\": [{\"data\": {\"text\": \"...сидя\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...лежа\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...в душе\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...в ванной\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...гуляя в родильном боксе\"}, \"type\": \"answer\"}], \"description\": \"Выберите то, что Вам нравится...\"}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Мне не нужны\", \"answers\": [{\"data\": {\"text\": \"клизма\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"бритье лобковой области\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"мочевой катетер\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"компрессионные чулки\"}, \"type\": \"answer\"}], \"description\": \"Следует учесть что к проведению манипуляций могут появиться медицинские показания.\"}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Для облегчения боли я хотела бы применить: Выберите то, что Вам нравится..\", \"answers\": [{\"data\": {\"text\": \"Акупунктуру\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Дыхательные методы\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Термотерапию (холод и тепло)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Ароматерапию\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Массаж\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Медитацию\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Гипноз\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Рефлексотерапию\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Стандартную эпидуральную анестезию\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Все, что предлагается во время родов\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Я не хочу снимать боль\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Затрудняюсь в выборе метода снижения болевых ощущений\"}, \"type\": \"answer\"}], \"description\": \"Выберите один или несколько ответов\"}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Во время потуг я хотела бы:\", \"answers\": [{\"data\": {\"text\": \"...лежать на полу\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...лежать на боку\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...опираться на руки и колени\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...стоять\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...лечь на моего партнера\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...опираться на партнера для поддержки ног\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...держать за руку своего партнера\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы партнер находился рядом\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...применять родильный стул\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \" ...находиться в родильной ванне\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...быть в душе\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...наклоняться\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...использовать свободное поведение\"}, \"type\": \"answer\"}], \"description\": \" Выберите то, что Вам нравится..\"}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Когда ребенок будет рождаться, я хотела бы, чтобы\", \"answers\": [{\"data\": {\"text\": \"...ребенок родился самостоятельно\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...можно было бы использовать зеркало, чтобы увидеть головку ребенка\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...избегали необоснованного использования акушерских щипцов\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...избегали вакуумную экстракцию\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...применяли любые необходимые методы по решению врача\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...помогли принять малыша\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...мой партнер принял малыша\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Я бы хотела, чтобы эпизиотомия...\", \"answers\": [{\"data\": {\"text\": \"...применялась только после массажа промежности\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...выполнялась только в крайнем случае по медицинским показаниям\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...выполнялась тогда, когда считает нужным мой лечащий врач\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...выполнялась в необходимый момент\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...выполнялась без местной анестезии с последующей местной анестезией при зашивании\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Я пока не знаю ответа на этот вопрос\"}, \"type\": \"answer\"}], \"description\": \"Эпизиотомия - хирургическое рассечение промежности во избежания разрывов и возможных черепно-мозговых травм ребенка.\"}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Если понадобится экстренное кесарево сечение, я хотела бы...\", \"answers\": [{\"data\": {\"text\": \"...услышать второе мнение\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...убедиться, что все другие варианты были исчерпаны\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...оставаться в сознании\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы мой партнер оставался со мной все время\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...прикоснуться к ребенку после его рождения\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы доктор во время операции объяснял, что происходит\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы мой партнер как можно скорее взял ребенка на руки\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...кормить грудью в операционной палате\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"В случае оперативного родоразрешения, я хотела бы, чтобы приносили ребенка...\", \"answers\": [{\"data\": {\"text\": \"...на весь день\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...на кормление\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...в любое время по моей просьбе\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}]', 'Мои пожелания о родах', 3),
(3, '[{\"data\": {\"text\": \"Вы хотите поддержки близких во время родов?\", \"answers\": [{\"data\": {\"text\": \"В первый период родов\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"В период потуг\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Сразу после родов\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"На всех периодах родов\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Я не хочу присутствия никого во время родов кроме медперсонала\"}, \"type\": \"answer\"}], \"description\": \"В какой период родов Вы хотите присутствия - выберите свой вариант.\"}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Я хочу, чтобы на родах присутствовали:\", \"answers\": [{\"data\": {\"text\": \"Муж (Партнер)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \" Доула \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Родители (Родственники) \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Подруга\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Я не хочу чтобы близкие присутствовали на родах\"}, \"type\": \"answer\"}], \"description\": \"Кого Вам хотелось бы видеть у себя на родах?\"}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Я хочу, чтобы мой партнер прошел\", \"answers\": [{\"data\": {\"text\": \"Хочу чтобы партнер прошел Симулятор схваток\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Это ему ни к чему\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Он отказывается\"}, \"type\": \"answer\"}], \"description\": \"Симулятор схваток позволит Вам поделиться своими ощущениями в родах со своим партнером. Симулятор абсолютно безвреден и дает достаточные  ощущения, которые испытывает женщина во время схваток!\"}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Я хочу, чтобы указанные выше лица\", \"answers\": [{\"data\": {\"text\": \"Могли в любое время посетить меня в послеродовом отделении\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Находились постоянно со мной в послеродовом отделении\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Я не хочу посещений в послеродовом отделении\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"<p>Кому можно сообщать информацию о состоянии моем и моего ребенка? Укажите ниже.<br><strong>Если Вы не заполните данные поля - мы никому не сообщим информацию о Вас.</strong></p>\"}, \"type\": \"textarea\"}, {\"data\": {\"text\": \"ФИО первого человека\", \"description\": null, \"field_text_1\": \"Фамилия\", \"field_text_2\": \"Имя\", \"field_text_3\": \"Отчество\"}, \"type\": \"question-type-three-text-field\"}, {\"data\": {\"text\": \"Телефон первого человека\", \"description\": null, \"field_text_1\": null}, \"type\": \"question-type-one-text-field\"}, {\"data\": {\"text\": \"ФИО второго человека\", \"description\": null, \"field_text_1\": \"Фамилия\", \"field_text_2\": \"Имя\", \"field_text_3\": \"Отчество\"}, \"type\": \"question-type-three-text-field\"}, {\"data\": {\"text\": \"Телефон второго человека\", \"description\": null, \"field_text_1\": null}, \"type\": \"question-type-one-text-field\"}, {\"data\": {\"text\": \"ФИО третьего человека\", \"description\": null, \"field_text_1\": \"Фамилия\", \"field_text_2\": \"Имя\", \"field_text_3\": \"Отчество\"}, \"type\": \"question-type-three-text-field\"}, {\"data\": {\"text\": \"Телефон третьего человека\", \"description\": null, \"field_text_1\": null}, \"type\": \"question-type-one-text-field\"}, {\"data\": {\"text\": \"Какую палату Вы бы хотели в послеродовом периоде?\", \"answers\": [{\"data\": {\"text\": \"Одноместную палату\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Двухместную палату\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"\\\"Семейную\\\" палату с постоянным пребыванием близкого человека\"}, \"type\": \"answer\"}], \"description\": \"Выберите свой вариант. Учтите, что совместное присутствие близких возможно только в палатах повышенного комфорта.\"}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Я бы хотела, чтобы мой сопровождающий вел фото/видео съемку\", \"answers\": [{\"data\": {\"text\": \"Да\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Нет\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Хочу пригласить профессионального фотографа\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-radio\"}]', 'Спутники в родах', 4),
(4, '[{\"data\": {\"text\": \"Сразу после рождения, я хотела бы:\", \"answers\": [{\"data\": {\"text\": \"...чтобы пуповину пересекли после того, как она отпульсирует\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы произвели забор пуповинной крови\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы плацента родилась без посторонней помощи\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы партнер перерезал пуповину\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...увидеть плаценту до того как ее унесут\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы выполнили гистологическое исследование плаценты\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Я бы хотела, чтобы ребенка выложили мне на живот\", \"answers\": [{\"data\": {\"text\": \"...сразу после рождения\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...после отсасывания слизи\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...после взвешивания\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...перед тем, как обтирать и пеленать, обрабатывать глаза\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...не знаю\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Я бы хотела приложить ребенка к груди...\", \"answers\": [{\"data\": {\"text\": \"...в кратчайшие сроки после рождения\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...перед тем, как врач-неонатолог будет проводить осмотр\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...позже\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...никогда\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Я знаю для чего необходим ранний контакт с ребенком\", \"answers\": [{\"data\": {\"text\": \"...происходит заселение \\\"родной микрофлорой\\\" ребенка от мамы (родителей)\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...стимуляция выработки грудного молока\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...ранняя адаптация ребенка к окружающей среде\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...создание психологического контакта матери и ребенка\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...в случае партнерских родов - укрепление связи между партнерами\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...я пока не знаю ответа на этот вопрос\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Я бы хотела, чтобы члены моей семьи\", \"answers\": [{\"data\": {\"text\": \"...могли посетить меня и малыша в послеродовом отделении\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...имели возможность посещения после рождения\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...могли узнать в любое время о состоянии ребенка и меня по телефону\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Я бы хотела, чтобы все манипуляции и процедуры с моим ребенком...\", \"answers\": [{\"data\": {\"text\": \"...выполнялись в моем присутствии\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...выполнялись только после того, как нас объединят с ребенком\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...выполнялись в присутствии моего партнера\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...скрининги новорожденного провели в роддоме\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы сделали прививку от туберкулеза\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы ввели витамин К\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...чтобы сделали прививку от гепатита В\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Прошу не давать моему ребенку - \", \"answers\": [{\"data\": {\"text\": \"...смесь \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...бутылку с соской \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...успокоительных средств\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Я хочу кормить своего ребенка: \", \"answers\": [{\"data\": {\"text\": \"...только грудным молоком\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...только смесью\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...по требованию \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...по графику\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...с помощью специалиста по грудному вскармливанию\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"Я бы хотела, чтобы малыш оставался в моей комнате... \", \"answers\": [{\"data\": {\"text\": \"...все время \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...в течение дня \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...только когда я не сплю \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...только для кормления \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...только когда я попрошу\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Я бы хотела, чтобы в моей комнате была видеосвязь с моими родными\", \"answers\": [{\"data\": {\"text\": \"Хочу видеосвязь\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Не хочу видеосвязи\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"Не определилась с ответом\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"После родов я хотела бы остаться в роддоме\", \"answers\": [{\"data\": {\"text\": \"...как можно меньше \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...как можно больше \"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...столько сколько понадобиться\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-radio\"}, {\"data\": {\"text\": \"Если моему ребенку потребуются реанимационные мероприятия, я хотела бы... \", \"answers\": [{\"data\": {\"text\": \"...сопровождать его в отделение реанимации или другое учреждение\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...обеспечить ребенка сцеженным грудным молоком для грудного вскармливания\"}, \"type\": \"answer\"}, {\"data\": {\"text\": \"...как можно больше находиться с ребенком, насколько это возможно\"}, \"type\": \"answer\"}], \"description\": null}, \"type\": \"question-type-checkbox\"}, {\"data\": {\"text\": \"<p>Подробнее об этом можно посмотреть в лекции по ссылке&nbsp;</p>\"}, \"type\": \"textarea\"}]', 'Мой ребенок', 5),
(6, '[{\"data\": {\"text\": \"<p><strong>&nbsp;Создайте свой, индивидуальный План родов!</strong></p><p>&nbsp;В процессе подготовки Плана Вы сформируете свои желания, подготовитесь к Дню рождения своего ребенка. Свой План родов Вы можете править, уточняя детали.&nbsp;</p><p>Обязательно покажите свой План лечащему врачу и обсудите все детали, внесите изменения в план после консультаций.</p><p>Выберите в каждом пункте то, что соответствует Вашим пожеланиям или впишите свой вариант.&nbsp;</p><p>В случае если Вы не определились с ответом - пропустите этот пункт - Вы сможете вернуться к нему позже, перейдя по ссылке Плана, присланного Вам на указанную электронную почту.</p><p>Сверху будет виден процент готовности Вашего Плана родов - в зависимости от количества заполненных полей.</p><p>Настоятельно рекомендуем составлять план родов на компьютере - Вам будет удобнее видеть все на большом экране!</p><p>В конце заполнения Вам будет представлен результат - он будет выведен на экран и отправлен на указанный Вами адрес электронной формы.&nbsp;</p><p><strong>Обязательно заполните максимально все поля на всех страницах - чем подробнее Вы ответите тем более детальным будет Ваш План.</strong></p><p>С уважением, Школа Мам и Пап \\\"Нежность\\\"</p>\"}, \"type\": \"textarea\"}]', 'Вводная часть', 1);
